INSERT INTO `animes` VALUES (1,'Reideen the Superior - Chouja Raideen','-reideen-the-superior-chouja-raideen','Hishou, Ginga, Ace, Hayate, and Ikazuchi all work at a studio doing various idol-related jobs at the request of their manager, Reiko. But in reality, these five teenagers are actually the Reideens, a group of superheroes who fight the Super Devils sent by Lushu, a mysterious being. Little do the Reideens know, these Super Devils are being sent for a more important purpose...Source: ANN',1996,'Adventure, Mecha, Sci-Fi, Shounen','Completed'),(2,'Senran Kagura OVA','-senran-kagura-ova','A letter arrives at Death Cram School. Inside is a an invitation to a spa resort. Yumi declares to the four excited girls that, &quot;No. This is evil itself,&quot; points out that they are slacking off too much. Shiki proposes, &quot;When opinions are divided, it&#039;s time for boob rock-paper-scissors!&quot; and then wins so they all go to the pool. There, girls from Hanzoo Academy, Homura Crimson Squad, and Hebijo Clandestine Girls&#039; Academy also come, but Asuka says, &quot;Let&#039;s have fun together today&quot; and they call a temporary truce. However, a trivial matter sets off a sour quarrel and, at Yumi&#039;s suggestion, they settle it with a showdown in the style of the ancient shinobi.',2015,'Action, Comedy, Ecchi','Completed'),(3,'?Maria-sama ga Miteru Haru 2nd','-maria-sama-ga-miteru-haru-2nd','Life goes on for the ladies in the Yamayurikai. On the one-year anniversary of Sachiko and Yumi becoming sisters, Yumi receives a difficult task from Sachiko: to finally acknowledge someone as her younger sister.   ',2006,'Drama, School, Shounen Ai, Slice of Life','Completed'),(4,'?Marmalade Boy Movie','-marmalade-boy-movie','Miki Koishikawa lived a normal life – until her parents tell her they’ll get divorced.. She doesn’t agree, until she meets Yuu Matsuura… the handsome son of another couple, with whom her parents are switching spouses. They all live together now in an enormous house, and Miki and Yuu find themselves falling in love.    They’ll have to struggle with their own feelings, other people who want to be with them, and whatever Lady Luck and Fate throws in their ways…',1995,'Romance, Shoujo','Completed'),(5,'.Hack//G.U. Returner','hackgu-returner','hack//G.U. Returner is a single-episode OVA offered to fans who completed all three GU Games, featuring characters from the .hack//G.U. Games and .hack//Roots.',2007,'Adventure, Drama, Game, Harem, Martial Arts, Seinen','Completed'),(6,'.hack//G.U. Trilogy','hackgu-trilogy','Based on the CyberConnect2 HIT GAME, now will be released in a CG Movie!    The Movie will be placed in the storyline of each .hack//G.U. games trilogy. The story follows Haseo, a player in the online MMORPG called The World:R2 at first depicted as a PKK (Player Killer Killer) known as the &quot;Terror of Death&quot;, a former member of the disbanded Twilight Brigade guild. Haseo encounters Azure Kite (believing him to be Tri-Edge and blaming him for what happened to Shino) but is hopelessly outmatched. Azure Kite easily defeats Haseo and Data Drains him, reducing his level from 133 to 1 and leaving him without any items, weapons, or member addresses. He is left with a mystery on his hands as to the nature of the Data Drain and why Azure Kite is in possession of such a skill.    Eventually Haseo gains the &quot;Avatar&quot; of Skeith. Acquiring the ability to call Skeith and wield his abilities, such as Data Drain. With Skeith as his strength, Haseo begins the quest for a way to save Shino.    He is seen seeking out a PK (Player Killer) known as Tri-Edge, whose victims supposedly are unable to return to The World after he PKs them. Haseo&#039;s friend, Shino, was attacked six months prior to the events of the game by Tri-Edge, and the player herself, Shino Nanao, was left in a coma.',2008,'Action, Game, Harem, Seinen','Completed'),(7,'.hack//Legend of the Twilight','hacklegend-of-the-twilight','.hack//Legend of the Twilight',2003,'Adventure, Comedy, Fantasy, Sci-Fi, Shounen','Completed'),(8,'.hack//Liminality','hackliminality','The story follows three girls, Mai Minase, Yuki Aihara, and Kyoko Tohno, and a former CC Corp. director of the Japanese version of The World, Junichiro Tokuoka. They investigate as to why several people have fallen into a coma while playing the game. The amine starts with the collapse of Mai and her boyfriend, (Tomonari Kasumi). It is soon revealed that she heard a certain sound (which is also present at important points in .hack//Sign) shortly before collapsing. She later wakes up to the same sound, the sound that tunes. “A In C Minor”.    Through the knowledge of all the the characters, the constantly search for the answer to why there have been so many victims due to “The World”. Will they be able to battle something that doesn’t even exist in the real world?  Genre: Action/Science Fiction',2002,'Mystery, Sci-Fi','Completed'),(9,'.hack//Quantum','hackquantum-','Plot Summary: Tobias, Mary, and Sakuya challenge the impregnable “The One Sin”, but they lose their way in the maze and unintentionally trap other guild members. A mysterious cat is watching their blunde',2011,'Action, Adventure, Fantasy, Sci-Fi','Completed'),(10,'.hack//Roots','hackroots','hack//Roots is the prequel to the .hack// videogames. It follows the story of Haseo a member of the Twilight Brigade guild. In the year 2015 the C.C. Corp’s building was burned down, and with it most of the data for “The World” was lost. By mixing the remaining data with that of another game, the C.C. Corp was able to create the game, “The World: R2?, unlike the games before this game allowed player versus player combat. The anime starts when Haseo logs into The World R:2 for the first time and falls victim to the PKers that reside within. He is saved by Ovan, which prompts him to join the Twilight Brigade.    The Twilight Brigade members are on a mission to find the Key of the Twilight, however, the TAN guild opposes. Their current mission is to find the 6 virus cores before TAN does, and Haseo has 2 of them, how will he escape from the TAN Guild, and find the Key of Twilight, which might be the answer to everything.  Genre: Action/Fantasy',2006,'Adventure, Drama, Fantasy, Game, Sci-Fi','Completed'),(11,'.Hack//Sign','hacksign','Taking place 2 years after the “Pluto’s Kiss” crisis. “The World” once again returns. This time being the only PC game in existence. Tsubasa a boy who started playing only a few weeks before, finds himself taken to a mysterious zone, where he meets Aura, Morganna, and a mysterious player that has the appearance of a cat. Soon after realizing that he can’t logout, he is forced to stay in “The World”, but unlike other characters he can still feel pain, he still has his emotions.    He slowly separates himself from those who try to help him, the only ones that can help him. His friends Bear and Black Rose, constantly try to comfort him in his struggle, but he always pushes them away. He only wants to search for the answer to why he can’t logout, and to the real question of who he really is.  Genre: Adventure/Mystery/Fantasy',2002,'Adventure, Fantasy, Magic, Mystery, Sci-Fi','Completed'),(12,'.hack//The Movie: Sekai no Mukou ni','hackthe-movie-sekai-no-mukou-ni','.hack//The Movie: Sekai no Mukou ni',2012,'Action, Adventure, Fantasy, Game, Mystery, Sci-Fi','Completed'),(13,'009 Re:Cyborg','009-recyborg','Nine regular humans from different parts of the world are abducted and transformed into cyborgs with astounding powers for the purpose of being used as weapons. The nine cyborgs rebel and start to fight against their creators in the name of justice and world peace.    Decades later, the nine cyborgs seem to be untouched by time, but they live in a world where &quot;justice&quot; has as many nuances as the number of people living on the planet. What is their place in the world now?',2012,'Action, Adventure, Mecha, Sci-Fi','Completed'),(14,'009-1','009-1','In an alternate world, the Cold War has continued to persist for 140 years. As a result, the world was divided into two factions: the West Block, and the East Block. As the Cold War drags on, the tension between the two factions, as well as the amount of nuclear weapons they have, rise. Mylene Hoffman is a female cyborg who is a spy for the West Block. Together with three other agents, Mylene partakes in various missions issued by her superiors.  Genres: science fiction Themes: assassins, cold war, Cyborg, Inner Demons, secret agents, spies     ',2006,'Action, Mecha, Sci-Fi','Completed'),(15,'07-GHOST','07-ghost','Out of 500 students in the military academy, only 20 will pass the difficult graduation exam to become begleiters (Assistant Executive Officers). Teito Klein, the chairman’s favorite, is one of them. He is disliked by the other students because of his relations with the chairman and his mysterious past. After Teito and his best from, Mikage, finish the first phase, Teito begins to have strange dreams again about a man. Later on he eavesdrops on people talking about him. During this conversation, Teito recognizes the man in his dreams and another man that killed him. When he is caught he is sent to prison, but escapes with the help of his best friend. Teito left Mikage and was found falling from the sky and unconscious by a group of guys.  Genre: Comedy, Fantasy',2009,'Action, Demons, Fantasy, Military, Shoujo','Completed'),(16,'1001 Nights','1001-nights','Presented in the form of a feverish love dream, 1001 Nights is the first performance of the ground-breaking &quot;Filmharmonic&quot; series, which presents new orchestral works by film composers in tandem with short films made by A-list directors. Nights is the series&#039; only animated work, and plans originally called for the film to be completely computer animated.',1999,'Demons, Fantasy','Completed'),(17,'11eyes','11eyes-','Satsuki Kakeru lost his sister by suicide and has been living a dull life ever since then. One day, he is transported into a bizarre world “Red Night” along with his friend Minase Yuka. In order to survive and escape from Red Night, he fights against Dark Spirits (Ralva) and Black Nights  Genres: action, fantasy, romance Themes: Harem',2009,'Action, Ecchi, Super Power, Supernatural','Completed'),(18,'12-sai.: Kiss, Kirai, Suki','12-sai-kiss-kirai-suki','The story begins with Hanahi, a sixth-grade girl who is neither an adult nor a child. She deals with issues such as accidentally witnessing her homeroom teacher kissing, and worrying about experiencing physiological changes before her friends. The manga depicts a 12-year-old girl&#039;s innocent worries and first love.',2014,'Romance, School, Shoujo','Completed'),(19,'2 x 2 Shinobuden','-2-x-2-shinobuden','Shinobu is a naive ninja-in-training. In order to test her ninja abilites, she must steal the panties of all the high school girls. The first house she stops at is the abode of one Kaede Shiranui, who happens to catch Shinobu in the act. Kaeda is the voice of reason and the two girls become quick friends, despite a round yellow ball-thing who claims to be a ninja master and tries to get in the way of their friendship.  Genre: Comedy',2004,'Comedy, Martial Arts, Parody','Completed'),(20,'3 x 3 Eyes','3-x-3-eyes','3X3 Eyes is the story of a young man named Yakumo Fuuji, who through a strange series of events becomes the immortal slave of the last of a race of 3 Eyed immortals. The immortal absorbs his soul to save his life, making him immortal in the process. Now, he begins a journey with the female immortal in an attempt to find a way of becoming human. Of… more 3X3 Eyes is the story of a young man named Yakumo Fuuji, who through a strange series of events becomes the immortal slave of the last of a race of 3 Eyed immortals. The immortal absorbs his soul to save his life, making him immortal in the process.    Now, he begins a journey with the female immortal in an attempt to find a way of becoming human. Of course, there are many complications along the way, not the least of which being that the immortal is a female with a split personality, one achingly cute and the other being no-nonsense destructive power, and the romances that develop between. less',1991,'Action, Demons, Fantasy, Horror, Romance','Completed'),(21,'30-sai no Hoken Taiiku','30-sai-no-hoken-taiiku','Plot Summary: A guide book teaching shy men around 30 how to date and have sex with wome',2011,'Ecchi, Parody, Romance, Seinen','Completed'),(22,'3000 Leagues in Search of Mother','3000-leagues-in-search-of-mother','Haha wo Tazunete Sanzenri is about an Italian boy, Marco, and his journey in search of his mother. Italy was in a deep depression, so to support her family, Marco`s mother went to Argentina to work as a domestic (like Piccolo`s sons went to America to work in Porco Rosso). But after she wrote to her family that she was sick, her letters stopped coming.    So Marco decides to go to Argentina to look for her. Marco has to travel across Argentina to find her, meeting many wonderful people, and encountering many adventures during his journey.  Genre: Adventure, Drama, Slice of Life',1976,'Adventure, Drama, Slice of Life','Completed'),(23,'5 Centimeters Per Second','5-centimeters-per-second','Part 1 — The Chosen Cherry Blossoms (26 min.): Because of family relocation, Shinohara Akari had to leave Tokyo after graduating from elementary school. The strong feelings between Takaki and Akari keep them in contact, but they worry that they may not meet again. Then, one day, Takaki learns that his family will move from Tokyo to an island in the far south of Japan, so he decides to use this last chance to visit Akari by train...    Part 2 — Cosmonaut (21 min.): Years have passed, and Takaki still writes emails meant for Akari, only to never send them to her. Meanwhile Sumita Kanae, his classmate, has feelings for Takaki, but she does not have the courage to confess her love to him...Part 3 — 5 Centimetres per Second (16 min., mostly a music clip): Takaki is working as computer programmer now, occasionally remembering his former life — and love. And one day, at a railroad crossing, he suddenly passes by a woman who looks familiar to him...',2007,'Drama, Romance, Slice of Life','Completed'),(24,'6 Angels','6-angels','In the near future, the death penalty has been revoked worldwide. Therefore, criminals are sent to an underground prison set in the impact crater of a nuclear site somewhere in the United States, known as Neo Purgatory.    A group of women, known as the Guard of Rose, is caught in the crossfire when the mysterious villain Donn Canyon launches his mission to &quot;purify the world&quot; with radiation...',2001,'Action, Sci-Fi','Completed'),(25,'A Channel','a-channel','Toeru takes a test so she can enter the same high school as Run, the girl she likes. She passes, but when she goes   to tell Run, she finds her hugging a girl she’s never seen before.',2011,'Comedy, School, Seinen, Slice of Life','Completed'),(26,'A Channel Ova','-a-channel-ova-','Toeru takes a test so she can enter the same high school as Run, the girl she likes. She passes, but when she goes   to tell Run, she finds her hugging a girl she’s never seen before.',2012,'Comedy, School, Seinen, Slice of Life','Completed'),(27,'A Channel Special','a-channel-special-','Toeru takes a test so she can enter the same high school as Run, the girl she likes. She passes, but when she goes   to tell Run, she finds her hugging a girl she’s never seen before.',2011,'Comedy, School, Seinen, Slice of Life','Completed'),(28,'A Little Snow Fairy Sugar','a-little-snow-fairy-sugar','Sugar, an apprentice Snow Fairy and her friend Salt and Pepper want to become official Season Fairies who have ability to make wind blow, snow fall, sun shine and something related with weather, they use their special instruments to create and control weather....    Sugar, an apprentice Snow Fairy and her friend Salt and Pepper want to become official Season Fairies who have ability to make wind blow, snow fall, sun shine and something related with weather, they use their special instruments to create and control weather. And just have only one way to become Season Fairies this is to find out the “Twinkles” which will make the magical flowers bloom. But none of them don’t know what a Twinkles is. Having a human girl name is Saga who can see Season Fairy. Saga help Sugar and her friend search for mysterious Twinkles and while trying to perfect their magic.',2001,'Comedy, Fantasy','Completed'),(29,'A Town Where You Live','a-town-where-you-live','A Town Where You Live about three young people name Eba Yuzuki, Kirishima Haruto and Kanzaki Nanami.Eba Yuzuki, a girl from Tokyo moves to countryside to attend high school....    A Town Where You Live about three young people name Eba Yuzuki, Kirishima Haruto and Kanzaki Nanami.Eba Yuzuki, a girl from Tokyo moves to countryside to attend high school.Kirishima Haruto whose father is an apprentice of Eba’s father.Kanzaki Nanami comes whom Haruto might be in love with.When Eba move countryside, she stays in Haruto’ house but he never agree about this. What will happen between them?',2013,'Drama, Romance, Slice of Life','Completed'),(30,'A Wind Named Amnesia','a-wind-named-amnesia','The Apocalypse didn&#039;t come with a BANG. Silently, the amnesia wind swept away all of mankind&#039;s knowledge. Thousands of years of human civilization vanished overnight as people forgot how to use the tools of modern civilization - who they were - how to speak - everything.    Technology decayed as mankind was instantly reduced to level of cavemen.Now, two years later, a young man explores a nation reduced to barbarism - America. Miraculously re-educated after the cataclysm, he is accompanied by a young woman- somehow spared the obliterating effects of the amnesia wind. Pursued by a relentless killing machine, they search for those responsible for stealing their memories.',1990,'Action, Dementia, Drama, Sci-Fi','Completed'),(31,'Aachi and Ssipak','aachi-and-ssipak','In the future, all energy sources are depleted, except human excrements. To reward production, people receive addictive, Popsicle-like Juicybars. Aachi and Ssipak are street hoodlums who struggle to survive by trading black market Juicybars. Through a chain of events involving their porn-director acquaintance Jimmy the Freak, they meet wannabe-actress Beautiful, whose defecations are rewarded by exceptional quantities of Juicybars. For that reason, Beautiful is also wanted by the violent blue mutants known as the Diaper Gang (led by the Diaper King), the police (most notably the cyborg police officer Geko), and others.',2006,'Action, Comedy','Completed'),(32,'Abarenbou Rikishi!! Matsutarou','abarenbou-rikishi-matsutarou','Based on the sports manga series written and illustrated by Chiba Tetsuya about sumo wrestling.  The story follows Sakaguchi Matsutarou, a giant roughneck man with strength far beyond ordinary people. He never uttered words like work hard, strive, and dream like the typical shounen manga protagonist. However, he is stronger than anyone and peerless in sumo wrestling. His greatest weakness is his own carefree personality. He grows into a full-fledged sumo wrestler.',604,'Seinen, Sports','Completed'),(33,'Abenobashi','abenobashi','Imamiya Satoshi, “Sasshi” to his friends, has grown up in the Abenobashi Shopping Arcade in Osaka, along with his childhood friend, Asahina Arumi. Now, all that was stable in his life is in ruins. His family’s bath house has closed and been torn down, and Arumi’s family is moving to Hokkaido – and taking her with them.    In the midst of all this, something happens to the framework of reality, and Sasshi and Arumi slip into a weird parallel world. It’s still Abenobashi, but not their Abenobashi. Strange things are afoot, and Sasshi must find out their meaning, in order to reach a goal that he barely understands.   ',2002,'Comedy, Ecchi, Fantasy, Parody','Completed'),(34,'Absolute Duo','absolute-duo','After losing a loved one, Tooru Kokonoe enrolls at Kouryou Academy so as to gain a &quot;Blaze,&quot; a weapon that is his soul manifestation, for the sake of revenge. He was expecting a weapon... What he got was a shield... How is he to seek revenge with something that isn&#039;t even a weapon?!',2015,'Action, Ecchi, Harem, Romance, School, Supernatural','Completed'),(35,'Accel World','accel-world','One autumn day in 2046, Haruyuki has an encounter with Kuroyukihime, the prettiest girl in his school. For the middle school boy who is often bullied, the meeting changes his life. Through a mysterious piece of software from her, Haruyuki learns of the existence of the virtual Accel World. In that moment, the lowest of the “school caste” becomes “Burst Linker”, a knight defending a princess.',2012,'Action, Romance, School, Sci-Fi, Shounen','Completed'),(36,'Accel World Ova','-accel-world-ova','One autumn day in 2046, Haruyuki has an encounter with Kuroyukihime, the prettiest girl in his school. For the middle school boy who is often bullied, the meeting changes his life. Through a mysterious piece of software from her, Haruyuki learns of the existence of the virtual Accel World. In that moment, the lowest of the “school caste” becomes “Burst Linker”, a knight defending a princess.',2012,'Action, Romance, School, Sci-Fi, Shounen','Completed'),(37,'Accel World Specials','-accel-world-specials','One autumn day in 2046, Haruyuki has an encounter with Kuroyukihime, the prettiest girl in his school. For the middle school boy who is often bullied, the meeting changes his life. Through a mysterious piece of software from her, Haruyuki learns of the existence of the virtual Accel World. In that moment, the lowest of the “school caste” becomes “Burst Linker”, a knight defending a princess.',2012,'Comedy, School, Sci-Fi, Shounen','Completed'),(38,'Acchi Kocchi','acchi-kocchi','Acchi Kocchi follows the misadventures, screw ups, and idiocy of 5 schoolmates: Io, Tsumiki, Hime, Mayoi, and Sakaki.',1962,'Dementia','Completed'),(39,'Acchi Kocchi: Place=Princess','acchi-kocchi-place-princess','Bonus Episode 13 of Acchi Kocchi that was included on BRD/DVD volume 6.',0,'Slice of Life','Completed'),(40,'Aeon Flux','aeon-flux','Aeon Flux is a mysterious and amoral secret agent from the country of Monica. Her motives or background are left unexplained, as are those of her antagonist/love, Trevor Goodchild. On her missions, she deals swift, bloody “justice” to all that oppose her.',0,'','Completed'),(41,'Afro Samurai','afro-samurai','his father in front of him when he was just a boy, a three-armed gunman who is the lord of the dark swordsman’s road and the current No. 1.',2007,'Action, Samurai','Completed'),(42,'Afro Samurai: Resurrection','afro-samurai-resurrection','Afro Samurai (Academy Award ® nominee Samuel L. Jackson) avenged his father and found a life of peace. But the legendary master is forced back into the game by a beautiful and deadly woman from his past.    The sparks of violence dropped along Afro&#039;s bloody path now burn out of control - and nowhere are the flames of hatred more intense than in the eyes of Sio (Lucy Liu: Kill Bill). She won&#039;t quit until Afro is schooled in the brutal lessons he dealt those who stood in his way. There&#039;s no such thing as final vengeance. The cycle of bloodshed spinning around the Number One Headband must roll on.',2009,'Action, Samurai','Completed'),(43,'Agent Aika','agent-aika','Aike, one of people who are hired to search the valuable information or artifacts for remnants of sunken Tokyo. An earthquake set in  the not-too-distant future, has pushed Tokyo under the waves and many people are making a living as “salvagers”....    Aike, one of people who are hired to search the valuable information or artifacts for remnants of sunken Tokyo. An earthquake set in  the not-too-distant future, has pushed Tokyo under the waves and many people are making a living as “salvagers”. She teamed up with her employer’s daughter and armed with a magical golden bustier, she searches the ocean for profit and adventure.',1997,'Action, Adventure, Comedy, Ecchi, Sci-Fi','Completed'),(44,'Ah! My Goddess','ah-my-goddess','Morisato Keiichi is a down on his luck college student. Although possessing a diligent and generous nature, he had the misfortune of being born under an unlucky star. As a result, the current state of his life is somewhat unenviable. All that is about to change, however, as Heaven has taken notice of his plight. A goddess, Belldandy, is despatched to Earth to grant Keiichi one wish.    One wish, be it unlimited power, wealth, or his fondest desire. And his wish? ‘I wish that a goddess like you will stay with me forever.’',1997,'Action, Adventure, Comedy, Ecchi, Sci-Fi','Completed'),(45,'Ah! My Goddess OVA','-ah-my-goddess-ova','Morisato Keiichi is a down on his luck college student. Although possessing a diligent and generous nature, he had the misfortune of being born under an unlucky star. As a result, the current state of his life is somewhat unenviable. All that is about to change, however, as Heaven has taken notice of his plight.    A goddess, Belldandy, is despatched to Earth to grant Keiichi one wish. One wish, be it unlimited power, wealth, or his fondest desire. And his wish? ‘I wish that a goddess like you will stay with me forever.’',1993,'Comedy, Magic, Romance, Supernatural','Completed'),(46,'Ah! My Goddess The Movie','ah-my-goddess-the-movie','Trouble in Paradise! Belldandy&#039;s mentor, Celestin, was imprisoned for attempting to overthrow the Goddess system, but now he&#039;s back! Using a system virus, Celestin, corrupts the Goddess system and removes all of Belldandy&#039;s memories of Keiichi! Will Belldandy&#039;s love for Keiichi prove to be the key to ruining Celestin&#039;s plans, or will it be the final ingredient necessary to destroy our reality?!',2000,'Comedy, Magic, Romance, Supernatural','Completed'),(47,'Ah! My Goddess: Everyone Has Wings','ah-my-goddess-everyone-has-wings-','Morisato Keiichi is a down on his luck college student. Although possessing a diligent and generous nature, he had the misfortune of being born under an unlucky star. As a result, the current state of his life is somewhat unenviable. All that is about to change, however, as Heaven has taken notice of his plight.    A goddess, Belldandy, is despatched to Earth to grant Keiichi one wish. One wish, be it unlimited power, wealth, or his fondest desire. And his wish? ‘I wish that a goddess like you will stay with me forever.’',0,'','Completed'),(48,'Ah! My Goddess: Itsumo Futari De','-ah-my-goddess-itsumo-futari-de','Morisato Keiichi is a down on his luck college student. Although possessing a diligent and generous nature, he had the misfortune of being born under an unlucky star. As a result, the current state of his life is somewhat unenviable. All that is about to change, however, as Heaven has taken notice of his plight.    A goddess, Belldandy, is despatched to Earth to grant Keiichi one wish. One wish, be it unlimited power, wealth, or his fondest desire. And his wish? ‘I wish that a goddess like you will stay with me forever.’',2011,'Comedy, Magic, Romance, Supernatural','Completed'),(49,'Ai Mai Mi','ai-mai-mi','This film’s very interesting for person who love Japanese manga.Ai, Mai, Mii, and Ponoka-sempai are girls in manga club. They’re fighting evil invaders threatening Earth, facing off against rivals in tournaments, ...    This film’s very interesting for person who love Japanese manga.  Ai, Mai, Mii, and Ponoka-sempai are girls in manga club. They’re fighting evil invaders threatening Earth, facing off against rivals in tournaments, and dealing with other absurd situations when they are not drawing manga. A excited story’s about the four-panel manga “Ai Mai Mi”.',2013,'Comedy, Slice of Life','Completed'),(5