hool. However, her life changes drastically when, at her good friend Aoi&#039;s invitation, she is admitted into Starlight Academy, a famous school for grooming idols. In the weeks and months to come, Ichigo meets many rivals, learns the skills of being an idol, and, using her Aikatsu! card, enters numerous auditions.',2012,'Kids, Music, School','Completed'),(64,'Aikatsu! 3','aikatsu-3','The story of the anime revolves around Ichigo, who was just a normal middle school student until she suddenly got involved in the world of idols. The film will center on Aikatsu!&#039;s greatest &quot;Super Live&quot; concert yet, the Dai Star Miya Ichigo Matsuri. Ichigo prepares for the concert with press conferences, last-minute lessons, and more.',2014,'Kids, Music','Completed'),(65,'Aikatsu! 4','aikatsu-4','The three members of Luminous started their tour in Hokkaido, where they met two girls who love singing and dancing: Nono Ouji and Lisa Shirakaba',2015,'Music, School, Shoujo, Slice of Life','Ongoing'),(66,'Aikatsu! Movie','aikatsu-movie','The story of the anime revolves around Ichigo, who was just a normal middle school student until she suddenly got involved in the world of idols. The film will center on Aikatsu!&#039;s greatest &quot;Super Live&quot; concert yet, the Dai Star Miya Ichigo Matsuri. Ichigo prepares for the concert with press conferences, last-minute lessons, and more.',2014,'Music, Shoujo','Completed'),(67,'Air Gear','air-gear','Minami “Ikki” Itsuki, is a student and a delinquent. Also known as the “Unbeatable Babyface,” Ikki is the leader of the youth gang by the name of “East Side Gunz.” Upon his return home after being humiliated by a street gang of Storm Riders called the Skull Saders Ikki discovers a secret hidden from him by his benefactors, the Noyamano sisters. The… more Minami “Ikki” Itsuki, is a student and a delinquent. Also known as the “Unbeatable Babyface,” Ikki is the leader of the youth gang by the name of “East Side Gunz.    ” Upon his return