e is unsure of hers. As events and other people present obstacles for the potential couple to clear, their relationship begins to develop and their feelings become clear.',2001,'Comedy, Drama, Romance, School','Completed'),(77,'Akagami no Shirayukihime','akagami-no-shirayukihime','Shirayuki was a young girl born with unique apple-red hair. She meets a famous but foolish Prince Raji, who falls in love with her at first sight and orders her to become his concubine. With nowhere else to go, Shirayuki cuts her hair and escapes to a neighboring country. While traversing through the forests, she meets a young boy, Zen, who helps her after she boldly cures his wounds but then gets poisoned by an apple given to Shirayuki. Meanwhile, Prince Raji sends out henchmen to search for her. What will happen to Shirayuki? What is Zen&#039;s true character? A refreshing fantasy story between an optimistic heroine and a prince who constantly stays on her watch',2015,'Drama, Fantasy, Historical, Romance, Shoujo','Completed'),(78,'Akagi','akagi','The story revolves around the Mahjong gambling exploits of Akagi Shigeru. After a death-defying game of chicken, Akagi nonchalantly enters a Yakuza Mahjong parlor to shake the cops’ trail. Even unfamiliar with the rules of Mahjong, his gambling intuition is enough to save a small time gambler, Nangou, and grant him a seat at the gambling table. As… more The story revolves around the Mahjong gambling exploits of Akagi Shigeru. After a death-defying game of chicken, Akagi nonchalantly enters a Yakuza Mahjong parlor to shake the cops’ trail.    Even unfamiliar with the rules of Mahjong, his gambling intuition is enough to save a small time gambler, Nangou, and grant him a seat at the gambling table. As the night progresses, the stakes are raised both for Akagi, who is under the suspicion of the local police, and within the game. However, Akagi overcomes the situation with his tactics, defiant of both life and chance. When he leaves the gambling house, no one present is in doubt of his genius',2005,'Game, Psychological, Seinen, Thriller','Completed'),(79,'Akame ga Kill!','akame-ga-kill','Tatsumi is a fighter who sets off to the Capital in search of a way to make money to assist his poverty-stricken village. After falling victim to a robbery by a woman and losing all his money, Tatsumi is taken in by a noble aristocratic girl by the name of Aria. In the following night, Aria&#039;s place is attacked by a group of assassins known as Night Raid. While Tatsumi at first tries to defend Aria from the assassin Akame, another member of the group stops the fight. She reveals that Aria has kidnapped several villagers and tortures them for fun. Shocked upon seeing the tortured villagers — including his two best friends, Tatsumi kills Aria.    Seeing potential in Tatsumi, Night Raid invites the boy to their group warning that regardless of how they want to assassin corrupted people, they are murderers. Tatsumi accepts in order to become stronger and protect his village. In their fight against the Empire, Night Raid starts antagonizing an organization known as The Jaegars led by Esdeath, the most powerful fighter in the Empire. As both Night Raid and Jaegars suffer losses, the Empire forms a new secret police force, the Wild Hunt, with the son of the Prime Minister, Shura, as its leader, to bolster its law reinforcements, though Wild Hunt heavily abuses its new authority by killing innocent civilians for fun.',2012,'Action, Adventure, Fantasy','Completed'),(80,'Akame ga Kill! Theater','akame-ga-kill-theater','       ',2014,'Comedy','Completed'),(81,'Akane Iro ni Somaru Saka','akane-iro-ni-somaru-saka','In order to protect the girl Yuuhi Katagiri, a new transfer student, from danger, Junichi Nagase is forced to kiss her. Not understanding what happend, she screams at him, not knowing that her father has arranged for her to marry him.',2008,'Comedy, Harem, Romance, School','Completed'),(82,'Akane Maniax','akane-maniax','Jouj