sang to Earth’s bitter end, AKB48. The illegal revival group’s name is… AKB0048',2012,'Music, Sci-Fi','Completed'),(89,'AKB0048 Next Stage','akb0048-next-stage','AKB0048 Second Season, AKB0048 2nd Season Genres: Music, Sci-Fi Plot',2013,'Music, Sci-Fi','Completed'),(90,'Aki no Kanade','aki-no-kanade','Aki Miyagawa moved to Tokyo to pursue her dream to be a taiko drummer, but had a hard time balancing her strict training regimen with her part-time job. Now, after 15 years, she&#039;s returning to coach others for a taiko festival.',2015,'Slice of Life','Completed'),(91,'Akikan','akikan','The story revolves around a typical high school boy named Kakeru Daichi and the can of melon juice soda that he bought from a vending machine. The can suddenly transforms into a beautiful but standoffish girl that Kakeru nicknames “Melon,” and more “Akikan” (”empty can”) girls appear. However, Akikan girls need to be infused with carbon dioxide in…    more The story revolves around a typical high school boy named Kakeru Daichi and the can of melon juice soda that he bought from a vending machine. The can suddenly transforms into a beautiful but standoffish girl that Kakeru nicknames “Melon,” and more “Akikan” (”empty can”) girls appear. However, Akikan girls need to be infused with carbon dioxide in order to turn into a human',2009,'Comedy, Ecchi, Fantasy, Romance','Completed'),(92,'Akikan OVA','akikan-ova','The story revolves around a typical high school boy named Kakeru Daichi and the can of melon juice soda that he bought from a vending machine. The can suddenly transforms into a beautiful but standoffish girl that Kakeru nicknames “Melon,” and more “Akikan” (”empty can”) girls appear. However, Akikan girls need to be infused with carbon dioxide in…    more The story revolves around a typical high school boy named Kakeru Daichi and the can of melon juice soda that he bought from a vending machine. The can suddenly transforms into a beautiful but standoffish girl that Kakeru nicknames “Melon,” and more “Akikan” (”empty can”) girls appear. However, Akikan girls need to be infused with carbon dioxide in order to turn into a human',2009,'Comedy, Ecchi','Completed'),(93,'Akira','akira','In the year 2019, thirty-one years after World War III, the authority of Neo-Tokyo is waging a constant battle against Underground rebels. Caught in the middle is a motorcycle gang whose aim is just to make trouble.    The gang leader Kaneda Shoutarou gets involved in more ways than one when an experimental psychic child escapes and results in gang member Shima Tetsuo&#039;s capture and subsequent experimentation. Tetsuo the bitter runt of the pack now has the power of Akira and soon escapes when everyone realises that his power can result in the total destruction of Neo-Tokyo.',1988,'Action, Adventure, Horror, Military, Sci-Fi, Supernatural','Completed'),(94,'Aku no Hana','aku-no-hana','Kasuga Takao is a boy who loves reading books, particularly Baudelaire’s Les Fleurs du Mal. A girl at his school, Saeki Nanako, is his muse and his Venus, and he admires her from a distance. One day, he forgets his copy of Les Fleurs du Mal in the classroom and runs back alone to pick it up. In the classroom, he finds not only his book, but Saeki’s… more Kasuga Takao is a boy who loves reading books, particularly Baudelaire’s Les Fleurs du Mal. A girl at his school, Saeki Nanako, is his muse and his Venus, and he admires her from a distance. One day, he forgets his copy of Les Fleurs du Mal in the classroom and runs back alone to pick it up.    In the classroom, he finds not only his book, but Saeki’s gym uniform. On a mad impulse, he steals it. Now everyone knows “some pervert” stole Saeki’s uniform, and Kasuga is dying with shame and guilt. Furthermore, the weird, creepy, and friendless girl of the class, Nakamura, saw him take the uniform. Instead of revealing it was him, she recognizes his kindred deviant spirit and uses her knowledge to take control of his life. Will it be possible for Kasuga to get closer to Saeki, despite Nakamura’s meddling and his dark secret? What exactly does Nakamura intend to do with him?',2013,'Drama, Psychological, Romance, School','Completed'),(95,'Akuma no Riddle','akuma-no-riddle','Ichinose Haru is a student at a private girls&#039; boarding school, Myoujou Academy, who is being targeted by 12 assassins disguised as students.Azuma Tokaku is a transfer student and an assassin who also initially targets Haru, but develops feeling for her and decides to protect her from the other assassins.',2014,'Action, School, Shoujo Ai','Completed'),(96,'Akuma no Riddle: Shousha wa Dare? Nukiuchi Test','akuma-no-riddle-shousha-wa-dare-nukiuchi-test','Unaired episode 13 of Akuma no Riddle released with the seventh Blu-ray/DVD volume.',2014,'Action, School, Shoujo Ai','Completed'),(97,'Aldnoah.Zero','aldnoahzero','In 1972, a hypergate was discovered on the surface of the moon, and humanity began using it to colonize Mars. Years later, war breaks out between Earth and the Martian colonists.',2014,'Action, Mecha, Sci-Fi','Completed'),(98,'Aldnoah.Zero 2nd Season','aldnoah-zero-2nd-season','Second season of Aldnoah.Zero, announced at the end of the first season.',2015,'Action, Mecha, Sci-Fi','Completed'),(99,'Alice in the Country of Hearts','alice-in-the-country-of-hearts','The girly but bloody otome game re-imagining of Lewis Carroll&#039;s classic fantasy novel Alice&#039;s Adventures in Wonderland with bishounen characters and added romance.A parody of Alice&#039;s Adventures in Wonderland where Alice is smart and non-doormatlike.    In this story, Alice is not all what she seems. She is practical, strong, yet darkly cynical. Instead of the tradition story, Alice is kidnapped unwillingly by a mysterious (yet somewhat bishie-looking) man with bunny ears into a place call Heartland. Stuck in Heartland due to a trick by the mysterious bunny eared man, she meets the residents of this world. Along the way, Alice meets Blood, handsome mafia leader; Ace, the psycho yet charming knight and more... What should Alice do in such a world!?',2011,'Fantasy, Harem, Romance, Shoujo','Completed'),(100,'Alien 9','alien-9','Otani Yuri, much to her disgust, has been elected by her class for alien fighting duty. Together with Tonime Kasumi, who joined the alien fighter simply for the sake of doing so, and Kawamura Kumi, who became and alien fighter to avoid the responsibility of yet another year of class presidency, she must defend her school from periodic alien attacks…    more Otani Yuri, much to her disgust, has been elected by her class for alien fighting duty. Together with Tonime Kasumi, who joined the alien fighter simply for the sake of doing so, and Kawamura Kumi, who became and alien fighter to avoid the responsibility of yet another year of class presidency, she must defend her school from periodic alien attacks. Introspection, fear, anxiety and friendship await Yuri as she is forced to stare life itself in the mouth in her chaotic coming of age',2002,'Horror, Sci-Fi','Completed'),(101,'All Purpose Cat Girl Nuku Nuku Dash','all-purpose-cat-girl-nuku-nuku-dash','Each episode centers on Nuku Nuku’s adventures and mishaps in high school, and her relationship to students, the overall series plot centers on the evil Mishima Industries’ scheme to dominate the world through its products. In opposition to this plan are the slightly nutty Kyuusaku Natsume and Nuku Nuku, the android who acts as a companion to his y… more Each episode centers on Nuku Nuku’s adventures and mishaps in high school, and her relationship to students, the overall series plot centers on the evil Mishima Industries’ scheme to dominate the world through its products. In opposition to this plan are the slightly nutty Kyuusaku Natsume and Nuku Nuku, the android who acts as a companion to his young son. Nuku Nuku’s classmates are all eccentrics, Futaba, the class president, is a domineering control-freak, who cannot leave her authority in school.    Chieko Shirakaba is the rich snob with the two yes-girls who always take her side. There is a bookworm, a mystic, a scientist, and a pop singer. All of these are true to their descriptions: the mystic is always foretelling doom via tarot cards, spirits, or some other occult technique. The pop singer never says anything except as a song. The bookworm always has her nose in a book. These eccentricities add to the series’ humor',1998,'Action, Comedy, Ecchi, Romance, Sci-Fi, Shounen','Completed'),(102,'All Purpose Cat Girl Nuku Nuku OVA','all-purpose-cat-girl-nuku-nuku-ova','A scientist, his son, and an incomplete biotech-type android are sneaking away from the scientist&#039;s psychotic wife. Along the way, the son gets out of the Jeep to satisfy an urge of nature, and comes back with a cat. At this point, gunfire erupts around them, and they try to get away. They succeed, but the cat was killed by a stray bullet.    Sometime later, the son attends school with his &quot;big sister&quot; named Nuku Nuku. Yes, this is the android — who now looks like a cute girl — with the brain of the dead cat. Of course, things do not stay peaceful for long; the boy&#039;s mother wants him back! And so the fast-paced action comedy begins.',1992,'Action, Adventure, Comedy, Magic, Mecha, Sci-Fi, Shounen','Completed'),(103,'All Purpose Cat Girl Nuku Nuku TV','all-purpose-cat-girl-nuku-nuku-tv','* Alternate telling of the OVA... with a twist.After starting out in a new school and meeting her rather zany classmates, Nuku Nuku is forced into fighting the dangerous (read as &quot;absurd&quot;) robots of the Mishima corporation&#039;s inner circle (all in the most ridiculous costumes since Kishin Heidan), led by the evil mastermind (read as &quot;blithering-idiot-in-the-goofiest-costume-of-all&quot;), Hell Mishima. Their plan? Why, to take over the world, of course!',1998,'Action, Adventure, Comedy, Mecha, Sci-Fi, Shounen','Completed'),(104,'All Purpose Cat Girl Nuku Nuku TV Specials','all-purpose-cat-girl-nuku-nuku-tv-specials','* Alternate telling of the OVA... with a twist.After starting out in a new school and meeting her rather zany classmates, Nuku Nuku is forced into fighting the dangerous (read as &quot;absurd&quot;) robots of the Mishima corporation&#039;s inner circle (all in the most ridiculous costumes since Kishin Heidan), led by the evil mastermind (read as &quot;blithering-idiot-in-the-goofiest-costume-of-all&quot;), Hell Mishima. Their plan? Why, to take over the world, of course!',1998,'Action, Comedy, Ecchi, Romance, Sci-Fi, Shounen','Completed'),(105,'Allison and Lillia','allison-and-lillia','The first half of the story centers around Allison Whittington, a young blonde pilot in the Roxche Air Force who has experience with biplanes. She comes to visit her good friend Wil Schultz  during his summer vacation at Rowe Sneyum Senior School&#039;s dormitory after being away for six months. The two get involved in three different adventures over a period of a year where they meet new people and form important bonds.       The first half of the story centers around Allison Whittington, a young blonde pilot in the Roxche Air Force who has experience with biplanes. She comes to visit her good friend Wil Schultz  during his summer vacation at Rowe Sneyum Senior School&#039;s dormitory after being away for six months. The two get involved in three different adventures over a period of a year where they meet new people and form important bonds.  The second half of the story starts about fifteen years after the conclusion of the first half. The story centers around Lilliane Schultz, or Lillia for short, the daughter of Allison and Wil. Wil has in this time assumed a new identity, Travas, under the Sou Beil military, though still dates Allison. Lillia&#039;s companion is her childhood friend Treize, son of Carr Benedict and Fiona; Treize has a twin sister named Merielle. Lillia&#039;s and Treize&#039;s adventure together begins during her summer vacation from school.  Allison &amp;amp; Lillia’s story covers the storys of the Roxcheanuk Confederation, and the United Kingdom of Bezel Iltoa.',2008,'Action, Adventure, Shounen','Completed'),(106,'Amaenaideyo','amaenaideyo','Satonaka Ikko is an apprentice Buddhist priest. He is sent to Saienji Buddhist Temple whose chief priest is his grand mother, Jotoku. What’s waiting for him there are severe training, purification jobs, and 6 nuns. The situation living with nuns of the same ages sounds enviable, but actually he is treated as an errand boy, and his purification skil… more Satonaka Ikko is an apprentice Buddhist priest. He is sent to Saienji Buddhist Temple whose chief priest is his grand mother, Jotoku. What’s waiting for him there are severe training, purification jobs, and 6 nuns. The situation living with nuns of the same ages sounds enviable, but actually he is treated as an errand boy, and his purification skill cannot compare with theirs. However, when he has worldly desire, his power becomes stronger than anybody else',2005,'Comedy, Ecchi, Harem, Romance, Supernatural','Completed'),(107,'Amaenaideyo Katsu','amaenaideyo-katsu','Satonaka Ikko is an apprentice Buddhist priest. He is sent to Saienji Buddhist Temple whose chief priest is his grand mother, Jotoku. What’s waiting for him there are severe training, purification jobs, and 6 nuns. The situation living with nuns of the same ages sounds enviable, but actually he is treated as an errand boy, and his purification skil… more Satonaka Ikko is an apprentice Buddhist priest. He is sent to Saienji Buddhist Temple whose chief priest is his grand mother, Jotoku. What’s waiting for him there are severe training, purification jobs, and 6 nuns. The situation living with nuns of the same ages sounds enviable, but actually he is treated as an errand boy, and his purification skill cannot compare with theirs. However, when he has worldly desire, his power becomes stronger than anybody else',2006,'Comedy, Ecchi, Harem, Romance, Supernatural','Completed'),(108,'Amagami SS','amagami-ss','A second-year high school boy finds himself uneasy during Christmas time due to an experience in the past. However, this year at Christmas, he gets his last chance to ask out a graduating female senior named Haruka Morishima — or one of several other classmates. The story of the anime will be arranged in an omnibus format, with each heroine getting… more A second-year high school boy finds himself uneasy during Christmas time due to an experience in the past. However, this year at Christmas, he gets his last chance to ask out a graduating female senior named Haruka Morishima — or one of several other classmates. The story of the anime will be arranged in an omnibus format, with each heroine getting her own version of the story animated. Each heroine will sing her own version of the ending theme song     ',2010,'Romance, School','Completed'),(109,'Amagami SS OVA','amagami-ss-ova','A second-year high school boy finds himself uneasy during Christmas time due to an experience in the past. However, this year at Christmas, he gets his last chance to ask out a graduating female senior named Haruka Morishima — or one of several other classmates. The story of the anime will be arranged in an omnibus format, with each heroine getting… more A second-year high school boy finds himself uneasy during Christmas time due to an experience in the past. However, this year at Christmas, he gets his last chance to ask out a graduating female senior named Haruka Morishima — or one of several other classmates. The story of the anime will be arranged in an omnibus format, with each heroine getting her own version of the story animated. Each heroine will sing her own version of the ending theme song',2011,'Romance, School','Completed'),(110,'Amagami SS plus','amagami-ss-plus','A second-year high school boy finds himself uneasy during Christmas time due to an experience in the past. However, this year at Christmas, he gets his last chance to ask out a graduating female senior named Haruka Morishima — or one of several other classmates. The story of the anime will be arranged in an omnibus format, with each heroine getting… more A second-year high school boy finds himself uneasy during Christmas time due to an experience in the past. However, this year at Christmas, he gets his last chance to ask out a graduating female senior named Haruka Morishima — or one of several other classmates. The story of the anime will be arranged in an omnibus format, with each heroine getting her own version of the story animated. Each heroine will sing her own version of the ending theme song',2012,'Comedy, Romance, School, Slice of Life','Completed'),(111,'Amagami SS plus OVA','amagami-ss-plus-ova','A second-year high school boy finds himself uneasy during Christmas time due to an experience in the past. However, this year at Christmas, he gets his last chance to ask out a graduating female senior named Haruka Morishima — or one of several other classmates. The story of the anime will be arranged in an omnibus format, with each heroine getting… more A second-year high school boy finds himself uneasy during Christmas time due to an experience in the past. However, this year at Christmas, he gets his last chance to ask out a graduating female senior named Haruka Morishima — or one of several other classmates. The story of the anime will be arranged in an omnibus format, with each heroine getting her own version of the story animated. Each heroine will sing her own version of the ending theme song',2012,'Romance','Completed'),(112,'Amagi Brilliant Park','amagi-brilliant-park','Kanie Seiya, a high school boy, is invited on a date in an amusement park by a mysterious beautiful transfer student named Sento Isuzu. He is introduced to Ratifa, a real princess and the park&#039;s manager, and is asked to be the acting manager of this &quot;disappointing amusement park in the Tokyo suburbs&quot;.',2014,'Comedy, Magic, Romance','Completed'),(113,'Amagi Brilliant Park OVA','amagi-brilliant-park-ova','Unaired episode bundled with the seventh Blu-ray and DVD volume of Amagi Brilliant Park.',2015,'Comedy, Magic, Romance','Completed'),(114,'Amagi Brilliant Park Specials','amagi-brilliant-park-specials','Amagi Brilliant Park Specials',2015,'Comedy','Completed'),(115,'Amatsuki','amatsuki','Tokidoki is a Japanese high school student who, when he fails his history class, is sent to a high-tech history museum that virtually recreates the Edo period to do make-up work. However, what was supposed to be a simple school project becomes much more complicated when he’s attacked by two supernatural beings known as “the nue” and “the yakou” and… more Tokidoki is a Japanese high school student who, when he fails his history class, is sent to a high-tech history museum that virtually recreates the Edo period to do make-up work. However, what was supposed to be a simple school project becomes much more complicated when he’s attacked by two supernatural beings known as “the nue” and “the yakou” and loses the vision in his left eye. After he’s saved from the nue by a girl named Kuchiha, he realizes that he’s no longer wearing the simulation goggles, and is trapped in the virtual Edo',2008,'Action, Fantasy, Historical, Supernatural','Completed'),(116,'Amazing Nurse Nanako','amazing-nurse-nanako','In the beginning, Nanako was the subject of a cyborg experiment conducted by Dr. Ogami for one of his most powerful robots. Through rigorous training, Dr. Ogami trained Nanako to withstand the pain. However, he made her too strong, and the plan ultimately failed. However, recent developments between the Pentagon and the Vatican to resurrect Jesus f… more In the beginning, Nanako was the subject of a cyborg experiment conducted by Dr.    Ogami for one of his most powerful robots. Through rigorous training, Dr. Ogami trained Nanako to withstand the pain. However, he made her too strong, and the plan ultimately failed. However, recent developments between the Pentagon and the Vatican to resurrect Jesus for the Second Coming have landed Nanako as the subject of an operation in which she will give birth to the new Jesus. Throughout the series, we learn that Nanako is, in fact, the third clone in a series of clones cloned from the original Nanako. The original died from a mysterious illness, and an experiment to clone her was successful. However, around the age of 20, each Nanako clone dies of the same mysterious illness that claimed the life of the first Nanako. It has been Dr. Ogami’s quest to cure the “Nanako illness” ever since he promised the second clone that he would heal her before she died when he was young',1999,'Comedy, Mecha, Military, Sci-Fi','Completed'),(117,'Ame-iro Cocoa','ame-iro-cocoa','An ordinary college student, Aoi Tokura, was having a bad day. It was so bad because he was called ugly by a good-looking guy on the train. Walking down the street in the rain, Aoi found a small, but cozy cafe, Rainy Color. He started to work part-time as he enjoyed a cup of hot chocolate he was served. Then a guy came into Rainy Color... It was Keiichi Iwase, the one who told Aoi was ugly!!??',2015,'Comedy','Completed'),(118,'Ame-iro Cocoa: Rainy Color e Youkoso!','ame-iro-cocoa-rainy-color-e-youkoso-','Life at the Rainy Color café can never be described as boring. The arrival of the Koga brothers from England – Noel, always brimming with curiosity, and Nicola, somewhat shy and conservative – ensures that their sibling, café manager Shion, is kept on his toes. There’s also another newcomer, cameraman/photographer Jun Arisawa, who holds a mysterious connection to café owner Koji Amami. Last but not least, there’s a special photograph that incites all kinds of heartfelt and comedic reactions from the Rainy Color crew!',2015,'Comedy, Slice of Life','Ongoing'),(119,'American Dragon Jake Long','american-dragon-jake-long','Jake Long is one of New York City’s average 13-year-old boys, living with his extended Chinese-American family and skateboarding with his friends… until he learns his amazing destiny.',0,'','Completed'),(120,'American Dragon Jake Long Season 2','american-dragon-jake-long-season-2','Jake Long is one of New York City’s average 13-year-old boys, living with his extended Chinese-American family and skateboarding with his friends… until he learns his amazing destiny.',0,'','Completed'),(121,'Amnesia','amnesia','On the morning of August 1, the heroine wakes up and discovers she has absolutely no memories of the past. A boy appears before her, and introduces himself as a “spirit” named Orion. The heroine struggles to regain her memories under the guidance of Orion. She then gets a phone call, but she does not recognize the name on her mobile phone screen. S… more On the morning of August 1, the heroine wakes up and discovers she has absolutely no memories of the past. A boy appears before her, and introduces himself as a “spirit” named Orion. The heroine struggles to regain her memories under the guidance of Orion. She then gets a phone call, but she does not recognize the name on her mobile phone screen. She meets her apparent “boyfriend,” despite not knowing his face',2013,'Fantasy, Mystery, Shoujo','Completed'),(122,'Amnesia OVA','amnesia-ova','On the morning of August 1, the heroine wakes up and discovers she has absolutely no memories of the past. A boy appears before her, and introduces himself as a “spirit” named Orion. The heroine struggles to regain her memories under the guidance of Orion. She then gets a phone call, but she does not recognize the name on her mobile phone screen. S… more On the morning of August 1, the heroine wakes up and discovers she has absolutely no memories of the past. A boy appears before her, and introduces himself as a “spirit” named Orion. The heroine struggles to regain her memories under the guidance of Orion. She then gets a phone call, but she does not recognize the name on her mobile phone screen. She meets her apparent “boyfriend,” despite not knowing his face',2013,'Fantasy, Shoujo','Completed'),(123,'Amon The Apocalypse of Devilman','amon-the-apocalypse-of-devilman','Fear runs rampant throughout Tokyo with the revelation that demons in fact exist amongst us. Paranoia and the darker side of humanity boils onto the streets as people turn on one another, suspecting that anyone could in fact be a demon hiding in human clothing. Amidst the growing tensions, tragedy strikes Akira causing his mind to snap, retreating into his subconscious, allowing his Devilish alter-ego Amon to break free from Akira&#039;s cage of flesh and wreak havoc on both human and demons alike.',2000,'Demons, Horror, Supernatural','Completed'),(124,'Amuri in Star Ocean','amuri-in-star-ocean','In the year 01 of the new age, the sun began to radiate increased amounts of radiation. A few years later, very strong children with unique abilities were born. Amuri Kakyoin is a 13 year old girl born with a special ‘Allergy’, called ‘Repultion’. This ability keeps her from actually touching most of her environment, but also protects her from harm… more In the year 01 of the new age, the sun began to radiate increased amounts of radiation. A few years later, very strong children with unique abilities were born. Amuri Kakyoin is a 13 year old girl born with a special ‘Allergy’, called ‘Repultion’. This ability keeps her from actually touching most of her environment, but also protects her from harm. During a trip to space station Pink Coral, unknown enemies from the junk planet Galapagos attack and destroy the entire space station. Amuri survives being launched into space because of her ‘Allergy’, but is picked up by the attackers. When the machines of Galapagos attempt to destroy her, a girl named Suzu Ling Yunque shows up with a kimono-like space suit designed from Amuri’s DNA. The suit lets her use her ‘Repulsion’ ability on a large scale. Amuri has lived her whole life unable to touch other people, however, this cheerful and strange girl was not Repulsed upon contact',2008,'Adventure, Fantasy, Sci-Fi','Completed'),(125,'Ane Log','ane-log','When Konoe Moyako and her little brother, Akira, were young, he said he wanted to marry her. Naturally, Moyako decided that her little brother was a complete pervert who was obsessed with her. Now that they&#039;re both teenagers, Moyako is convinced she needs to &quot;rehabilitate&quot; him. However, it seems that the &quot;perversion&quot; is entirely in her imagination, and she can&#039;t seem to help turning completely innocent situations into creepy ones in her mind!',2014,'Comedy, School, Shounen','Completed'),(126,'Ane Log Specials','ane-log-specials','In addition to the flash anime, 3 short special episodes were included on the Ane Log Fan Disc. Episodes #1: Sekai no Ane Ijin no Jikan #2: Moya-nee Boot Camp #3: Ane Denwa Soudan',0,'Comedy','Completed'),(127,'Angel Beats','angel-beats','In a world after death, angels fight for their fate and their future. Yuri, the leader of the Shinda Sekai Sensen, rebels against the god who destined her to have an unreasonable life. On the other hand, Tenshi, the chairperson of the student council for the world after death, battles against the SSS members. SSS members utilize armed weaponry to b… more In a world after death, angels fight for their fate and their future. Yuri, the leader of the Shinda Sekai Sensen, rebels against the god who destined her to have an unreasonable life. On the other hand, Tenshi, the chairperson of the student council for the world after death, battles against the SSS members. SSS members utilize armed weaponry to battle it out against the angels harnessing supernatural powers.',2010,'Action, Comedy, Drama, Supernatural','Completed'),(128,'Angel Cop','angel-cop-','To combat rising attacks by communist terrorists, Japan has created a special security force authorized to use lethal force. Angel, the newest member of the force, fights to take down the terrorist group, Red May. Accidentally uncovering ties between Red May and the government, she and the rest of the Special Security Force are targeted for executi… more To combat rising attacks by communist terrorists, Japan has created a special security force authorized to use lethal force. Angel, the newest member of the force, fights to take down the terrorist group, Red May. Accidentally uncovering ties between Red May and the government, she and the rest of the Special Security Force are targeted for execution by 3 “hunters”, enhanced psychics, working for the government. Together with her cybernetically enhanced partner, Raiden, it is up to Angel to stop them',1989,'Action, Police, Sci-Fi','Completed'),(129,'Angel Egg','angels-egg','The plot for Tenshi no Tamago is not something that can easily be related in words. The film is largely about the presentation more than action, and understatement instead of open revelation. Existentialism abounds, heightened by the moody artwork and the dialogue, which asks more questions than it answers.    Bear in mind, however, that the conflict in the plotline primarily occurs in the audience&#039;s mind, not in any sequence of actions in the film, spurred by speculation arising from one jarring impression after another. There are only two primary characters in Tenshi no Tamago: a young girl who bears an egg and a man who holds a strange cross. The audience is left to speculate as to the identities and true personalities of these two images which act in this disturbing world. Indeed, much of their dialogue involves the question &quot;dare ka&quot; (who are you). For such an existential film, however, this is perfect, as any open declaration of their thoughts, instead of such questions and mysterious actions, would ruin the mystery of the film.',1985,'Dementia, Drama, Fantasy','Completed'),(130,'Angel Feather','angels-feather','Hamura Shou, winner of the national kendo championship, is transferred to an only boys private school. He there thinks he meets his lost younger twin brother Kai, who strongly denies this. Strange things happen at the school somehow referring to a magical world called Winfield.    After re-encountering his best friend Naoto and while meeting many new friends, which each have specific abilities, he soon discovers his own inheritance and the difficult tasks ahead.',2006,'Drama, Fantasy, Romance, Sci-Fi, Shoujo, Shounen Ai','Completed'),(131,'Angel Heart','angel-heart','A young Taiwanese assassin codenamed “Glass Heart” committed suicide by jumping off a building, and her heart was pierced by metal fence. Miraculously, her life was saved by heart transplantation. During her recovery she began to experience strange dreams, which lead her to Japan looking for the donor of her heart, who happens to be Kaori Makimura,… more A young Taiwanese assassin codenamed “Glass Heart” committed suicide by jumping off a building, and her heart was pierced by metal fence. Miraculously, her life was saved by heart transplantation. During her recovery she began to experience strange dreams, which lead her to Japan looking for the donor of her heart, who happens to be Kaori Makimura, former partner of City Hunter Ryo Saeba.',2005,'Action, Drama, Romance','Completed'),(132,'Angel Links','angel-links','Li Meifon is the head of a free, no expenses paid protection/security agency for escorting ships across outer space. Though only 16, she posesses great skill and leadership qualities while commanding her crew aboard their ship, the “Angel Links.” However, some unpleasant memories begin to trouble her and she starts questioning her own past and reas…    more Li Meifon is the head of a free, no expenses paid protection/security agency for escorting ships across outer space. Though only 16, she posesses great skill and leadership qualities while commanding her crew aboard their ship, the “Angel Links.” However, some unpleasant memories begin to trouble her and she starts questioning her own past and reason for existence. Join Li Meifon and the rest of the Angel Links crew on their adventures through the Oracion star system as they battle pirates, government organizations, and a Tao master, all while finally uncovering Meifon’s dark and mysterious past',1999,'Adventure, Comedy, Drama, Romance, Sci-Fi','Completed'),(133,'Angel Sanctuary','angel-sanctuary','Organic Angel Alexiel, who is one of the highest and most powerful beings in existence, rebelled against God when, supposedly, she became disgusted by the way angels were behaving. She was captured and faced with the ultimate punishment of heaven, to have her soul reincarnated into human lives, and each of her lives would end tragically. The story…    more Organic Angel Alexiel, who is one of the highest and most powerful beings in existence, rebelled against God when, supposedly, she became disgusted by the way angels were behaving. She was captured and faced with the ultimate punishment of heaven, to have her soul reincarnated into human lives, and each of her lives would end tragically. The story follows her latest incarnation, Setsuna Mudo, who is romantically in love with his younger sister.',2001,'Adventure, Comedy, Drama, Fantasy, Romance, Sci-Fi, Shoujo','Completed'),(134,'Angel Tales','angel-tales','Goro’s down on his luck. He keeps losing jobs and has little money. One day he meets a fortune-teller outside of a pet store who predicts that his luck will change. That night three girls appear in his appartment claiming to be his guardian angels. Soon a total of twelve girls appear to help him, each one a reincarnation of a deceased pet once owne… more Goro’s down on his luck. He keeps losing jobs and has little money. One day he meets a fortune-teller outside of a pet store who predicts that his luck will change. That night three girls appear in his appartment claiming to be his guardian angels. Soon a total of twelve girls appear to help him, each one a reincarnation of a deceased pet once owned by Goro.',2005,'Comedy, Fantasy, Magic, Romance','Completed'),(135,'Angel Tales Chu','angel-tales-chu','Goro’s down on his luck. He keeps losing jobs and has little money. One day he meets a fortune-teller outside of a pet store who predicts that his luck will change. That night three girls appear in his appartment claiming to be his guardian angels. Soon a total of twelve girls appear to help him, each one a reincarnation of a deceased pet once owne… more Goro’s down on his luck. He keeps losing jobs and has little money. One day he meets a fortune-teller outside of a pet store who predicts that his luck will change. That night three girls appear in his appartment claiming to be his guardian angels. Soon a total of twelve girls appear to help him, each one a reincarnation of a deceased pet once owned by Goro.',2003,'Fantasy, Magic, Romance','Completed'),(136,'Angelic Layer','angelic-layer-','12-year-old Misaki Suzuhara has just gotten involved in Angelic Layer, a battling game using electronic dolls called angels. Even as a newbie, Misaki shows advanced skills as she meets new friends and enters Angelic Layer tournaments to fight the greatest Angelic Layer champions of the nation.',2001,'Comedy, Drama, Sci-Fi, Shounen, Sports','Completed'),(137,'Angelique Kagayaki no Ashita','angelique-kagayaki-no-ashita','A young girl named Ange is summoned to a Sacred Land and is chosen as the Legendary Etoile, whose mission is to save the newly-born Cosmos of the Holy Beast, which has recently fallen under a crisis. With the support of nine Guardians (who have the power of nine elements), she embarks on a journey to save the dying land of the Holy Beast and to dis…    more A young girl named Ange is summoned to a Sacred Land and is chosen as the Legendary Etoile, whose mission is to save the newly-born Cosmos of the Holy Beast, which has recently fallen under a crisis. With the support of nine Guardians (who have the power of nine elements), she embarks on a journey to save the dying land of the Holy Beast and to discover her true self',2007,'Drama, Fantasy, Harem, Romance, Shoujo','Completed'),(138,'Angelique Kagayaki no Ashita OVA','angelique-kagayaki-no-ashita-ova','A young girl named Ange is summoned to a Sacred Land and is chosen as the Legendary Etoile, whose mission is to save the newly-born Cosmos of the Holy Beast, which has recently fallen under a crisis. With the support of nine Guardians (who have the power of nine elements), she embarks on a journey to save the dying land of the Holy Beast and to dis…    more A young girl named Ange is summoned to a Sacred Land and is chosen as the Legendary Etoile, whose mission is to save the newly-born Cosmos of the Holy Beast, which has recently fallen under a crisis. With the support of nine Guardians (who have the power of nine elements), she embarks on a journey to save the dying land of the Holy Beast and to discover her true self',2007,'Fantasy, Romance','Completed'),(139,'Angelique OVA','angelique-ova','Angelique Limoges and Rosalia de Catargena have been chosen as candidates in a Queen Examination – a test to see who is better qualified to be the next Queen of the cosmos. For this special examination, both girls are given their own continent on a planet. The girls must raise the continents into thriving civilizations and environments. Nine Guardi…    more Angelique Limoges and Rosalia de Catargena have been chosen as candidates in a Queen Examination – a test to see who is better qualified to be the next Queen of the cosmos. For this special examination, both girls are given their own continent on a planet. The girls must raise the continents into thriving civilizations and environments. Nine Guardians (who control various elements, such as fire, wind, and water) have been chosen to help the girls raise their continents during the Queen Examination.',2004,'Drama, Fantasy, Romance, Sci-Fi, Shoujo','Completed'),(140,'Angelique when the Heart Awakens','angelique-when-the-heart-awakens','A young girl named Ange is summoned to a Sacred Land and is chosen as the Legendary Etoile, whose mission is to save the newly-born Cosmos of the Holy Beast, which has recently fallen under a crisis. With the support of nine Guardians (who have the power of nine elements), she embarks on a journey to save the dying land of the Holy Beast and to dis…    more A young girl named Ange is summoned to a Sacred Land and is chosen as the Legendary Etoile, whose mission is to save the newly-born Cosmos of the Holy Beast, which has recently fallen under a crisis. With the support of nine Guardians (who have the power of nine elements), she embarks on a journey to save the dying land of the Holy Beast and to discover herself.',2006,'Adventure, Comedy, Drama, Fantasy, Magic, Romance, Sci-Fi, Shoujo','Completed'),(141,'Angelique when the Heart Awakens OVA','angelique-when-the-heart-awakens-ova','A young girl named Ange is summoned to a Sacred Land and is chosen as the Legendary Etoile, whose mission is to save the newly-born Cosmos of the Holy Beast, which has recently fallen under a crisis. With the support of nine Guardians (who have the power of nine elements), she embarks on a journey to save the dying land of the Holy Beast and to dis…    more A young girl named Ange is summoned to a Sacred Land and is chosen as the Legendary Etoile, whose mission is to save the newly-born Cosmos of the Holy Beast, which has recently fallen under a crisis. With the support of nine Guardians (who have the power of nine elements), she embarks on a journey to save the dying land of the Holy Beast and to discover herself.',2006,'Adventure, Comedy, Drama, Fantasy, Magic, Romance, Sci-Fi, Shoujo','Completed'),(142,'Ani Tore! EX','ani-tore-ex','&quot;Move your soul and body!&quot; Each episode contains a variety of routines, such as push-ups, sit-ups, spine twists, dance, yoga, stretches, trunk training, and taichi. Five girls aiming to become idols will exercise with you, and that troubling body fat percentage will go down by 1000%...!?',2015,'Comedy, Sports','Ongoing'),(143,'Animal Crossing','animal-crossing','Ai is a self-reliant girl that moves to Animal Village. She makes friends with the various villagers as she settles into the village. One night as she walked along the beach, she finds a message in the bottle. It sets her off on a quest of planting pine trees around the village to fulfill a miracle on the eve of the Winter Festival.',2006,'Kids, Slice of Life','Completed'),(144,'Animal Yokochou','animal-yokochou','On the first day in her new house, 5 year old Ami-chan made friends with three talking animals who came out of a door in her bedroom floor, which she finds out leads to Animal Yokocho, another world. The three are Issa, an overly innocent, soft-spoken panda, Kenta, a highly strung    , red-scarf-loving bear who puts on an almost constant tough-guy act,… more On the first day in her new house, 5 year old Ami-chan made friends with three talking animals who came out of a door in her bedroom floor, which she finds out leads to Animal Yokocho, another world. The three are Issa, an overly innocent, soft-spoken panda, Kenta, a highly strung, red-scarf-loving bear who puts on an almost constant tough-guy act, and Iyo, a rabbit who usually holds the importance of her own well-being and enjoyment over the happiness (and safety) of her “friends.” Even at only 5 years old, Ami-chan is easily the most rational of the group, and she’s a little wary at first, but she eventually comes around and starts spending her free time with them. A typical day involves Ami-chan and the three doing different things to pass the time, often playing a seemingly innocent game, but in AniYoko style. Unfortunately for Ami-chan, the AniYoko version usually turns out to be drastically different, much less logical, and usually more dangerous than the ordinary version.',2005,'Adventure, Comedy, Fantasy, Shoujo','Completed'),(145,'Anime de Wakaru Shinryounaika','anime-de-wakaru-shinryounaika','The psychologist Ryou and his cheerful nurse Asuna explain many aspects of mental illness to the reader. They cover topics such as the validity, prevalence, and origins of mental disorders, in addition to addressing specific disorders. The information is imparted in a cheerful and comic manner, with various jokes, puns, and pop culture references.',0,'Comedy, Seinen','Completed'),(146,'Anime Mirai 2014','anime-mirai-2014','Anime Mirai project announced the four studios that will each receive 38 million yen (about US$370,000) from the &quot;Young Animator Training Project&quot; to make half-hour anime. Just like the last three years, the Japan Animation Creators Association (JAniCA) received money from the Japanese government&#039;s Agency for Cultural Affairs, and it will distribute most of those funds to studios who will train young animators on-the-job this year. - Harmonie - Kuro no Sumika -Chronus- - Ookii 1 Nensei to Chiisana 2 Nensei - Parol no Mirai Shima',0,'','Completed'),(147,'Anime Mirai Movie','anime-mirai-movie','On Thursday, the Anime Mirai project announced the four studios that will each receive 38 million yen (about US$480,000) from the “2012 Young Animator Training Project” to make half-hour anime. Just like the last two years, the Japan Animation Creators Association (JAniCA) received money from the Japanese government’s Agency for Cultural Affairs, a…    more On Thursday, the Anime Mirai project announced the four studios that will each receive 38 million yen (about US$480,000) from the “2012 Young Animator Training Project” to make half-hour anime. Just like the last two years, the Japan Animation Creators Association (JAniCA) received money from the Japanese government’s Agency for Cultural Affairs, and it will distribute most of those funds to studios who will train young animators on-the-job this year.',0,'','Completed'),(148,'Anju to Zushiou Maru','anju-to-zushiou-maru','After their father quarrels with local military men, Anju and Zushio are forced to flee, but they are captured and sold into slavery. When their mother dies, they are sold to Sansho the Bailiff, a cruel man who subjects them to hideous torments.While Anju falls into a lake and is transformed into a swan, Zushio escapes and after being adopted to a nobleman grows to a young man. He will then fight to defeat the evil Dayu and free all the slaves.',1961,'Fantasy, Historical','Completed'),(149,'Ano Natsu de Matteru','ano-natsu-de-matteru','The October issue of Gakken’s Megami Magazine is announcing on Tuesday that Onegai Teacher/Onegai Twins story creator Yousuke Kuroda and Onegai franchise character designer Taraku Uon are collaborating on a new original anime called Ano Natsu de Matteru. The anime will be an adolescent romantic comedy. The three main characters are the two girls I…    more The October issue of Gakken’s Megami Magazine is announcing on Tuesday that Onegai Teacher/Onegai Twins story creator Yousuke Kuroda and Onegai franchise character designer Taraku Uon are collaborating on a new original anime called Ano Natsu de Matteru. The anime will be an adolescent romantic comedy. The three main characters are the two girls Ichika Takatsuki and Remon Yamano, and the boy Kaito Kirishima.',2012,'Comedy, Drama, Romance, Sci-Fi, Shounen, Slice of Life','Completed'),(150,'Ano Natsu de Matteru Special','ano-natsu-de-matteru-special','A special episode of Ano Natsu de Matteru which will be included in the Blu-ray box set, set to be released in Summer 2014.',2014,'Comedy, Drama, Romance, Sci-Fi, Shounen, Slice of Life','Completed'),(151,'Anohana','anohana','Once, there was a group of close childhood friends. However, by the time they entered high school, they had grown apart from each other. These are:  Jin-tan — The hikikomori.Anaru — She just wants to hang out with her girlfriends.Yukiatsu and Tsuruko — These two are proper school-going students.Poppo — Rather than enter high school, he had opted to do some travelling.Menma — The one unchanging constant of the group.One day, Menma meets Jin-tan and asks him to fulfil her wish. For this, these widely separated companions gather once more.',2011,'Drama, Slice of Life, Supernatural','Completed'),(152,'AnoHana The Movie','anohana-the-movie','Ano Hi Mita Hana no Namae wo Bokutachi wa Mada Shiranai. Movie The story of the TV series will be retold from Menma&#039;s point of view.',2013,'Drama, Slice of Life, Supernatural','Completed'),(153,'Another (Anime)','another-anime','26 years ago, in a third-year classroom of a middle school, there was a student named Misaki. As an honors student who was also good at sports, the charming girl was popular with her classmates. When she suddenly died, her classmates decided to carry on as if she was still alive until graduation. Then, in the spring of 1998, a boy named Sakakibara…    more 26 years ago, in a third-year classroom of a middle school, there was a student named Misaki. As an honors student who was also good at sports, the charming girl was popular with her classmates. When she suddenly died, her classmates decided to carry on as if she was still alive until graduation. Then, in the spring of 1998, a boy named Sakakibara Kouichi transfers to that classroom, and he grows suspicious of the fearful atmosphere in that classroom. In particular, there is a beautiful, aloof girl named Mei Misaki who wears an eyepatch and is always alone drawing pictures.',2012,'Horror, Mystery, School, Thriller','Completed'),(154,'Another OVA','another-ova','26 years ago, in a third-year classroom of a middle school, there was a student named Misaki. As an honors student who was also good at sports, the charming girl was popular with her classmates. When she suddenly died, her classmates decided to carry on as if she was still alive until graduation. Then, in the spring of 1998, a boy named Sakakibara…    more 26 years ago, in a third-year classroom of a middle school, there was a student named Misaki. As an honors student who was also good at sports, the charming girl was popular with her classmates. When she suddenly died, her classmates decided to carry on as if she was still alive until graduation. Then, in the spring of 1998, a boy named Sakakibara Kouichi transfers to that classroom, and he grows suspicious of the fearful atmosphere in that classroom. In particular, there is a beautiful, aloof girl named Mei Misaki who wears an eyepatch and is always alone drawing pictures.',2012,'Horror, Mystery, Thriller','Completed'),(155,'Ansatsu Kyoushitsu','ansatsu-kyoushitsu-tv-','A humorous and action-packed story about a class of misfits who are trying to kill their new teacher – an alien octopus with bizarre powers and super strength! The teacher has just destroyed the moon and is threatening to destroy the earth – unless his students can destroy him first. What makes things more complicated is that he&#039;s the best teacher they&#039;ve ever had!',2015,'Action, Comedy, School, Shounen, Supernatural','Completed'),(156,'Ansatsu Kyoushitsu OVA','ansatsu-kyoushitsu-ova','The story of the original manga begins after 70% of the moon was suddenly vaporized in an explosion. The super lifeform responsible for this catastrophe is a strange tentacled creature that can slink around at supersonic Mach 20 speeds. It has a 10 billion yen (US$100 million) price on its head, but for some reason, this creature ends up teaching a middle school class at the beginning of the school year. The students have until graduation to assassinate the teacher, or it will destroy Earth as well. The event anime special will adapt the original manga&#039;s popular segment about the field trip to ancient Kyoto.',2014,'Action, Comedy, School, Shounen, Supernatural','Completed'),(157,'Antique Bakery','antique-bakery','One day, Tachibana, owner of the cake shop Antique, meets genius pâtissier Ono. He is Tachibana’s former classmate who used to get spurned by him. Tachibana is relieved to know that Ono doesn’t remember him, and so Tachibana invites him as a pâtissier at his cake shop. However, Ono has come out of the closet and makes numerous advance to Tachibana… more One day, Tachibana, owner of the cake shop Antique, meets genius pâtissier Ono. He is Tachibana’s former classmate who used to get spurned by him. Tachibana is relieved to know that Ono doesn’t remember him, and so Tachibana invites him as a pâtissier at his cake shop. However, Ono has come out of the closet and makes numerous advance to Tachibana.',2008,'Comedy, Shoujo','Completed'),(158,'Anyamaru Tantei Kiruminzuu','anyamaru-tantei-kiruminzuu','The “heartwarming comedy” story poses the following premise: “What if you can really transform into an animal?” Riko, Rimu and Nagisa Mikogami are three cute sisters who live in Kamihama, a Japanese city abundant with natural wonders. On an otherwise peaceful day, the three come across a mysterious Kirumin compact in an attic. With the Kirumin, the…    more The “heartwarming comedy” story poses the following premise: “What if you can really transform into an animal?” Riko, Rimu and Nagisa Mikogami are three cute sisters who live in Kamihama, a Japanese city abundant with natural wonders. On an otherwise peaceful day, the three come across a mysterious Kirumin compact in an attic. With the Kirumin, these character-costume-wearing girls can transform into real animals.',2009,'Comedy, Magic, Shoujo','Completed'),(159,'Ao Haru Ride','ao-haru-ride','Yoshioka Futaba used to be in love with a boy named Tanaka Kou in middle school. However, after a misunderstanding, their relationship as friends ends when he transfers schools over summer vacation. In high school, her world is turned around once more when she meets Kou again, this time under the name of Mabuchi Kou.',2014,'Comedy, Drama, Romance, School, Shoujo, Slice of Life','Completed'),(160,'Ao Haru Ride: Unwritten','ao-haru-ride-unwritten','Bundled with the eleventh volume of Ao Haru Ride manga by Sakisaka Io.',2014,'Romance, School, Shoujo, Slice of Life','Completed'),(161,'Ao no Exorcist','ao-no-exorcist--movie','The atmosphere in True Cross Academy is lively and boisterous in the days leading up to the grand festival held once every 11 years. During this time, Okumura Rin is entrusted with the responsibility of suppressing the berserk Phantom Train. In the midst of his mission, he meets a devil whose appearance is that of a young boy.',2012,'Action, Demons, Fantasy, Shounen, Supernatural','Completed'),(162,'Ao no Exorcist','ao-no-exorcist-','Humans live in the world of Assiah, demons in Gehenna. The two dimensions are not meant to interfere with each other, but demons still possess creatures in Assiah in spite of this. The humans who can    fight these demons are known as exorcists. Rin Okumura is a boy who bears the curse of being Satan’s illegitimate son. His foster father sacrificed hi… more Humans live in the world of Assiah, demons in Gehenna. The two dimensions are not meant to interfere with each other, but demons still possess creatures in Assiah in spite of this. The humans who can fight these demons are known as exorcists. Rin Okumura is a boy who bears the curse of being Satan’s illegitimate son. His foster father sacrificed himself to save him from demons. To avenge his foster father’s death as well as to prove himself, Rin decides to follow the path of an exorcist.',2011,'Action, Demons, Fantasy, Shounen, Supernatural','Completed'),(163,'Ao no Exorcist: Kuro no Iede OVA','ao-no-exorcist-kuro-no-iede-ova','Humans live in the world of Assiah, demons in Gehenna. The two dimensions are not meant to interfere with each other, but demons still possess creatures    in Assiah in spite of this. The humans who can fight these demons are known as exorcists. Rin Okumura is a boy who bears the curse of being Satan’s illegitimate son. His foster father sacrificed hi… more Humans live in the world of Assiah, demons in Gehenna. The two dimensions are not meant to interfere with each other, but demons still possess creatures in Assiah in spite of this. The humans who can fight these demons are known as exorcists. Rin Okumura is a boy who bears the curse of being Satan’s illegitimate son. His foster father sacrificed himself to save him from demons. To avenge his foster father’s death as well as to prove himself, Rin decides to follow the path of an exorcist.',2011,'Action, Demons, Fantasy, Shounen, Supernatural','Completed'),(164,'Aoharu x Kikanjuu','aoharu-x-kikanjuu','When Hotaru moves into a new apartment alone, there&#039;s a mysterious man standing nearby the apartment. Hotaru decides to confront the man, who turns out to live in the neighboring apartment. The next day at school, Hotaru&#039;s best friend Kanae tells Hotaru that a host tricked her out of her money. When Hotaru goes to confront the host, he happens to be none other than Hotaru&#039;s neighbor, Masamune?!',2015,'Action, Comedy, Shounen','Completed'),(165,'Aoi Bungaku','aoi-bungaku-','An animated adaptation of six classical Japanese literature pieces, including No Longer Human (Ningen Shikaku) and Run, Melos (Hashire, Melos) by Osamu Dazai, Kokoro    by Natsume Souseki, Hell Screen (Jigoku Hen) and The Spider’s Thread (Kumo no Ito) by Ryunosuke Akutagawa and In the Forest, Under Cherries in Full Bloom (Sakura no Mori no Mankai no S… more An animated adaptation of six classical Japanese literature pieces, including No Longer Human (Ningen Shikaku) and Run, Melos (Hashire, Melos) by Osamu Dazai, Kokoro by Natsume Souseki, Hell Screen (Jigoku Hen) and The Spider’s Thread (Kumo no Ito) by Ryunosuke Akutagawa and In the Forest, Under Cherries in Full Bloom (Sakura no Mori no Mankai no Shita) by Ango Sakaguchi.',2009,'Drama, Historical, Psychological, Seinen, Thriller','Completed'),(166,'Aoi Hana','aoi-hana','Fumi Manjoume and Akira Okudaria were close friends when they were young, but when Fumi moved away, they lost contact. Ten years later, they meet again as high school freshmen. Although they find that things between them have changed, they try to help each other through hard times, and maintaining the new lives they’ve built without growing apart.',2009,'Romance, Shounen Ai, Slice of Life','Completed'),(167,'Aoi Sekai no Chuushin de','aoi-sekai-no-chuushin-de','Segua Kingdom has been losing the war against Ninterdo Empire but the tables are turned by the appearance of a boy called Gear. All the characters are parodies of Nintendo or Sega games such as Sonic the Hedgehog, Super Mario Bros., The Legend of Zelda etc.',2012,'Action, Adventure, Ecchi, Fantasy, Parody, Shounen','Completed'),(168,'Aoki Densetsu Shoot','aoki-densetsu-shoot','Toshihiko “Toshi” Tanaka joined the same soccer club that his idol, Yoshiharu Kubo plays for at Kakegawa High School. When Toshi played in junior high with two of his friends Kenji Shiraishi and Kazuhiro Hiramatsu, they were known as the Kakenishi golden trio. Now in high school, his friends do not want or cannot play soccer anymore. Hiramatsu is f…    more Toshihiko “Toshi” Tanaka joined the same soccer club that his idol, Yoshiharu Kubo plays for at Kakegawa High School. When Toshi played in junior high with two of his friends Kenji Shiraishi and Kazuhiro Hiramatsu, they were known as the Kakenishi golden trio. Now in high school, his friends do not want or cannot play soccer anymore. Hiramatsu is forced to study by his father so that he would become a respectable adult. However, Hiramatsu loves soccer and wants to play so he confronted his father and says that he wants to play soccer with his friends and that he would never understand his love for soccer. It turns out that his father played soccer during his youth and, remembering how much he loved it, decides to let Hiramatsu play soccer but under the condition that he will keep his grades up as well. Shiraishi on the other hand quit soccer because he lost his temper and got into a fight that ended up disqualifying their team. In the end, he joins the Kakegawa High School soccer club because he loves soccer and playing in the golden trio.',1993,'Action, Comedy, Drama, Romance, School, Shounen, Sports','Completed'),(169,'Aoki Hagane no Arpeggio: Ars Nova','aoki-hagane-no-arpeggio-ars-nova','In the story, a Fleet of Fog loaded with super weapons suddenly appear all over the world. Without the ability to withstand this fleet, humanity was defeated and could no longer travel the seas. 17 years after the devastating naval war, Chihaya Gunzou and his friends somehow commandeer a Fleet of Fog submarine and rename it I-401. Together with Iona, they take on the Fleet of Fog.',2013,'Action, Sci-Fi, Seinen','Completed'),(170,'Aoki Hagane no Arpeggio: Ars Nova DC','aoki-hagane-no-arpeggio-ars-nova-dc','The first movie will be a compilation of 2013&#039;s television anime series with new story sequences, while the second movie will be an entirely brand-new work.',2015,'Action, Sci-Fi, Seinen','Completed'),(171,'Apfelland Monogatari','apfelland-monogatari','Apfelland is a small but beautiful country surrounded by Russia, Austria, and Germany. Vel is a boy who lives in the capital, Charlottenburg. He happens to help a girl Frid. She was kidnapped because radium mine was found in her grandfather&#039;s abandoned mine. Aiming at the radium mine, various people gather there, for example, an American who wants to make money, a Polish woman disguised like a man who wants to earn money for the revolution, and the ministry of Apfelland who plots to affiliate with Germany. Vel and Frida are involved in their plots, and they know the secret of the mine.',1992,'Adventure, Drama, Historical','Completed'),(172,'Appleseed','appleseed','In 2131 AD Deunan Knute has been a soldier on countless battlefields for most of her life. When the World War ends, she is transported to the city of Olympus to live peacefully and finds out that, in an effort to protect the human race from future wars, humans have created the Bioroids, a genetically enhanced race of people that have restrained feelings and therefore cannot hurt each other.    She discovers, however, that not everyone is happy with this Human-Bioroid symbiosis: Many humans treat Bioroids as a lower species and as a threat to their future. The human-controlled military is seeking to annihilate all Bioroids, and the Bioroid-controlled government is afraid of a coup d&#039;état.The task falls on Deunan to control the situation, and to avert the inter-species war. In this she is aided by her former lover, Briareos, who has lost his body in war, to become a cyborg — a brain in an artificial body.',1988,'Action, Adventure, Mecha, Police, Sci-Fi','Completed'),(173,'Appleseed Alpha','appleseed-alpha','A young female soldier Deunan and her cyborg partner Briareos survive through the post World War 3 apocalyptic New York in search of human&#039;s future hope, the legendary city of Olympus.',2014,'Action, Adventure, Mecha, Military, Police, Sci-Fi','Completed'),(174,'Appleseed XIII','appleseed-xiii','In the wake of the destruction of a worldwide non-nuclear war, the city Olympus has become the control center of the world. Run by Bioroids (cloned humans made from only the best DNA), it is defended from terrorists by special military forces. Among these are former LAPD SWAT member Deunan Knotts and her multipurpose cyborg partner Brialeos. They f…    more In the wake of the destruction of a worldwide non-nuclear war, the city Olympus has become the control center of the world. Run by Bioroids (cloned humans made from only the best DNA), it is defended from terrorists by special military forces. Among these are former LAPD SWAT member Deunan Knotts and her multipurpose cyborg partner Brialeos. They face a challenge from the Human Liberation Front and its terrorist underbelly the Argonauts. The leader of this group, Al Ceides, supposedly died 20 years ago in an attack on Poseidon, but now his shadow emerges once again.',2011,'Action, Mecha, Military, Police, Sci-Fi','Completed'),(175,'Appleseed XIII Movie','appleseed-xiii-movie','In the wake of the destruction of a worldwide non-nuclear war, the city Olympus has become the control center of the world. Run by Bioroids (cloned humans made from only the best DNA), it is defended from terrorists by special military forces. Among these are former LAPD SWAT member Deunan Knotts and her multipurpose cyborg partner Brialeos. They face a challenge from the Human Liberation Front and its terrorist underbelly the Argonauts. The leader of this group, Al Ceides, supposedly died 20 years ago in an attack on Poseidon, but now his shadow emerges once again.',2011,'Action, Mecha, Military, Police, Sci-Fi','Completed'),(176,'Appleseed: Ex Machina','appleseed-ex-machina','Deunan, a young female soldier, and Briareos, a veteran cyborg-soldier, are both partners and lovers. As members of ESWAT, an elite special unit serving Olympus, they are deployed whenever trouble strikes. The two fighters find their partnership tested by the arrival of a new member to their ranks — an experimental Bioroid named Tereus.',2007,'Action, Mecha, Military, Police, Sci-Fi','Completed'),(177,'Aquarian Age','aquarian-age','Five supernatural factions have been fighting against each other for who knows how many centuries, with the beginning of Aquarian Age always in mind. Kyouta, soon begins to see visions of mystical girls fighting, except they do exist. Soon he and his girlfriend Yoriko become involved and the battle for Earth and Aquarian Age lies in their hands.',2002,'Action, Adventure, Fantasy, Romance, Sci-Fi, Shounen, Super Power, Supernatural','Completed'),(178,'Aquarion Evol','aquarion-evol','The story will take place 12,000 years after the first Aquarion television series at a city modeled after Hong Kong. A new cast of characters, piloting a new Aquarion robot, will fight enemies from another dimension.',2012,'Action, Comedy, Drama, Fantasy, Mecha, Romance, Sci-Fi','Completed'),(179,'Aquarion Logos','aquarion-logos','New Aquarion series.',2015,'Action, Comedy, Drama, Fantasy, Mecha, Romance, Sci-Fi','Ongoing'),(180,'Arakawa under the Bridge','arakawa-under-the-bridge','Ichinomiya Kou has always lived according to the creed of his wealthy, successful family: never be in debt to anyone. But one day, under the Arakawa Bridge, his life is saved by a homeless girl named Nino. In order to pay her back, Kou promises to be her boyfriend; and thus begins his new life under the bridge.',2010,'Comedy, Romance, Seinen','Completed'),(181,'Arakawa under the Bridge x Bridge','arakawa-under-the-bridge-x-bridge','Second part of AKB0048.: In the dry riverbed of Arakawa River, undefeated elite Ichinomiya Kou (aka Rick) met the lovely homeless girl Nino, a self-declared Venusian. Their awkward love stirs up trouble among the other strange inhabitants of the riverbed.',2010,'Comedy, Romance, Seinen','Completed'),(182,'Arashi no Yoru ni: Himitsu no Tomodachi','arashi-no-yoru-ni-himitsu-no-tomodachi','A new anime adaptation by Sparky Animation, Duckbill Entertainment, Baku Enterprise and Bandai Visual of the book Arashi no Yoru ni (One Stormy Night…) by Kimura Yuuichi.',2012,'Adventure, Drama','Completed'),(183,'Arata Kangatari','arata-kangatari','Every 30 years, a new princess is chosen from the Hime family to serve the Hayagami. The time has come again, but over these past years, records state not a single female has been born, save for one, the 15-year-old Arata. The only problem is, Arata is actually a male! Forced to disguise himself and take the place of the princess candidate until a…    more Every 30 years, a new princess is chosen from the Hime family to serve the Hayagami. The time has come again, but over these past years, records state not a single female has been born, save for one, the 15-year-old Arata. The only problem is, Arata is actually a male! Forced to disguise himself and take the place of the princess candidate until a formal one can be found, he attends the festival only to witness the current princess, Kokuri-hime, murdered, and his own life is forfeit as well, by the hands of the princess’ personal guard, the 12 Shinshou. As he runs for his life, Kannagi of the 12 convinces everyone that Arata is the one who has murdered the princess instead, and now everyone in the Imperial Court is after his head!',2013,'Adventure, Fantasy, Shounen','Completed'),(184,'Arata naru Sekai: Mirai-hen','arata-naru-sekai-mirai-hen',' Arata-naru Sekai is a mixed-media project of Iruma Hitoma. He is not only writing the novel version, but also creating the story for the manga version, scripting the anime version, and penning the lyrics for the music.The story follows a time researcher and a group of children in a depopulated world that finds itself stuck in time. In order to save humanity, some of the characters are chosen to travel to the future (depicted in the anime), and others to the past (depicted in the manga), while those who are deemed unsuitable for the technology stay in the present (depicted in the novel)',2012,'Sci-Fi','Completed'),(185,'Arcana Famiglia','arcana-famiglia','The story takes place on the small island of Regalo in the Mediterranean Sea. The island has been protected by a vigilante committee called “Arcana Famiglia”. The members of the family have psychic powers gained by a secret ritual. Felicita is a 16-year-old girl who was raised by her strict mother. She visits Regalo to see her father who is the he…    more The story takes place on the small island of Regalo in the Mediterranean Sea. The island has been protected by a vigilante committee called “Arcana Famiglia”. The members of the family have psychic powers gained by a secret ritual. Felicita is a 16-year-old girl who was raised by her strict mother. She visits Regalo to see her father who is the head of Arcana Famiglia. He tells her to become the leader of “Serie of Sword”, the arbitrator section of the family. As one of the members of Arcana Famiglia, Felicita interacts with other handsome but eccentric members.',2012,'Action, Romance, Shoujo','Completed'),(186,'Arcana Famiglia: Capriccio - stile Arcana Famiglia','arcana-famiglia-capriccio-stile-arcana-famiglia','An unaired episode of Arcana Famiglia.',2013,'Romance, Shoujo','Completed'),(187,'Area 88','area-88','Deep in the sandy plains of the Middle Eastern kingdom of Asran, Japanese photojournalist Makoto Shinjou travels to the remote airbase Area 88 to document the activities of the mercenaries who destroy the country’s enemies for a living. Among their ranks is Shin Kazama, a Japanese ace pilot who was tricked by his former best friend into signing a c…    more Deep in the sandy plains of the Middle Eastern kingdom of Asran, Japanese photojournalist Makoto Shinjou travels to the remote airbase Area 88 to document the activities of the mercenaries who destroy the country’s enemies for a living. Among their ranks is Shin Kazama, a Japanese ace pilot who was tricked by his former best friend into signing a contract with the Asran’s fighter squad. Because of this, he lost his career as an airline pilot and the chance to marry his fiancee Ryoko Tsugumo. Now, Shin has three choices in order to leave Area 88 and return to Japan: serve the mercenary group for three years, earn US$1.5 million, or desert the base, risking imminent death.',2004,'Action, Drama, Military, Romance, Shounen','Completed'),(188,'Area no Kishi','area-no-kishi','Believing himself to be useless at scorer, Aizawa Kakeru is the manager of his school’s Scorer team, while his brother Suguru is its ace, and is even good enough to represent Japan. However, Kakeru may be harbouring a strong talent within himself that only Suguru can see, and the two often get into arguments over Kakeru’s denial of his skills. Thin…    more Believing himself to be useless at scorer, Aizawa Kakeru is the manager of his school’s Scorer team, while his brother Suguru is its ace, and is even good enough to represent Japan. However, Kakeru may be harbouring a strong talent within himself that only Suguru can see, and the two often get into arguments over Kakeru’s denial of his skills. Things are made more complicated with Suguru die in a car accident and Kakeru got a heart injure and need a heart transplant and the parent gave Suguru’ heart to save Kakeru. Seven, an old playmate of theirs that Kakeru has a crush on. She join Aizawa Kakeru in his journey to the national and even international championships.',2012,'Comedy, School, Shounen, Sports','Completed'),(189,'Arei no Kagami: Way to the Virgin Space','arei-no-kagami-way-to-the-virgin-space','The story follows Daichi Meguru and Mayu, a young boy and a pilot, as they flee their war torn planet and into space. Upon their ship a stowaway android named Zero joins their quest as they travel through Halley&#039;s Mirror.',1985,'Action, Adventure, Sci-Fi','Completed'),(190,'Aria the Animation','aria-the-animation','On the planet Aqua lies the watery city of Neo Venezia, a tourist hub in which people travel around in gondolas. Professional gondoliers known as Undines are well-revered as they act as tour guides for the people. Akari Mizunashi is a gondolier in training and also an employee of Aria Company. She gets to meet all sorts of people as she takes them… more On the planet Aqua lies the watery city of Neo Venezia, a tourist hub in which people travel around in gondolas. Professional gondoliers known as Undines are well-revered as they act as tour guides for the people. Akari Mizunashi is a gondolier in training and also an employee of Aria Company. She gets to meet all sorts of people as she takes them on the gondola rides, from friendly mentors to special individuals, all this admidst the beautiful scenic backdrop of the entire city.',2005,'Fantasy, Sci-Fi, Slice of Life','Completed'),(191,'Aria the Natural','aria-the-natural','In a continuation of the last series, Akari Mizunashi continues her job as a gondolier along with her friends from the other two rival companies, Aika and Alice. As they continue their training to become Undines, they continue to meet new people and partake on mysterious adventures, all in the quiet, scenic, and peaceful city of Neo Venezia.',2006,'Fantasy, Sci-Fi, Slice of Life','Completed'),(192,'Aria the Natural OVA','aria-the-natural-ova','In a continuation of the last series, Akari Mizunashi continues her job as a gondolier along with her friends from the other two rival companies, Aika and Alice. As they continue their training to become Undines, they continue to meet new people and partake on mysterious adventures, all in the quiet, scenic, and peaceful city of Neo Venezia.',2006,'Fantasy, Sci-Fi, Slice of Life','Completed'),(193,'Aria the Origination','-aria-the-origination','It is the year 2301. Man has terraformed Mars into a beautiful water planet, and has renamed it “Aqua”. Built upon it is Neo-Venezia, an exact replica of old Venice, with beautiful waterways, palaces and plazas. Akari Mizunashi, a 15 year old girl arrives from Man-Home (formerly known as Earth) to become a gondolier trainee at a company called Aria…    more It is the year 2301. Man has terraformed Mars into a beautiful water planet, and has renamed it “Aqua”. Built upon it is Neo-Venezia, an exact replica of old Venice, with beautiful waterways, palaces and plazas. Akari Mizunashi, a 15 year old girl arrives from Man-Home (formerly known as Earth) to become a gondolier trainee at a company called Aria Company. The company is lead by Alicia Florence, one of the three best gondoliers, also known as the three Water Fairies. Trough hard training, Akari aims to become a Prima herself. Many encounters and mysterious events are sure to follow on this planet of miracles',2008,'Fantasy, Sci-Fi, Slice of Life','Completed'),(194,'Ark','ark','Ooguro Mikiko is a young, energetic woman who has just graduated from the Greater Tokyo Animation Academy into her first real job. The producer, calling her Kuromi for short, gives her a tour of the offices, which are empty because most people have either quit, work from home or have nutty hours.    And while she is coming to terms with this he collapses from a medley of stress related illnesses. Which in the opinion of the studio president is sort of impressive, because he did not think the guy would hold together long enough to pass this doomed project onto his replacement. Clearly it is going to be a long day.',2005,'Action, Fantasy, Mecha, Military, Sci-Fi, Supernatural','Completed'),(195,'Ark (2004)','ark-2004','Summary: Ark takes place on a dying alien world in which a global war between two technologically advanced human civilizations has reduced the planet to a desolate wasteland. The only way to escape the dying world is by activating the Ark, an ancient giant robot capable of supporting a human city as well as traveling through space. James Woods plays Jallak… more Ark takes place on a dying alien world in which a global war between two technologically advanced human civilizations has reduced the planet to a desolate wasteland. The only way to escape the dying world is by activating the Ark, an ancient giant robot capable of supporting a human city as well as traveling through space. James Woods plays Jallak, the military leader of the victorious civilization, the Storrians, who is trying to get the Ark to work in order to save his people. Unbeknownst to him, his adopted daughter Amarinth is the direct descendant of the priestess who originally built the Ark, Amiel. The civilization that lost the war, the Ceveans, have since been enslaved. A leader of their resistance movement is a young resistance fighter named Rogan. After discovering the lineage the young woman holds, both civilizations scramble to use Amarinth&#039;s power to activate the Ark and leave the other civilization behind to die. However, Amarinth, who has ties to both civilizations, wishes to try and find a way to use her power to save everyone. She is opposed by the lifeforce-stealing wraith Baramanda, the Empress&#039;s manipulative right-hand man, who wishes to steal the power of the Ark for his own selfish purposes. less ',2005,'Action, Fantasy, Mecha, Military, Sci-Fi, Supernatural','Completed'),(196,'Armitage III: Polymatrix','armitage-iii-polymatrix','2179: Mars has been colonized by Earth, populated by humans and &#039;Second Types&#039; robots - robots designed to perform the menial tasks humans won&#039;t do. Then there are the &#039;Third Types&#039; - illegal humanoid robots designed by a nationalist force to look and behave exactly like humans - living undetected among the Martian population as citizens, until one man, Rene&#039; Danclaude, declares war on the &#039;Thirds,&#039; starting a massacre in a vow to destroy them all.    That&#039;s where she comes in.She&#039;s Naomi Armitage. A cyber-punk Martian cop in hot pants, with an attitude as deadly as her gun. She&#039;s also a &#039;Third,&#039; and her fight against D&#039;anclaude is a fight for her survival. Her partner, Ross Sylibus, lost his partner at the hands of a cybernetic killer and hates robots.',1995,'Action, Adventure, Mecha, Police, Romance, Sci-Fi','Completed'),(197,'Armitage: Dual Matrix','armitage-dual-matrix','Naomi Armitage and Ross Sylibus have changed their names and live with their daughter Yoko as a happy and normal family on Mars — until an android riot breaks out at an anti-matter plant on Earth.    Armitage learns the riot is actually part of a conspiracy to suppress evidence of illegal research and development of more Third Types — androids almost indistinguishable from humans. She decides to go to Earth to find out who is behind this heinous act and encounters the most dreaded enemy yet — replicas of herself!',2002,'Action, Adventure, Mecha, Sci-Fi','Completed'),(198,'Armored Trooper Votoms Case Irvine','armored-trooper-votoms-case-irvine','Armored Trooper Votoms Case;Irvine will follow the story of Irvine (Irvin) Lester, a repairer of the tank-like robotic Armored Trooper (AT) mecha in the VOTOMS story world.',2010,'Action, Drama, Mecha, Military, Sci-Fi','Completed'),(199,'Armored Trooper Votoms Finder','armored-trooper-votoms-finder','Votoms Finder will center around Aki Tesuno, a guard for scrap salvagers and a pilot of a robotic mecha called an At or Altro (as opposed to VOTOMS&#039; trademark Armored Trooper mecha).',2010,'Action, Drama, Mecha, Military, Sci-Fi','Completed'),(200,'Armored Trooper Votoms Pailsen Files','armored-trooper-votoms-pailsen-files','Alternative release of Armored Trooper Votoms: Pailsen Files OVA. Created by the original staff of the series, with an all new story about the end of the 100 year war.',2009,'Mecha, Military, Sci-Fi, Seinen','Completed'),(201,'Armored Trooper Votoms: Big Battle','armored-trooper-votoms-big-battle','Chirico finds his beloved Fiana held hostage by Bararant in an experimental facility near Koba City, and he and his comrades have to fight their way in to save her.',1986,'Action, Drama, Mecha, Military, Sci-Fi','Completed'),(202,'Armored Trooper Votoms: Red Shoulder Document','armored-trooper-votoms-red-shoulder-document','Chirico Cuvie has been assigned to a new unit, the Red Shoulder division. His selection is not an accident, as he has an ability that possibly makes him the ultimate soldier. The Red Shoulder unit is callous and merciless in their training, and will test Chirico&#039;s ability to the limit.',1988,'Drama, Mecha, Military, Sci-Fi','Completed'),(203,'Armored Trooper Votoms: The Last Red Shoulder','armored-trooper-votoms-the-last-red-shoulder','Chirico Cuvie is reunited with others from the Red Shoulder unit as they pursue their revenge against Yoran Pailsen. Unknown to them, Yoran and his group have created the Perfect Soldier, Ypsilon.',1985,'Action, Drama, Mecha, Military, Sci-Fi','Completed'),(204,'Arslan Senki (TV)','arslan-senki-tv-','In the prosperous kingdom of Pars lies the Royal Capital of Ecbatana, a city of splendor and wonder, ruled by the undefeated and fearsome King Andragoras. Arslan is the young and curious prince of Pars who, despite his best efforts, doesn&#039;t seem to have what it takes to be a proper king like his father.    At the age of 14, Arslan goes to his first battle and loses everything as the blood-soaked mist of war gives way to scorching flames, bringing him to face the demise of his once glorious kingdom. However, it is Arslan&#039;s destiny to be a ruler, and despite the trials that face him, he must now embark on a journey to reclaim his fallen kingdom.',2015,'Action, Adventure, Drama, Fantasy, Historical, Supernatural','Completed'),(205,'Arve Rezzle: Kikaijikake no Yoseitachi (2013)','arve-rezzle-kikaijikake-no-yoseitachi-2013','',0,'','Completed'),(206,'Asa Made Jugyou Chu (2012)','asa-made-jugyou-chu-2012','The story revolves around Yuuki Kagami, a boy who enrolls in the academy of his dreams as a honors student — and is mistakenly put in the girls&#039; dormitory where boys are prohibited. Faced with the possibility of having to leave the school, Yuuki has to dress up as a girl in the dormitory. On top of things, he ends up rooming with the female teacher Ayana Kakinozaka, who has to watch over him.',2012,'Comedy, Ecchi, Romance, School','Completed'),(207,'Asatte no Houkou','-asatte-no-houkou','Karada is a young girl who hates being treated like a child and who wishes to be grown up. Shoko is an aloof, unhappy young woman who has just returned from overseas. When they meet by coincidence one night at a local shrine where they both like to make wishes and both exchanged ages.',2006,'Drama, Fantasy, Slice of Life, Supernatural','Completed'),(208,'Ashita no Joe','ashita-no-joe','Ashita no Joe tells the tale of a wandering orphan named Joe Yabuki. He falls into one of Tokyo’s slums and gets into a fight with a local gang and his street fighting skills gets him the attention of a washed up alcoholic boxing trainer. Until he sticks up for Joe when the gang comes back to finish Joe,    Joe decides to live with the trainer. Despit… more Ashita no Joe tells the tale of a wandering orphan named Joe Yabuki. He falls into one of Tokyo’s slums and gets into a fight with a local gang and his street fighting skills gets him the attention of a washed up alcoholic boxing trainer. Until he sticks up for Joe when the gang comes back to finish Joe, Joe decides to live with the trainer. Despite the trainer’s generosity, Joe is still committing money making scams and lands him in prison. While serving time, he meets another boxer named Rikiishi Tooru who gets Joe interested in boxing. Upon release, Joe then pursues a boxing career.',1970,'Drama, Sports','Completed'),(209,'Ashita no Joe 2','ashita-no-joe-2','A continuation of the previous seres, Ashita no Joe. After accidently killing his rival in a boxing match six    months ago, Joe, a boxer, steps into the ring once again to pick up the pieces of his past and regain his former glory.',1980,'Drama, Sports','Completed'),(210,'Asobi ni Iku yo!','asobi-ni-iku-yo','The story centers around Kio Kakazu , a high school freshman living in Okinawa. During a memorial service for one of his family ancestors.    A mysterious girl with cat ears appears before him indroducing herself as Eris and claiming that she is an alien. However She be more troubling than he first realizes',2010,'Comedy, Ecchi, Romance, Sci-Fi','Completed'),(211,'Asobi ni Iku yo! OVA','asobi-ni-iku-yo-ova','It is already summer and the Catians decide to study the games on Earth. To make things more interesting, Manami suggests that each participant should wage a precious item and whenever a person wins a round they may choose one of these items as a reward. While Aoi and Manami covet a special item waged by Kio, their priorities change when they are risking to let a DVD with embarrassing scenes of both go in the wrong hands.',2011,'Comedy, Ecchi, Romance, Sci-Fi','Completed'),(212,'Assemble Insert','assemble-insert','A criminal group known as Demon Seed terrorizes Tokyo with its vast armies of mecha. The local police is afraid to confront them, but one person stands in their way: Maron Namikaze, a 13-year-old idol singer with a catchy voice and unbelievable superhuman strength',2015,'Comedy','Completed'),(213,'Astarotte’s Toy Ep EX','astarottes-toy-ep-ex','Naoya is taken to a magical land where his is to enter succubus Princess Lotte’s harem.    Due to trauma during her childhood, she dislikes men and surrounds herself with women. Let’s watch the lives of these individuals unfold.',0,'','Completed'),(214,'Astarottes Toy','astarottes-toy','Naoya is taken to a magical land where his is to enter succubus Princess Lotte’s harem. Due to trauma during her childhood, she dislikes men and    surrounds herself with women. Let’s watch the lives of these individuals unfold.',0,'','Completed'),(215,'Asu no Yoichi!','asu-no-yoichi-','Yoichi Karasuma is a young samurai who spent all his life training martial arts on a mountain in Japan.    His father finally sends him away to learn about the life in the city. There he starts to live with four girls and goes to a normal high school. But modern life is harder to grasp than expected.',2009,'Comedy, Ecchi, Romance, Shounen','Completed'),(216,'Asura','asura','* Based on a manga by George Akiyama, serialised in Weekly Shounen Magazine.In 15th century Kyoto, at the foot of a wrecked shrine, a beast is born in fire and destruction. Plunged into an age of war, chaos and starvation, and taught to eat human flesh to survive by the madwoman who gave birth to him, he is a bestial cannibal child, called Asura, for the warlike Buddhist spirit, or anti-god.    Orphaned as an infant after his mother tries to eat him alive, Asura grows to become a pint-sized murder machine, killing and eating everything in his path, until he meets a beautiful village girl, Wakasa. Wakasa nurses him back to health, teaches him to speak, and works to turn him away from the path of barbarism. But times are hard, and as disease and starvation bear down on Wakasa&#039;s village, Asura reverts to his animalistic mindset. But he can&#039;t help remembering the words of the Buddhist monk who tamed him once before, and the sacred, purifying sutra chant he was once taught.',2012,'Drama, Historical','Completed'),(217,'Asura Cryin','asura-cryin','Tomo was a school kid with just one problem: he had a ghost friend for a while. One day, his life is turned upside down as his world changes into a new one, one which he couldn’t imagine before.',2009,'Action, Mecha, Supernatural','Completed'),(218,'Asura Cryin 2','asura-cryin-2','Following the first season, Tomoharu is now faced with a dilemma: if he doesn&#039;t form a contract with an &quot;akuma&quot;, he risks losing his dear friend Takatsuki. However, doing so would compromise his own existence as it would result in him and his ghost friend Misao becoming an Asura Cryin&#039;—mankind&#039;s biggest threat, according to their school&#039;s presidents. To make the decision even harder, Tomoharu and Misao have recovered some of their past memories—memories of a world that they didn&#039;t even know existed.',2009,'Action, Mecha, Supernatural','Completed'),(219,'Aura Battler Dunbine','aura-battler-dunbine','After a motocross accident, Show Zama was pulled from Japan into the mystical world of Byston Well, where he and others from Earth were reicruited by Lord Drake Luft to pilot his newest weapons, the Aura Battlers, a combination of Byston Well magic and Earthien technology. However, in the heat of battle, Show is approached by Marvel, a woman from E… more After a motocross accident, Show Zama was pulled from Japan into the mystical world of Byston Well, where he and others from Earth were reicruited by Lord Drake Luft to pilot his newest weapons, the Aura Battlers, a combination of Byston Well magic and Earthien technology.    However, in the heat of battle, Show is approached by Marvel, a woman from Earth, who convinces him of Luft’s sinister intentions.',1983,'Adventure, Mecha, Sci-Fi','Completed'),(220,'Avatar The Last Air Bender','avatar-the-last-air-bender','A century prior to the series’ opening, when Aang was 12 years old, he was frozen into a state of suspended animation for 100 years. After being awoken by two children from the Southern Water Tribe, he finds the world at war with the Fire Nation. As the Avatar, he sets out to master the elements and ultimately defeat the Fire Lord and end the war.… more A century prior to the series’ opening, when Aang was 12 years old, he was frozen into a state of suspended animation for 100 years. After being awoken by two children from the Southern Water Tribe, he finds the world at war with the Fire Nation. As the Avatar, he sets out to master the elements and ultimately defeat the Fire Lord and end the war. Each generation yields one person who is capable of Bending all four elements. This being is referred to as the Avatar, the spirit of the planet manifested in human form. When an Avatar dies, they are reincarnated into the next nation in the Avatar Cycle.    The Avatar Cycle parallels the seasons: winter for The Water Tribes, spring for the Earth Kingdom, summer for the Fire Nation, and autumn for the Air Nomads. Legend holds the Avatar must master each bending art in order, starting with their native element. This can sometimes be compromised when the situation requires it, as Aang demonstrates in the show. For the Avatar, learning to bend the element opposite their native element can be extremely difficult. This is because opposing Bending arts are based on opposing fighting styles and disciplines. Firebending and Waterbending are opposites, as are Earthbending and Airbending.',0,'','Completed'),(221,'Avatar: The Legend of Korra','avatar-the-legend-of-korra','The new series will take place seventy years after the end of the Avatar: The Last Airbender story arc, with new characters and settings.[4] The protagonist of the new series, Korra, the Avatar after Aang, is a hot-headed and rebellious young woman from the Southern Water Tribe who is “ready to take on the world.”[7] The series will follow Korra as… more The new series will take place seventy years after the end of the Avatar: The Last Airbender story arc, with new characters and settings.    [4] The protagonist of the new series, Korra, the Avatar after Aang, is a hot-headed and rebellious young woman from the Southern Water Tribe who is “ready to take on the world.”[7] The series will follow Korra as she faces an anti-bender revolt while mastering the art of airbending from Aang and Katara’s son, Tenzin.',0,'','Completed'),(222,'Avatar: The Legend of Korra Book 2: Spirit','avatar-the-legend-of-korra-book-2-spirit','Team Avatar travels to the Southern Water Tribe, as well as being visited by many spirits and explores the origin of the Avatar line.',2013,'','Completed'),(223,'Avatar: The Legend of Korra Book 3: Change','avatar-the-legend-of-korra-book-3-change','Book Three: Change (?) is the title of the upcoming third book of The Legend of Korra, which will run for a total of thirteen episodes. Set a few weeks after the end of Book Two: Spirits,the nomenclature refers to the changes induced by the energy shift of the planet due to Harmonic Convergence and Korra&#039;s battle with the Dark Avatar.',2014,'','Completed'),(224,'Avatar: The Legend of Korra Book 4: Balance','avatar-the-legend-of-korra-book-4-balance','The new series will take place seventy years after the end of the Avatar: The Last Airbender story arc, with new characters and settings. The protagonist of the new series, Korra, the Avatar after Aang, is a hot-headed and rebellious young woman from the Southern Water Tribe who is &quot;ready to take on the world.&quot; The series will follow Korra as she faces an anti-bender revolt while mastering the art of airbending from Aang and Katara&#039;s son, Tenzin.',0,'','Completed'),(225,'Avenger','avenger','Mars has been colonized and is a world where children have been replaced by robot servents known as ‘dolls’. Layla is a skilled fighter with a tragic past who travels about the world. Her companions are Nei, a strange and unique doll with some unknown ties to Layla, and Speedy, who is a doll breeder. The founders of Mars see the trio as a threat to… more Mars has been colonized and is a world where children have been replaced by robot servents known as ‘dolls’.    Layla is a skilled fighter with a tragic past who travels about the world. Her companions are Nei, a strange and unique doll with some unknown ties to Layla, and Speedy, who is a doll breeder. The founders of Mars see the trio as a threat to their world, and each time they attack Layla and Nei a bit more of their mysterious past and future is revealed.',2003,'Adventure, Fantasy, Sci-Fi, Shounen','Completed'),(226,'Ayakashi','-ayakashi-','Adapted from the 2005 adults-only superhuman battle action visual novel game Ayakashi. Ayakashi is a parasite life force that gives superpowers to its host, taking in return the host’s entire life force. Kusaka Yuu is a student that lost his will to live after the death of a dear childhood friend, until the day a mysterious girl, named Yoake Eimu,… more Adapted from the 2005 adults-only superhuman battle action visual novel game Ayakashi. Ayakashi is a parasite life force that gives superpowers to its host, taking in return the host’s entire life force.    Kusaka Yuu is a student that lost his will to live after the death of a dear childhood friend, until the day a mysterious girl, named Yoake Eimu, appears. From that moment on, his life would never be the same again. Hunted by Ayakashi and their hosts, the power within Yuu awakens and a never ending battle begins.',2007,'Action, Fantasy, Horror, Sci-Fi','Completed'),(227,'Ayakashi Japanese Classic Horror','ayakashi-japanese-classic-horror','A collection of three classic Japanese horror stories: “Yotsuya Kaidan,” the story of a wife betrayed by her husband who seeks vengeance even in death, “Tenshu Monogatari,” the story of forbidden love between a goddess and a human, and “Bakeneko,” the story of a mysterious cat monster with a vendetta against a certain family.',2006,'Fantasy, Historical, Horror','Completed'),(228,'Ayane High Kick','ayanes-high-kick','Ayane is a high school student focused on one thing, becoming a pro wrestler. A trainer tricks her into becoming a Kick Boxer, the sport she hates. She keeps with it though once she finds out.',1997,'Comedy, Shounen, Sports','Completed'),(229,'Ayashi Ayakashi Inferno OVA','ayashi-ayakashi-inferno-ova-','Plot Summary: Feudal Japan is attacked by beasts called ‘Youi’. Ryuudou Yukiatsu, a ‘floater’ and an employee at a bath house has the power of Ayagami (“The power to find the words behind things”) which can be used in fighting against the Youi. That’s why the members of a Youi-fighting group Bansha Aratamesho, called the Ayashi, are looking for Yukiatsu – they want him to become an Ayashi as well. Yukiatsu runs into a woman and a son who are chased by a Youi and has to face the past he’s been running away from',2007,'Action, Drama, Historical, Supernatural','Completed'),(230,'Ayashi no Ceres','ayashi-no-ceres','this transformation happens quite frequently. With protector Yuuhi by her side, it is up to Aya to control Ceres and keep her from coming back, but her relationship with an ex-worker for her evil grandpa may be a distraction.',2007,'Action, Drama, Historical, Supernatural','Completed'),(231,'Ayatsuri Sakon','ayatsuri-sakon','Sakon is the grandson of the famous Bunraku master, Tachibana Zaemon. He is incredibly shy and lacks confidence in himself. However, when he is with his puppet, Ukon, he is able to focus himself and his crime-solving abilities. As a contrast to traditional Bunraku puppeteering, Sakon is an expert ventriloquist. He uses his talent of mimicing and th… more Sakon is the grandson of the famous Bunraku master, Tachibana Zaemon. He is incredibly shy and lacks confidence in himself. However, when he is with his puppet, Ukon, he is able to focus himself and his crime-solving abilities. As a contrast to traditional Bunraku puppeteering, Sakon is an expert ventriloquist.    He uses his talent of mimicing and throwing voices to confront the villains and often force a confession. Ukon is a beautiful Bunraku puppet created in 1870, supposedly by the Master puppet-builder Unosuke Koizumi III. But Ukon doesn’t act as a good Bunraku puppet should. When he is with Sakon, he is forward, obnoxious, flirtatious, coarse, and very egocentric. Together, Sakon and Ukon travel around Japan, solving mysteries, murders, and horrific crimes. In the meantime, Sakon’s aunt Kaoruko, a young and pretty police detective, helps him out and keeps an eye on him.',1999,'Horror, Mystery, Thriller','Completed'),(232,'Azuki-chan (1995)','azuki-chan-1995','Azusa Noyama is a 12-year-old girl student, taking 5th grade, but everyone knows her as Azuki-Chan, nickname that she dislikes. Yuunosuke Ogasawara, a new student, asks her about her nickname, saying that he likes it. Azuki falls in love with him, and they start going out together. They share a diary, and become boyfriend and girlfriend.',1995,'Comedy, Romance, Shoujo, Slice of Life','Completed'),(233,'Azumanga Daioh','azumanga-daioh','Azumanga Daioh chronicles everyday life in an unnamed Japanese high school in Tokyo, following the trials and triumphs of six girls: reserved Sakaki’s obsession with cute animals, Chiyo’s struggle to fit in with girls five years older, Osaka’s spacey nature and skewed perspective on the world, Yomi’s aggravation at an annoying best friend, Tomo, wh… more Azumanga Daioh chronicles everyday life in an unnamed Japanese high school in Tokyo, following the trials and triumphs of six girls: reserved Sakaki’s obsession with cute animals, Chiyo’s struggle to fit in with girls five years older, Osaka’s spacey nature and skewed perspective on the world, Yomi’s aggravation at an annoying best friend, Tomo, whose energy is rivaled only by her lack of sense, and Kagura’s efforts in sports and school.    The story covers three years of tests, culture festivals, and athletic events at school, after-school life at the nearby shopping district, at Chiyo’s large house, vacations spent at Chiyo’s summer home on the beach and at Magical Land, a theme park. It is generally realistic in tone, marked by occasional bursts of surrealism and absurdity, such as Osaka’s bizarre imaginings and an episode featuring the characters’ New Year’s dreams.',2002,'Comedy, School, Slice of Life','Completed'),(234,'B Gata H Kei','b-gata-h-kei','Yamada is a high school student, and a virgin, who aspires to have 100 casual sex partners. Despite this, she soon finds herself targeting and pursuing only one boy.',2010,'Comedy, Ecchi, Romance, School, Seinen','Completed'),(235,'B-Legend! Battle Badaman','b-legend-battle-badaman','Raised by cats until he was five, Yamato Delgato’s only dream was to play B’Daman-the official sport of the B’DaWorld. However, his dream comes true when he’s chosen to wield the most powerful B’Daman ever; the legendary Cobalt Blade. Only he has skills to harness its power. This is his journey into the world of B’Daman as he learns valuable lesson…    more Raised by cats until he was five, Yamato Delgato’s only dream was to play B’Daman-the official sport of the B’DaWorld. However, his dream comes true when he’s chosen to wield the most powerful B’Daman ever; the legendary Cobalt Blade. Only he has skills to harness its power. This is his journey into the world of B’Daman as he learns valuable lessons and also tries to save the B’DaWorld from the evil clutches of the Shadow Alliance.',2005,'Adventure, Comedy, Kids, Shounen','Completed'),(236,'Baby Steps','baby-steps','The story follows Ei-chan, a punctual and earnest boy who has strived for straight As since elementary school. He began going to a tennis school during high school. There, he meets Natsu, a beautiful, earnest girl who only has passion for tennis.',2014,'Romance, School, Shounen, Sports','Completed'),(237,'Baby Steps 2nd Season','baby-steps-2nd-season','Second season of Baby Steps series.',2015,'Romance, School, Shounen, Sports','Completed'),(238,'Baby, Please Kill Me!','baby-please-kill-me','Kill Me Baby is the touching story of Yasuna, a normal (?) high school girl, and Sonya, her best friend who happens to be an assassin. Unfortunately, little Sonya’s trained assassin instincts often work against her and others in her daily high school life, as Yasuna’s often-broken wrist can attest to. She just wanted a hug, but she ended up with a…    more Kill Me Baby is the touching story of Yasuna, a normal (?) high school girl, and Sonya, her best friend who happens to be an assassin. Unfortunately, little Sonya’s trained assassin instincts often work against her and others in her daily high school life, as Yasuna’s often-broken wrist can attest to. She just wanted a hug, but she ended up with a broken neck. Isn’t it sad? No, it’s hilarious. Not even Yasuna’s intense ninja training can prepare her for the exciting adventures in this explosive 4-panel manga adaptation.',0,'','Completed'),(239,'Baccano!','baccano','Each of the stories in the series involves several unrelated plots intersecting and crossing each other as events spiral farther and farther out of control. Immortal alchemists, mafia operated speakeasies, and many other elements of pulp fiction mashed together for a world straight out of the movies.',2007,'Action, Comedy, Historical, Seinen, Supernatural','Completed'),(240,'Bagi, the Monster of Mighty Nature','bagi-the-monster-of-mighty-nature','Ryo is sent out by the people of a village to kill the monster which has been attacking the villagers. It is rumoured that this monster is a cat-woman named Bagi. As Ryo waits for the monster to come to its watering hole, he thinks back to how he first met Bagi as a kitten who learned how to write, and later re-enters his life on a quest to discover who and what she really is. But now she has gone wild, and as the time of her arrival approaches, he strengthens his resolve to kill her.',1984,'Action, Romance, Sci-Fi','Completed'),(241,'Baka to Test to Shoukanjuu','baka-to-test-to-shoukanjuu-','The story centers around Akihisa Yoshii, the “baka” of the title. His academy rigidly divides up the student body into classes based on the results of tests. The prodigies are in the A class with reclining seats complete with air conditioning, but Akihisa is in F class, the lowest rung of the school ladder which is furnished only with low, decrepit… more The story centers around Akihisa Yoshii, the “baka” of the title. His academy rigidly divides up the student body into classes based on the results of tests.    The prodigies are in the A class with reclining seats complete with air conditioning, but Akihisa is in F class, the lowest rung of the school ladder which is furnished only with low, decrepit tables and worn-out straw tatami mats. A girl named Mizuki Himeji is actually one of the smartest girls in Akihisa’s sophomore year, but she had a fever on test day and was pigeonholed into the F class. Besides Mizuki (who Akihisa secretly adores), the F class also has Y?ji Sakamoto, the class president who has been Akihisa’s friend and partner-in-crime since the freshman year.',2010,'Comedy, Romance, School, Super Power','Completed'),(242,'Baka to Test to Shoukanjuu Ni!','baka-to-test-to-shoukanjuu-ni-','Continuing from where Season 1 left, the story continues with a more in depth into the characters but with the same humor narrative as before.',2011,'Comedy, Romance, School, Super Power','Completed'),(243,'Baka to Test to Shoukanjuu Ni! Specials','baka-to-test-to-shoukanjuu-ni-specials','Spin-off of Baka to Test to Shoukanjuu that has been serialized on Famitsu Comic Clear website since 2010.    These specials are included in the Baka to Test Ni! BD/DVD releases.',2011,'Comedy, Romance, School, Super Power','Completed'),(244,'Baka to Test to Shoukanjuu OVA','baka-to-test-to-shoukanjuu-ova','The story centers around Akihisa Yoshii, the “baka” of the title. His academy rigidly divides up the student body into classes based on the results of tests. The prodigies are in the A class with reclining seats complete with air conditioning, but Akihisa is in F class, the lowest rung of the school ladder which is furnished only with low, decrepit… more The story centers around Akihisa Yoshii, the “baka” of the title. His academy rigidly divides up the student body into classes based on the results of tests.    The prodigies are in the A class with reclining seats complete with air conditioning, but Akihisa is in F class, the lowest rung of the school ladder which is furnished only with low, decrepit tables and worn-out straw tatami mats. A girl named Mizuki Himeji is actually one of the smartest girls in Akihisa’s sophomore year, but she had a fever on test day and was pigeonholed into the F class. Besides Mizuki (who Akihisa secretly adores), the F class also has Y?ji Sakamoto, the class president who has been Akihisa’s friend and partner-in-crime since the freshman year.',2009,'Comedy, Romance','Completed'),(245,'Bakemonogatari','bakemonogatari','Koyomi Araragi is almost hman again after briefly bcoming a vampire. When Hitagi falls down the stairs into his arms, he discovers he wieghs almost nothing, and offers her help from a middle-aged man. Koyomi encounters different apperitions in a series of interconnected stories.',2009,'Mystery, Romance, Supernatural, Vampire','Completed'),(246,'Baki The Grappler','baki-the-grappler','Baki Hanma is a young fighter who yearns to follow in the footsteps of his father, Yujiro, and become the strongest fighter in the world. Through that he trains tirelessly and fights constantly to hone his skills and develop his body to achieve these goals. Many intense battles lay ahead of Baki as he goes about his quest to be the best and ultimat…    more Baki Hanma is a young fighter who yearns to follow in the footsteps of his father, Yujiro, and become the strongest fighter in the world. Through that he trains tirelessly and fights constantly to hone his skills and develop his body to achieve these goals. Many intense battles lay ahead of Baki as he goes about his quest to be the best and ultimately take the title of “King” from his father. Hanma Baki, son of the strongest grappler in the world, is trying to claim his father’s throne. To do so he has to fight many; making lots of friends and enemies in the process.',1994,'Action, Shounen, Sports','Completed'),(247,'Baki The Grappler','baki-the-grappler-movie','Grappler Baki is a story about Baki, a happy student with an odd hobby. Baki is a mysterious martial artist who enjoys fighting; not the normal fighting, but fighting in the ruthless secret martial arts tournament where the best fighters fight in extremely nasty combats; the tournament where fighters are routinely crippled or even to the extent of getting killed!    The story begins when 13-year-old Baki Hanma faces 100 opponents in a martial-arts battle! He manages to defeat 37 of them, but is disgusted with himself for not beating the rest of them. He goes home and fires his trainer for not doing a good job. He then sets out to fight with tough guys such as Yu Lee, the junior welterweight champion. Baki has set himself on this tough path of self-discipline because he wants to be a tougher man than his father, Yujiro Hanma.',2001,'Shounen, Sports','Completed'),(248,'Bakugan: Battle Brawlers','bakugan-battle-brawlers-','Mysterious cards appear in front of the children of the world, with the powers to summon monsters from an alternate dimension.    When card-fighting group Battle Brothers Dan unleashes the power of Drago card in battle, he’s sucked into an alternate dimension causing a break in the balance of both worlds and possibilty the end to all humanity.',2007,'Action, Fantasy, Game, Shounen','Completed'),(249,'Bakugan: Gundalian Invaders','bakugan-gundalian-invaders','Bakugan Interspace has gone active all across the Earth, and kids are having fun testing their skills against Dan, Shun, and Marucho. However the Brawlers soon learn some Bakugan were sent into an alternate dimension when Vestroia became six different groups. These Bakugan are now at war with each other as the Gunadlians and the Neathians fighting…    more Bakugan Interspace has gone active all across the Earth, and kids are having fun testing their skills against Dan, Shun, and Marucho. However the Brawlers soon learn some Bakugan were sent into an alternate dimension when Vestroia became six different groups. These Bakugan are now at war with each other as the Gunadlians and the Neathians fighting for control of their dimension and looking to recruit the strongest Earthlings to their cause. The Battle Brawlers must noe fight to keep Interspace free of politics while deciding whether or not they should participate in this new found war.',2010,'Action, Adventure, Fantasy, Game, Shounen','Completed'),(250,'Bakugan: Mechtanium Surge','bakugan-mechtanium-surge','Bakugan Interspace gets messy when Dan learns his battling directly threatens Earth. Drago’s exposure to Code Eve has infused him with incredible power and as a result Dan accidentally releases Mechtogan, a new mysterious entity that wreaks havoc whenever Drago battles! While Dan attempts to regain control over Drago’s new powers, an insidious enem…    more Bakugan Interspace gets messy when Dan learns his battling directly threatens Earth. Drago’s exposure to Code Eve has infused him with incredible power and as a result Dan accidentally releases Mechtogan, a new mysterious entity that wreaks havoc whenever Drago battles! While Dan attempts to regain control over Drago’s new powers, an insidious enemy builds an army of “Dark Bakugan” engineered for total world domination.',2011,'Action, Adventure, Fantasy, Game, Shounen','Completed'),(251,'Bakugan: New Vestroia','bakugan-new-vestroia','Mysterious cards appear in front of the children of the world, with the powers to summon monsters from an alternate dimension. When card-fighting group Battle Brothers Dan unleashes the power of Drago card in battle, he’s sucked into an alternate dimension causing a break in the balance of both worlds and possibilty the end to all humanity.',2009,'Adventure, Comedy, Fantasy, Game, Shounen','Completed'),(252,'Bakukyuu Hit! Crash B-Daman','bakukyuu-hit-crash-b-daman','Hitto Tamaga, an 11-year-old boy, lives in some town in Japan. He is a very unfortunate boy, whose only asset is brightness. He lives only with his father who is a Bedaman researcher, but he left home several months ago, and he&#039;s been missing since then. He is living alone in a hut built on a relative’s land. Nobody celebrates his 11th birthday...except his cousin Nana who lives in the same land. One day, Hitto receives a present from the lost father, and he is very grad to know that his father remembers his birthday. It is “Crash Bedaman” that he longed for. After he puts them together to complete Crash Bedaman, he brings it to Bee Park, or a battle field of Beedaman. A battle there shows him a new way he should go. There is a message from his father with the present. “Overcome the difficulties”. Putting this word in his mind, he beats the enemies one after another with his Bedaman. With the encounter of partners and rivals, the mystery of Bedaman, a shadow organization, and the reason of the missing of his father gradually come to light. Defeating various obstacles in his way, he’s growing up.',1999,'Adventure, Game','Completed'),(253,'Bakuman','bakuman','Moritaka Mashiro, a junior high school student, content to live out a relatively normal life as any other does, is persuaded by his classmate, Akito Takagi, to become an aspiring mangaka when the latter realizes his natural talent as an artist. However, Moritaka is reluctant to pursue his dream as his uncle, once a mangaka with his own serializatio…    more Moritaka Mashiro, a junior high school student, content to live out a relatively normal life as any other does, is persuaded by his classmate, Akito Takagi, to become an aspiring mangaka when the latter realizes his natural talent as an artist. However, Moritaka is reluctant to pursue his dream as his uncle, once a mangaka with his own serializations, died from overwork trying to regain his lost status. With Akito’s help, Takagi gets another classmate and his school crush, Azuki Miho, who is an aspiring voice actress, to voice in the anime adaptation of their future manga once it is completed. However, Mashiro also proposes to Azuki, who surprisingly accepts only on the condition she will marry him when both of them have achieved their dreams. With a goal set before him, Mashiro begins a long and struggling path to become a famous mangaka.',2010,'Comedy, Romance, School, Shounen','Completed'),(254,'Bakuman Season 2','bakuman-season-2','Moritaka Mashiro, a junior high school student, content to live out a relatively normal life as any other does, is persuaded by his classmate, Akito Takagi, to become an aspiring mangaka when the latter realizes his natural talent as an artist. However, Moritaka is reluctant to pursue his dream as his uncle, once a mangaka with his own serializatio…    more Moritaka Mashiro, a junior high school student, content to live out a relatively normal life as any other does, is persuaded by his classmate, Akito Takagi, to become an aspiring mangaka when the latter realizes his natural talent as an artist. However, Moritaka is reluctant to pursue his dream as his uncle, once a mangaka with his own serializations, died from overwork trying to regain his lost status. With Akito’s help, Takagi gets another classmate and his school crush, Azuki Miho, who is an aspiring voice actress, to