n artist. However, Moritaka is reluctant to pursue his dream as his uncle, once a mangaka with his own serializatio…    more Moritaka Mashiro, a junior high school student, content to live out a relatively normal life as any other does, is persuaded by his classmate, Akito Takagi, to become an aspiring mangaka when the latter realizes his natural talent as an artist. However, Moritaka is reluctant to pursue his dream as his uncle, once a mangaka with his own serializations, died from overwork trying to regain his lost status. With Akito’s help, Takagi gets another classmate and his school crush, Azuki Miho, who is an aspiring voice actress, to voice in the anime adaptation of their future manga once it is completed. However, Mashiro also proposes to Azuki, who surprisingly accepts only on the condition she will marry him when both of them have achieved their dreams. With a goal set before him, Mashiro begins a long and struggling path to become a famous mangaka.',0,'','Completed'),(257,'Bakumatsu Gijinden Roman','-bakumatsu-gijinden-roman','The story takes place in Kyoto in the late 19th century. Manjiro has two faces. During the day, he works as a helper for people in Kyoto, but he also acts in secret to get back people’s properties from the men in power. As the get-backer “Roman,” Manjiro is getting involved in a nationwide conspiracy.',2013,'Fantasy, Historical','Completed'),(258,'Bakumatsu Rock','bakumatsu-rock','In the Bakumatsu era, at the end of the shoguns&#039; rule over Japan in the middle of the 19th century: the Tokugawa shogunate uses the brainwashing Heaven&#039;s Songs by the top idols in Shinsengumi to subjugate the country and its people. In this Japan, writing or singing any songs besides the Heaven&#039;s Songs is a capital offence. Sakamoto Ryouma and the other rockers rise up and change the world with rock &#039;n&#039; roll for freedom and justice.',2014,'Action, Comedy, Historical, Music, Shoujo','Completed'),(259,'Bakumatsu Rock: Mystery! Ons