mon','barakamon','Calligrapher Seishuu Handa moves to the remote Gotou Islands off the western coast of Kyushu, interacting with various people of the island.',2014,'Comedy, Slice of Life','Completed'),(265,'Barakamon: Mijikamon','barakamon-mijikamon','Short specials for Barakamon, airing on the official YouTube channel before every regular episode.',2014,'Comedy','Completed'),(266,'Basilisk','basilisk','The year is 1614 AD. Two warring ninja clans, each supporting a son of Hidetada Tokugawa as the next shogun, send ten representatives each to fight to the death for the possession of a scroll. The prize: the annihilation of the other and the staunch support of the Tokugawa government for the winning clan for the next thousand years.',2005,'Action, Adventure, Fantasy, Historical, Romance, Samurai, Supernatural','Completed'),(267,'Basquash!','basquash','On the planet Earthdash, its inhabitants gaze on its moon and the technologically advanced lunar city of Mooneyes with awe. Dan JD, a boy living in Rollingtown on Earthdash’s surface, gets caught up in Bigfoot Basketball — a fast-paced sport played with giant Bigfoot robots.',2009,'Ecchi, Mecha, Shounen, Sports','Completed'),(268,'Bastard','bastard','Several hundred years after Anthrasax destroyed modern civilization, a group of four lords plans to set this old god free once again. To prevent this from happening, a former ally of the four is released from his 15 year imprisonment. Dark Schneider, a sorcerer who once tried to conquer the world, now fights to save it.',2009,'Ecchi, Mecha, Shounen, Sports','Completed'),(269,'Batman Beyond','batman-beyond','BATMAN BEYOND it is the year 2039 it’s been 40 years since bruce wayne retired from being the dark knight. Now he is to weak and old to continue the fight against crime so now it’s up to the new Batman to bring justice back to the streets of Gotham.',2008,'Action, Adventure, Martial Arts','Completed'),(270,'Batman Beyond Season 2','batman-beyond-season-2-','since bruce 