n that looks like a robot. The stowaway had in his possession a me… more Project to mark Yokohama City&#039;s 150th anniversary. On Planet Abel, humans and robots co-exist. One day a mysterious stowaway on a transport vessel tries to invade the planet, but is discovered by Apollo (Hayato Ichihara), a robot that looks like a human; and Mikaru (Aya Ueto), a human that looks like a robot. The stowaway had in his possession a memory chip containing the latest in camouflage software, the mysterious “Cipher” OS. Apollo takes the Cipher chip simply for fun, but has no idea what he’s getting himself into. He suddenly starts acting strange, but Mikaru has no idea what’s wrong or that Cipher is behind it. What exactly is Cipher? What sort of secrets does it hold? Apollo and Mikaru will unravel a mystery encompassing the past, present, and future to find out. less - See more at: http://www.animegetdev.com/baton-movie#sthash.7QII364D.dpuf',2009,'Adventure, Sci-Fi','Completed'),(276,'Battle Angel Alita','battle-angel-alita','Known as Gunnm in Japan and then Battle Angel Alita to the Western audience, Battle Angel (in all of its incarnations) is now part of the canon of Blade Runner-inspired anime cyberpunk. Adapts the first two volumes of the manga.    The film version follows a Hunter Warrior and cyborg healer named Ido. Ido formerly lived in the floating land of Zalem (Tiphares in the book), the paradise that hovers over the refuse heap of Scrap Iron City in which he now resides with his former lover, Chiren. In his travels as a bounty hunter — killing spine thieves in a world in which human nerve tissue has become the most precious commodity — Ido one day discovers and repairs the remnants of a cyborg whom he names Gally (Alita in the Western version).',1993,'Drama, Sci-Fi, Shounen','Completed'),(277,'Battle Girls Time Paradox','battle-girls-time-paradox','Modern-day middle school girl Hideyoshi is mysteriously hurled into a world resembling the warring states period of Japanese history, only this time it’s inhabited only by women. This world’s Oda Nobunaga is gathering the legendary Crimson Armor so she can rule the world, and for some reason needs Hideyoshi’s help to do it.',2011,'Action, Comedy, Historical, Samurai, Sci-Fi, Super Power','Completed'),(278,'Battle Programmer Shirase','battle-programmer-shirase','Battle Programmer Shirase, also known as BPS, is a free programmer with super hacking abilities who doesn’t work for money. What he does work for is certainly something that only people like him would appreciate. But, his demeanor certainly doesn’t suit the jobs he is hired for. With the evil King of America causing trouble via the internet, Shiras…    more Battle Programmer Shirase, also known as BPS, is a free programmer with super hacking abilities who doesn’t work for money. What he does work for is certainly something that only people like him would appreciate. But, his demeanor certainly doesn’t suit the jobs he is hired for. With the evil King of America causing trouble via the internet, Shirase is nothing but busy as each new adventure brings even more interesting people into the picture.',2003,'Comedy, Ecchi, Sci-Fi','Completed'),(279,'Battle Spirits: Burning Soul','battle-spirits-burning-soul','Battle Spirits 2015 Project.',2015,'Action, Kids','Ongoing'),(280,'Beast Saga','beast-saga-','Beast Saga have three beast tribes include the Sea Tribe, the Land Tribe, and the Sky Tribe, takes place on a distant planet in our galaxy. They try to protect Godlot which an infinite elemental power source and fight for their honor. ',2013,'Action, Sci-Fi','Completed'),(281,'Beast Wars','beast-wars','The Transformers’ war continues in an older time, through a newer generation. On a prehistoric Earth, the heroic Maximals and the evil Predacons battle for survival against each other and against',1999,'Action, Adventure, Mecha, Shounen, Super Power','Completed'),(282,'Beck','beck','Tanaka Yukio, better known by his nickname Koyuki is a 