 and discovers a bent? (boxed meal) on sale at half price. Just as he reaches to grab it, he ends up on the floor unconscious. Sat? has just entered the fierce, no-holds-barred “supermarket survival battle” for half-price bent?.',2011,'Action, Comedy, Martial Arts','Completed'),(298,'Berserk','berserk','Guts, a man who calls himself “The Black Swordsman” looks upon his days serving as a member of a group of mercenaries, the Band of the Hawk, nicknamed “the Grim Reaper of the Battlefield.” Led by an ambitious, ruthless, and intelligent man named Griffith, together they battle their way into the royal court, and are forced into a fate that may chang…    more Guts, a man who calls himself “The Black Swordsman” looks upon his days serving as a member of a group of mercenaries, the Band of the Hawk, nicknamed “the Grim Reaper of the Battlefield.” Led by an ambitious, ruthless, and intelligent man named Griffith, together they battle their way into the royal court, and are forced into a fate that may change their entire lives.',1997,'Action, Adventure, Demons, Fantasy, Horror, Military, Romance, Seinen, Supernatural','Completed'),(299,'Berserk Ougon Jidaihen III: Kourin','berserk-ougon-jidaihen-iii-kourin','In the dead of night, at a camping site where they hide, the Band of the Hawk is attacked by Bakiraka assassins led by Silat. When all seems lost, Guts returns from his journey. &quot;You destroyed everything.&quot; Crying that Griffith is nothing without Guts, Casca and Guts are joined together body and soul. Griffith is imprisoned in the oldest building in Wyndham Catle, the Tower of Rebirth. They discover that Griffith has been tortured, with the tendons of his legs and arms severed and his tongue removed. Seeing Guts and Casca pitying him, Griffith drags his body along the ground. At that moment, the Egg of the King Behelit that he had thought lost returns to his hand. The Behelit resonated with Griffith&#039;s despair and screams, causing a shockwave that creates a twisted dimension. The God Hand descends. A nightmare of magnificent violence erupts as a horde of apostles devour the Band of the Hawk. This is the birth of the fifth guardian and the beginning of an age where darkness overcomes all light.',2013,'Action, Adventure, Demons, Fantasy, Military, Seinen, Supernatural','Completed'),(300,'Berserk: Golden Age Arc I - The Egg of the King','berserk-golden-age-arc-i---the-egg-of-the-king','Guts, an immensely strong sword-for-hire, has little direction in his life, simply fighting one battle after the next. However, this all changes suddenly when he meets and is bested by Griffith, a beautiful and charismatic young man who leads the Band of the Hawk mercenary army. After Guts joins the Band and the relationship between the two men begins to blossom, Casca, the tough, lone swordswoman in the Band of the Hawk, struggles to accept Guts and the influence he has on the world around her. While the two men begin to fight together, Griffith continues to rise to power, all seemingly in order to reach his mysterious, prophesied goals. What lengths will Guts and Griffith go to in order to reach these goals, and where will fate take the two men?',2012,'Action, Adventure, Demons, Fantasy, Military, Seinen, Supernatural','Completed'),(301,'Berserk: Golden Age Arc II - The Battle for Doldrey','berserk-golden-age-arc-ii---the-battle-for-doldrey','This second Berserk film will cover the part of the series dealing with the taking of the important Band of the Hawk stronghold.',2012,'Action, Adventure, Demons, Fantasy, Seinen, Supernatural','Completed'),(302,'Beyblade','beyblade','Thirteen-year-old Tyson Granger (Takao Kinomiya), along with his fellow teammates, Kai Hiwatari, Max Tate (Max Mizuhura), and Ray Kon (Rei Kon), strive to become the greatest beybladers in the world. With the technical help of the team’s resident genius, Kenny (Kyouju), and with the powerful strength of their bit beasts, the Bladebreakers armed wit…    more Thirteen-year-old Tyson Granger (Takao Kinomiya), along with his fellow teammates, Kai Hiwatari, Max Tate (Max Mizuhura), and Ray Kon (Rei Kon), strive to become the greatest beybladers in the world. With the technical help of the team’s resident genius, Kenny (Kyouju), and with the powerful strength of their bit beasts, the Bladebreakers armed with their tops (AKA: blades) attempt to reach their goal.',0,'','Completed'),(303,'Beyblade G Revolution','beyblade-g-revolution','After keeping their Bit Beasts out of harm’s way, a new world championship tournament is announced, but the defending champions can’t all be on the same team. Their friendship will be tested and tried as each Bladebreaker goes on a quest to prove why they are the best beyblader around. Tyson, Max, Ray, Kai, and newcomer Daichi, must keep up their w…    more After keeping their Bit Beasts out of harm’s way, a new world championship tournament is announced, but the defending champions can’t all be on the same team. Their friendship will be tested and tried as each Bladebreaker goes on a quest to prove why they are the best beyblader around. Tyson, Max, Ray, Kai, and newcomer Daichi, must keep up their winning ways…even if they must face each other. But, after the tournament is over, what awaits them is an old foe, Boris, taking over the BBA and transforming it into BEGA, the Beyblade Entertainment Global Association. To save Beybladers of the entire world from BEGA’s corruption, the Bladebreakers must reunite once again…',2003,'Action, Adventure, Comedy, Sci-Fi, Shounen, Sports','Completed'),(304,'Beyblade The Movie','beyblade-the-movie','The Bladebreakers are on a well deserved vacation. But, a hyperactive kid named Daichi continues to pursue Tyson for a rematch after his defeat in the Beyblade World Championships.    The Bladebreakers&#039; vacation eventually takes a turn for the worst once they encounter mysterious beybladers who claim to be the Dark Spirits sealed inside a strange temple. With Daichi under their control, the Shadow Bladers seek to destroy the world with their Dark Bit Beasts. Together, Tyson, Max, Ray, and Kai must save Daichi... and the world once again...',2002,'Action, Adventure, Comedy, Sci-Fi, Shounen, Sports','Completed'),(305,'Beyblade V-Force','beyblade-v-force','The Bladebreakers have to join forces once again because a mysterious group under the lead of Oozuma has defeated them, but the real enemy is not Oozuma. The real threath is formed by a group of people who use cyber-bitbeasts to capture the original ones from the Bladebreakers',2002,'Action, Adventure, Comedy, Sci-Fi, Shounen, Sports','Completed'),(306,'Beyblade: Fierce Battle','beyblade-fierce-battle','The Bladebreakers are on a well deserved vacation. But, a hyperactive kid named Daichi continues to pursue Tyson for a rematch after his defeat in the Beyblade World Championships.    The Bladebreakers&#039; vacation eventually takes a turn for the worst once they encounter mysterious beybladers who claim to be the Dark Spirits sealed inside a strange temple. With Daichi under their control, the Shadow Bladers seek to destroy the world with their Dark Bit Beasts. Together, Tyson, Max, Ray, and Kai must save Daichi... and the world once again...',2002,'Action, Adventure, Comedy, Sci-Fi, Shounen, Sports','Completed'),(307,'Big Wars','big-wars','It is the dawn of the 21st century. Mankind has terraformed and colonized Mars, but is not alone in the universe. An ancient race of alien beings, known only as The Gods, has been watching mankind&#039;s progress... and waiting. Now, these mysterious aliens have returned to halt mankind&#039;s expansion into space... by force.Presently, the planet named after the God of War, Mars, will become the final battlefield, as mankind fights a desperate battle with the latest in high-tech, military hardware: hyper-advanced aircraft, orbital fighters, and gigantic, desert battleships brimming with the most advanced weaponry.    But will it be enough? The aliens have awesome, incredibly destructive weapons at their disposal — including Hell — an unstoppable stealth carrier. But the alien&#039;s primary weapon is insidiously quiet and invisible — a mind control plaque. Incurable. Inevitable. Contagious. Humans are powerless to resist its effects, which transforms even the most loyal soldiers into dangerous subversives.Mankind&#039;s last hope lies with Captain Akuh and the crew of the Battleship Aoba. If his top-secret mission is successful, mankind will deal a decisive blow against the alien armada. But Akuh&#039;s girlfriend is showing signs of nymphomania — the first symptom of alien subversion!',1993,'Action, Adventure, Military, Sci-Fi, Space','Completed'),(308,'Bikini Warriors','bikini-warriors','Set in an RPG world with swords and magic, warriors must form a party to defeat the demon lord. But, these warriors are all wearing Bikini armor!!',2015,'Action, Ecchi, Fantasy','Completed'),(309,'Binan Koukou Chikyuu Bouei-bu Love!','binan-koukou-chikyuu-bouei-bu-love-','This is the story of how five high school boys affiliated with the &quot;Binan High School Earth Defense Club&quot; aka the &quot;Do Nothing Club&quot; are charged by a weird pink wombat creature with protecting the world.',2015,'Comedy, Magic, Slice of Life','Completed'),(310,'Binbou Shimai Monogatari','binbou-shimai-monogatari','The Yamada sisters, Kyo (15) and Asu (9), are students studying in secondary and primary schools respectively. Their mother has passed away while their father ran away after incurring debts due to gambling. Despite the difficult circumstances, both of them decide to overcome the unhappiness and welcome their days with enthusiasm and pride. Fortunat…    more The Yamada sisters, Kyo (15) and Asu (9), are students studying in secondary and primary schools respectively. Their mother has passed away while their father ran away after incurring debts due to gambling. Despite the difficult circumstances, both of them decide to overcome the unhappiness and welcome their days with enthusiasm and pride. Fortunately, with the change in the law system several years ago, Kyo is able to study and simultaneously, take up temporary jobs (such as distributing newspapers and tutoring) so as to support the family and make ends meet. On the other hand, Asu will take charge of household chores, prepare meals and manage the financials to assist her older sister. Surrounding them are also good and kind neighbours such as the novelist, Saegusa-san, and the aunt at the public bath who will watch over them. Although life is difficult and at times painful, the sisters are happy to have each other.',2006,'Comedy, Drama, Slice of Life','Completed'),(311,'Binbougami ga!','binbougami-ga','Sakura Ichiko is a 16-year-old girl who leads a charmed life and is blessed with beauty, brains, and health. She has an abundance of “Happiness Energy”, which can make people happy, but at the cost of absorbing all the “Happiness Energy” from her surroundings. She has caused the energy balance of the world to become unbalanced and because of this,…    more Sakura Ichiko is a 16-year-old girl who leads a charmed life and is blessed with beauty, brains, and health. She has an abundance of “Happiness Energy”, which can make people happy, but at the cost of absorbing all the “Happiness Energy” from her surroundings. She has caused the energy balance of the world to become unbalanced and because of this, she becomes the target of a Poverty God named Momiji. Momiji’s goal is to remove Ichiko’s power of absorbing other people’s Happiness Energy and to return all the energy she has taken to its rightful place.',2012,'Comedy, Parody, Shounen, Supernatural','Completed'),(312,'Birdy the Mighty Decode','birdy-the-mighty-decode','Federation investigator Birdy chases the space criminal Geega through space to Earth, where he hides in the entertainment industry under a human disguise. Birdy goes undercover herself, posing as famous model “Arita Shion” that often uses a ‘space girl’ look. A male student, Senkawa, stumbles upon a fight between the two one night in an abandoned b…    more Federation investigator Birdy chases the space criminal Geega through space to Earth, where he hides in the entertainment industry under a human disguise. Birdy goes undercover herself, posing as famous model “Arita Shion” that often uses a ‘space girl’ look. A male student, Senkawa, stumbles upon a fight between the two one night in an abandoned building only to be severed in half as he is used as a shield by Geega against Birdy. Birdy heals him from imminent death in some fashion- but Senkawas body, and life, are now changed and permanently linked to Birdy.',2008,'Action, Comedy, Sci-Fi','Completed'),(313,'Birdy the Mighty Decode:02 Prologue','birdy-the-mighty-decode02-prologue','Federation investigator Birdy chases the space criminal Geega through space to Earth, where he hides in the entertainment industry under a human disguise. Birdy goes undercover herself, posing as famous model “Arita Shion” that often uses a ‘space girl’ look. A male student, Senkawa, stumbles upon a fight between the two one night in an abandoned b…    more Federation investigator Birdy chases the space criminal Geega through space to Earth, where he hides in the entertainment industry under a human disguise. Birdy goes undercover herself, posing as famous model “Arita Shion” that often uses a ‘space girl’ look. A male student, Senkawa, stumbles upon a fight between the two one night in an abandoned building only to be severed in half as he is used as a shield by Geega against Birdy. Birdy heals him from imminent death in some fashion- but Senkawas body, and life, are now changed and permanently linked to Birdy.',2009,'Action, Comedy, Sci-Fi','Completed'),(314,'Black Blood Brothers','black-blood-brothers','Ten years after the Holy War in Hong Kong, Mochizuki Jirou, aka the Silver Blade, and the lone hero who fought and defeated the Kowloon Children despite the loss of his lover, returns to Japan with his young brother, Mochizuki Kotaro. The two quickly discover that the Kowloon Children who survived the Holy War are seeking to infiltrate the “Special…    more Ten years after the Holy War in Hong Kong, Mochizuki Jirou, aka the Silver Blade, and the lone hero who fought and defeated the Kowloon Children despite the loss of his lover, returns to Japan with his young brother, Mochizuki Kotaro. The two quickly discover that the Kowloon Children who survived the Holy War are seeking to infiltrate the “Special Zone”—a thriving city protected by an invisible barrier that will not allow Kowloon Children entrance—unless they’re invited. Red Bloods refer to the humans; Black Bloods are the vampires, and the Mochizuki Brothers are Old Blood—the last descendants of an elite clan of vampires. When Kotaro is abducted by one of the Kowloon Children, Jirou has no choice but to fight once more.',2006,'Action, Comedy, Fantasy, Shounen, Supernatural, Vampire','Completed'),(315,'Black Bullet','black-bullet','A near future, where humans have been defeated by the viral parasites named Gastrea. They have been exiled into a small territory and live in despair, side-by-side in terror. In this world trapped in darkness— Rentaro, a boy living near Tokyo and member of the &quot;Civil Security&quot;—an organization specializing in fighting against the Gastrea—is used to accomplishing dangerous tasks. His partner is Enju, a precocious young girl. They fight thanks to their peculiar powers until one day, when they receive a special assignment from the government. This top secret mission is to prevent the destruction of Tokyo... Set in a near future, this thrilling heroic-action story... starts now!',2014,'Action, Mystery, Sci-Fi, Seinen','Completed'),(316,'Black Cat','black-cat','Train Heartnet is known as the Black Cat for his quick reactions to attacks and his title as Number Thirteen as member of the secret society Chronos. He is an unbeatable master gunman, a cold and unfeeling killer until he meets Saya, a bounty hunter, or “sweeper”. She teaches him the value of a human life, and that one should live in order to repen…    more Train Heartnet is known as the Black Cat for his quick reactions to attacks and his title as Number Thirteen as member of the secret society Chronos. He is an unbeatable master gunman, a cold and unfeeling killer until he meets Saya, a bounty hunter, or “sweeper”. She teaches him the value of a human life, and that one should live in order to repent for one’s mistakes rather than die because of them. Through her, Train learns to love and care for other people as he too becomes a sweeper and travels with his partner Sven and the mysterious girl Eve.',2005,'Adventure, Comedy, Sci-Fi, Shounen, Super Power','Completed'),(317,'Black Heaven','black-heaven','Oji Tanaka has a wife, a child and a mundane job as a salary man in Tokyo’s modern society. But life wasn’t dull for him to begin with; 15 years ago, he was known as “Gabriel”, leader of a short-lived heavy metal band called Black Heaven. Oji’s life gets a sudden change in direction when he is invited by a mysterious blonde woman named Layla to pic…    more Oji Tanaka has a wife, a child and a mundane job as a salary man in Tokyo’s modern society. But life wasn’t dull for him to begin with; 15 years ago, he was known as “Gabriel”, leader of a short-lived heavy metal band called Black Heaven. Oji’s life gets a sudden change in direction when he is invited by a mysterious blonde woman named Layla to pick up his Gibson Flying V and once again display his “legendary” guitar skills, not knowing that his music generates power for a massive weapon in an intergalactic war.',1999,'Adventure, Comedy, Music, Sci-Fi, Slice of Life','Completed'),(318,'Black Jack','black-jack','Black Jack is an “unregistered” doctor with a clouded, mysterious past. He works with his little assistant Pinoko (who has a massive crush on the doctor), dealing wi