ack Rock Shooter','black-rock-shooter--movie','Based on a media franchise that started with characters created by illustrator Fuke &quot;Huke&quot; Ryouhei and later inspired a song of the same name by Ryo, a music Kuroi Mato just got into junior high school, and on the first day, someone catches her eye; her classmate Takanashi Yomi.    The two meet. The innocent and naive Mato. The mature Yomi. Seemingly opposites, but the time they spend together only strengthens a growing friendship. But as they go into their second year at the school, they get placed in separate classes, and they begin to grow apart.But somewhere simultaneously... In another world, a young girl, blue fire residing in her eyes, Black Rock Shooter faces another young girl; this one holding a jet-black scythe, Dead Master, and a battle to the death begins to unfold.',2008,'Action, Music','Completed'),(328,'Black Rock Shooter','black-rock-shooter-','Mato Kuroi just got into junior high school, and on the first day, someone catches her eye; her classmate Yomi Takanashi. The two meet.The innocent and naive Mato. The mature Yomi. Seemingly opposites, but the time they spend together only strengthens a growing friendship. But as they go into their second year at the school, they get placed in sepa…    more Mato Kuroi just got into junior high school, and on the first day, someone catches her eye; her classmate Yomi Takanashi. The two meet.The innocent and naive Mato. The mature Yomi. Seemingly opposites, but the time they spend together only strengthens a growing friendship. But as they go into their second year at the school, they get placed in separate classes, and they begin to grow apart. But somewhere simultaneously… In another world, a young girl, blue fire residing in her eyes, Black Rock Shooter faces another young girl; this one holding a jet-black scythe, Dead Master, and a battle to the death begins to unfold.',2010,'Action, Drama, School, Slice of Life','Completed'),(329,'Blade','blade','Blade, a “Daywalker” vampire hunter who was born with human and vampire blood in his veins after a vampire attacked his mother, is visiting Japan on a mission. There, he not only confronts Deacon Frost, the vampire who killed his mother, but he also faces up against “Existence,” a mysterious organization of vampires modified by Frost.',2011,'Action, Drama, Horror, Vampire','Completed'),(330,'Blade and Soul','blade-and-soul','An anime adaptation of the Korean MMORPG (massively multiplayer online role-playing game) Blade and Soul.',2014,'Adventure, Fantasy, Martial Arts','Completed'),(331,'Blade and Soul Specials','blade-and-soul-specials','Blade and Soul Specials.',2014,'Adventure, Fantasy, Martial Arts','Completed'),(332,'Blade of the Immortal','blade-of-the-immortal','Manji is a crass, violent samurai with a special ability: he cannot die. Cursed with immortality by the nun Yobikuni as punishment for his ruthless deeds, he has grown weary of his ageless life. The only way to lift the curse is to slay 1,000 evil men. So Manji wanders Japan, shedding the blood of the wicked on his quest to finally die.',2008,'Action, Adventure, Historical, Samurai, Supernatural','Completed'),(333,'Blade of the Phantom Master','blade-of-the-phantom-master','After wandering through the desert for days, a bitter warrior named Munsu is lost and unable to continue. His life is unexpectedly saved by Mon-ryon, a young man who dreams of becoming a secret agent for Jushin, a once-great country that was recently destroyed.    It is Mon-ryon&#039;s goal to save his girlfriend, Chunhyan, a born fighter who is held captive by the evil Lord Byonand.Then, from out of nowhere, blood begins trickling from Mon-ryon&#039;s chest. He has been fatally wounded by the Sarinjas, a cannibalistic breed of desert goblins. The quick-thinking Munsu convinces these beasts to spare his life, in exchange for the peaceful handover of Mon-ryon&#039;s appetising corpse.',2004,'Action, Fantasy','Completed'),(334,'Blassreiter','blassreiter','Faced with an outbreak of demonic blood, which transforms humans into insane and hideous creatures bent on violence and death, only one man can stand against the tide of destruction. Joseph Jobson, the only man able to control his cursed demonic form, must hunt down the man who cursed him and save the world from apocalypse.',2008,'Action, Sci-Fi','Completed'),(335,'BlazBlue Alter Memory','blazblue-alter-memory','The story is set in December of 2199, when the streets are full of anticipation for the end of the year and the start of the new one. Amid the celebrations, word spreads that Ragna the Bloodedge, an SS-class rebel with the highest ever bounty on his head, has appeared in the 13th Hierarchical City of Kagutsuchi. The apparent aim of Ragna or the “Grim Reaper” is the destruction of the system controlling the world. To collect the bounty, a motley array of unrivaled fighters converge on Kagutsuchi.',2013,'Action, Fantasy','Completed'),(336,'Bleach','bleach','A 15 year-old teenager named Kurosaki Ichigo has the ability to see the undead/ghosts/spirits. The journey begins when Ichigo first meets with Rukia Kuchiki, a Shinigami (Soul Reaper). Her mission in the real world is to find evil spirits called Hollow, then capture them. When Rukia first meets Ichigo, she finds Ichigo has a tremendous ability in h… more A 15 year-old teenager named Kurosaki Ichigo has the ability to see the undead/ghosts/spirits.    The journey begins when Ichigo first meets with Rukia Kuchiki, a Shinigami (Soul Reaper). Her mission in the real world is to find evil spirits called Hollow, then capture them. When Rukia first meets Ichigo, she finds Ichigo has a tremendous ability in his soul. The story continues on with twisted and turns, excitement and sad, friends and foes, and the most important of all, EVERYONE in the series has unique SUPERPOWER.',2012,'Action, Comedy, Shounen, Super Power, Supernatural','Completed'),(337,'Bleach Movie 1: Memories of Nobody','bleach-movie-1-memories-of-nobody','In Karakura Town, there has been a sudden outbreak of unidentifiable spirits called blanks (vacant souls) while in the skies of Soul Society, the real world has been reflected. A mysterious female shinigami called Senna has appeared before Ichigo along with a man named Ganryuu, leading a group called the Dark Ones.',2006,'Action, Adventure, Martial Arts, Super Power','Completed'),(338,'Bleach Movie 2: The Diamond Dust Rebellion','bleach-movie-2-the-diamond-dust-rebellion','When an artifact known as the &quot;King&#039;s Seal&quot; is stolen during transport from Soul Society, Hitsugaya Toushirou is assigned to retrieve it. Toushirou goes missing after a battle with the thieves, leading Seireitei to suspect him of treachery.    They order his immediate capture and execution. Unwilling to believe him capable of such a crime, Ichigo, Rangiku, Rukia, and Renji set out to find Toushirou and clear his name. Meanwhile, Toushirou is still searching for the thieves, and stumbles upon a dark secret involving a shinigami long since dead.',2007,'Action, Adventure, Martial Arts, Shounen, Supernatural','Completed'),(339,'Bleach Movie 3: Fade to Black','bleach-movie-3-fade-to-black','A mysterious reiatsu (spiritual particle) explosion occurs in the center of Seireitei in Soul Society, causing it to be destroyed. At the exact same time, a major change overwhelms Kuchiki Rukia, which leaves her losing something important inside.    Urahara Kisuke sends Kurosaki Ichigo to Soul Society to investigate the disturbance. Upon reaching Seireitei, Ichigo is set upon and attacked by shinigamis, once allies, who have no memory of him and Rukia. Now alone and on the run, Ichigo must find the missing Rukia and uncover the cause of the mysterious incident before it&#039;s too late.',2008,'Action, Comedy, Shounen, Super Power, Supernatural','Completed'),(340,'Bleach Movie 4 : The Hell Verse','bleach-movie-4-the-hell-verse','&quot;Hell&quot; is the place where a person is sent to who committed violent crimes when they were alive. Shinigami are forbidden to go there. One day prisoners revolt and make their escape to Karakura - the real world - where Ichigo and his friends live in.    Ichigo and his friends are defeated one after the other by prisoners with overwhelming power. A mysterious man appears who comes to their rescue. With Kokutou leading the way Ichigo, Rukia, Uryuu, and Renji marches into Hell to save the world.',2010,'Action, Comedy, Shounen, Super Power, Supernatural','Completed'),(341,'Bleach OVA','bleach-ova','Kurosaki Ichigo, the temporary Shinigami(Death God) for Kuchiki Rukia, discovers his mother’s killer as one of the Hollows he has been hunting. He does battle with it in a prideful battle of revenge.    This Special is actually a flashback of previous episodes in Bleach. After the ending credits, a short plays showing Shinigami and their Zanpakutos to “Number One” from the Bleach Soundtrack.',2004,'Action, Comedy, Shounen, Super Power, Supernatural','Completed'),(342,'Blood Lad','blood-lad','Staz is the vampire boss of a section of the demon world, but he has little interest in human blood. He’s more infatuated with Japanese culture. When he learns that Yanagi Fuyumi, a Japanese teenage girl, accidentally    wanders into the demon city, he jumps to the occasion. However, while Staz deals with an intruder on his turf, the oblivious Fuyumi is killed by a monster and becomes a wandering ghost. The disappointed Staz vows to her that he will find a way to bring Fuyumi back to life.',2013,'Comedy, Demons, Seinen, Supernatural, Vampire','Completed'),(343,'Blood Lad OVA','blood-lad-ova','Staz is the vampire boss of a section of the demon world, but he has little interest in human blood. He’s more infatuated with Japanese culture. When he learns that Yanagi Fuyumi, a Japanese teenage girl, accidentally wanders into the demon city, he jumps to the occasion. However, while Staz deals with an intruder on his turf, the oblivious Fuyumi is killed by a monster and becomes a wandering ghost. The disappointed Staz vows to her that he will find a way to bring Fuyumi back to life.',2013,'Comedy, Demons, Seinen, Supernatural, Vampire','Completed'),(344,'Blood Reign: Curse of the Yoma','blood-reign-curse-of-the-yoma','To avenge the woman and friends he loved, one lone warrior must seek out and slay his former comrade... but how do you kill someone who is already dead?    The solitary ninja must find the answer to that very question, and the ancient secrets of the world&#039;s oldest clan of professional assassins are pitted against the forces of evil! From nightmarish battles in which blood-soaked clay literally becomes the feeding ground for the dark creatures that lay in wait beneath the surface of the earth, to flesh-eating stallions and shape-changing spiders.',1989,'Action, Adventure, Horror, Supernatural','Completed'),(345,'Blood-C','blood-c','Shrine is located in an old, picturesque lakeside town. Shrine maiden Kisaragi Saya lives there along with her father, Tadayoshi. By day, she lives the life of a normal high school student at Sanbara Academy. By night, she hunts the Old Ones. Possessing supernatural physical prowess, the Old Ones prey on humans, and only Saya has the ability to defeat them.',2011,'Action, Horror, School, Supernatural, Vampire','Completed'),(346,'Blood-C Special','-blood-c-special','Two summary episodes of the TV series that are airing prior to Blood-C: The Last Dark. They will feature secret content that was never aired during the TV series&#039; run.',2012,'Action, Horror, School, Supernatural, Vampire','Completed'),(347,'Blood-C: The Last Dark','blood-c-the-last-dark','Despite the use of the Youth Ordinance Bill to enforce curfews for minors and regulate the use of the Internet, young people continue to fight for their own freedom through underground methods. One such group calls themselves Surat.    They have decided to take on Nanahara Fumito, a man who has