agon-tenkai-no-shichi-ryuu','After the events of the Blue Dragon series, Shu and Bouquet join a resistance group to fight General Rogi&#039;s army of invasion.They encounter a mysterious child , Noi, who has the power to revive Shu&#039;s shadow counter-part Blue Dragon, and save her from the pursuit of a red dragon. Now Shu and his company have to set foot once again on a journey to discover the purpose of the dragons, undergo their tests and stop the chains of events which threatens the fate of humanity.',2008,'Adventure, Comedy, Fantasy, Supernatural','Completed'),(352,'Blue Dragon: Tenkai no Shichi Ryu','-blue-dragon-tenkai-no-shichi-ryu','of Shadow, an ability that let’s them transfor thier shadow into a powerfull monster. Shu recives one of the most powerfull monsters, Blue Dragon, and they all set out to defeat their enemy.',2008,'Adventure, Comedy, Fantasy, Supernatural','Completed'),(353,'Blue Drop','-blue-drop','to go, she does and meets Hagino Sekonji. At first appearance, this girl appears like a normal student but inside her lies a deep secret that relates to the tragedy of 5 years ago.',2007,'Drama, Sci-Fi, Shounen Ai','Completed'),(354,'Blue Gender','blue-gender','Yuji Kaido was diagnosed with a serious disease and cryogenically frozen. He wakes up more than 20 years later–and Earth is nothing like what he remembers. A race of alien bugs called the Blue have taken over the planet, and a few select humans have retreated to the space station Second Earth. Yuji is taken back to Second Earth, where he learns th… more Yuji Kaido was diagnosed with a serious disease and cryogenically frozen. He wakes up more than 20 years later–and Earth is nothing like what he remembers.    A race of alien bugs called the Blue have taken over the planet, and a few select humans have retreated to the space station Second Earth. Yuji is taken back to Second Earth, where he learns that he and the other sleepers will be instrumental in defeating the Blue. And his relationship with one member of the recovery squad only serves to complicate things.',1999,'Adventure, Drama, Horror, Mecha, Military, Romance, Sci-Fi, Space','Completed'),(355,'Blue Gender: The Warrior','blue-gender-the-warrior','It is a time of chaos. Earth is no longer what it used to be. It has been infested with a bug-like species called the Blue. Yuji Kaido, who has a mysterious disease, is put into suspended animation until a cure can be found.    When he wakes up, Yuji learns that it has been more than 30 years since he was put into suspended animation, and the world is now controlled by these creatures. He then decides to join a group of soldiers fighting against the Blue in hope of a better future.',2002,'Adventure, Drama, Horror, Military, Sci-Fi','Completed'),(356,'Blue Meteor SPT Layzner','blue-meteor-spt-layzner','The Story takes place in the year 1996, where humanity is advanced enough to develop long-range space travel, as well as bases on both the Moon and Mars. However, the Cold War tensions between the United States and the Soviet Union have not ended; rather, they’ve escalated as both sides build military facilities in space, and the shadow of nuclear… more The Story takes place in the year 1996, where humanity is advanced enough to develop long-range space travel, as well as bases on both the Moon and Mars.    However, the Cold War tensions between the United States and the Soviet Union have not ended; rather, they’ve escalated as both sides build military facilities in space, and the shadow of nuclear conflict looms over humanity, both on and off Earth.',1985,'Mecha, Military, Sci-Fi, Shounen, Space','Completed'),(357,'Blue Remains','blue-remains','Post-nuclear Earth is barren, and life can&#039;t survive on the surface, so the few remaining people have lived under-water waiting for their time to be able to go to the surface. Amamiku and her faithful computer guardians, Pyron and Mayzamik, guard the seeds that contain the DNA for life and re-growth on the surface when the air is breathable again, but not everyone wants that to happen.  Read more at http://myanimelist.net/anime/4733/Blue_Remains#TxAoUQ1o5w8Ikk7r.99',2001,'Adventure, Sci-Fi','Completed'),(358,'Blue Seed','blue-seed','Momiji is an average girl until the day she finds she is the descendant of the great Kushinada family. Only she, with her Kushinada blood, can stop the Aragami, demonic plant-like monsters threatening to destroy Japan. Along to help her is the TAC, and a possible love interest in a young man named Kusanagi.',1994,'Action, Adventure, Comedy, Demons, Drama, Ecchi, Horror, Mystery, Romance, Sci-Fi','Completed'),(359,'Blue Seed Beyond','blue-seed-beyond','can stop the Aragami, demonic plant-like monsters threatening to destroy Japan. Along to help her is the TAC, and a possible love interest in a young man named Kusanagi.',1996,'Action, Comedy, Drama, Horror, Sci-Fi, Supernatural','Completed'),(360,'Blue Seed Omake','blue-seed-omake','Episodes are extras shown on the video releases of Blue Seed in Japan. They take place after every other episode, such as Omake 1 follows episode 2',0,'Comedy, Parody','Completed'),(361,'Blue Submarine No. 6','-blue-submarine-no-6','The once famous and well respected scientist Zorndyke has bred a new genre of living being, one that thrives on the oceans and lives to destroy humans. Zorndyke believes it is time that the humans were relieved of their rule of the earth. It is up to Blue Submarine No. 6 and the rest of the Blue fleet to put an end to Zorndyke’s madness and creatio… more The once famous and well respected scientist Zorndyke has bred a new genre of living being, one that thrives on the oceans and lives to destroy humans.    Zorndyke believes it is time that the humans were relieved of their rule of the earth. It is up to Blue Submarine No. 6 and the rest of the Blue fleet to put an end to Zorndyke’s madness and creations.     ',1998,'Action, Adventure, Mecha, Military, Sci-Fi','Completed'),(362,'Bobbys In Deep 1985','bobbys-in-deep-1985','* Based on a short story by Kataoka Yoshio.The 17-year-old Nomura Akihiko, called Bobby, is an underachieving high school kid with a deep love for motorcycles. His grades are failing, and his father — traditional and strict is trying everything he can think of to get the kid to apply for college. His mother is so silent, she might as well not even exist. Really, his support system lies entirely in his twinkle-toed little sister, the 14-year-old Keiko, who is nosy but cheers him on in her own way.Bobby really does little else but work on his bike. His most recent achievement seems to have been getting photos of himself on a road trip printed in a motorcyclist hobby magazine.This leads to an unexpected result: A girl his age, Nakahara Sakumi, who picked up that issue on a whim, decides to write him a letter. A romantic letter...Note: Shown on a double bill with Kamui no Ken.      ',0,'','Completed'),(363,'Bobobo-bo bo-bobo','bobobo-bo-bo-bobo','Bo Bobo is a man with the incredible power of hearing the voices of hair and using his own to fight. He uses his power to fight off the Margarita Empire and all of EmperorTsuru Tsuruiina’s minions who are stealing the hair off of anyone they find to power up their emperor.',2003,'Adventure, Comedy, Sci-Fi, Shounen','Completed'),(364,'Boku no Imouto wa Osaka Okan','boku-no-imouto-wa-osaka-okan','Kyousuke has been living apart from his younger sister Namika for ten years. One day, he begins to live with her, but she has turned into an energetic tsundere Osaka girl.',2012,'Comedy','Completed'),(365,'Boku wa Tomodachi ga Sukunai','boku-wa-tomodachi-ga-sukunai','Hasegawa Kodaka has transferred schools, and he’s having a hard time making friends. It doesn’t help that his blond hair tends to make people think he’s a delinquent. One day, he runs into his bad-tempered solitary classmate Yozora while she’s talking animatedly to her imaginary friend Tomo. Realizing that neither of them have any actual friends, t… more Hasegawa Kodaka has transferred schools, and he’s having a hard time making friends. It doesn’t help that his blond hair tends to make people think he’s a delinquent.    One day, he runs into his bad-tempered solitary classmate Yozora while she’s talking animatedly to her imaginary friend Tomo. Realizing that neither of them have any actual friends, they decide that the best way to alter this situation is to form a club and start recruiting. That is how “Rinjinbu” was formed, a club specifically designed for people who don’t have very many friends. As other lonely classmates slowly join their little club, they’ll try to learn how to build friendships through cooking together, playing games, and other group activities. But will this group of relationship-challenged misfits really be able to get along?',2011,'Comedy, Ecchi, Harem, Romance, School, Seinen','Completed'),(366,'Boku wa Tomodachi ga Sukunai Next','boku-wa-tomodachi-ga-sukunai-next','The Neighbor’s Club—a club founded for the purpose of making friends, where misfortunate boys and girls with few friends live out their regrettable lives. Although Yozora Mikazuki faced a certain incident at the end of summer, the daily life of the Neighbor’s Club goes on as usual. A strange nun, members of the student council and other new faces… more The Neighbor’s Club—a club founded for the purpose of making friends, where misfortunate boys and girls with few friends live out their regrettable lives. Although Yozora Mikazuki faced a certain incident at the end of summer, the daily life of the Neighbor’s Club goes on as usual.    A strange nun, members of the student council and other new faces make an appearance, causing Kodaka Hasegawa’s life to grow even busier. While they all enjoy going to the amusement park, playing games, celebrating birthdays, and challenging the “school festival”—a symbol of the school life normal people live—the relations amongst the members slowly begins to change… Let the next stage begin, on this unfortunate coming-of-age love comedy!!',2013,'Comedy, Harem, Romance, School, Seinen','Completed'),(367,'Bokura ga Ita','bokura-ga-ita','Nanami Takahashi, a 15 year old high school student, falls in love with and begins dating the most popular guy in school, Yano Motoharu. However, their relationship is not easily maintainable. Yano’s past, as well as the complex emotions they bring up, make it difficult to be completely honest about how he feels. Caught in the middle are Yuri Yamam… more Nanami Takahashi, a 15 year old high school student, falls in love with and begins dating the most popular guy in school, Yano Motoharu. However, their relationship is not easily maintainable. Yano’s past, as well as the complex emotions they bring up, make it difficult to be completely honest about how he feels.    Caught in the middle are Yuri Yamamoto, the younger sister of Yano’s now dead ex-girlfriend, and Takeuchi Masafumi, Yano’s best friend. Yuri’s past with Yano goes deeper than one might suspect and her feelings run deeper than she portrays in public. Takeuchi cherishes Yano’s friendship, but at the same time, he may lose it for someone dear to him. Nanami must search deep inside herself and find her true feelings for Yano while being able to trust and accept Yano’s feelings for her as well, deciding if Yano is indeed the one for her or if someone else can provide better solace. Along the way Nanami will get tips from her love infatuated friends, Mizu and Taka. ~Antoine B.',2006,'Drama, Romance, Shoujo, Slice of Life','Completed'),(368,'Bokura wa Minna Kawaisou','bokura-wa-minna-kawaisou','Usa, a high-school student aspiring to begin a bachelor lifestyle, moves into a new apartment only to discover that he not only shares a room with a perverted roommate that has an obsession for underaged girls, but also that another girl, Ritsu, a love-at-first-sight, is living in the same building as well!',2014,'Drama, Romance, Shoujo, Slice of Life','Completed'),(369,'Bokura wa Minna Kawaisou: Hajimete no','bokura-wa-minna-kawaisou-hajimete-no','Unaired episode bundled on 7th Blu-ray/DVD volume of Bokura wa Minna Kawaisou.',2015,'Comedy, Romance, School, Slice of Life','Completed'),(370,'Bokurano','bokurano','During a summer camp, 15 children, 8 males and 7 females, find a grotto by the sea. Deep within they discover working computers and some electronic equipment, and later the owner, a man called Kokopelli. Kokopelli claimed to be a programmer working on a brand new game, in which a large robot has to defend the Earth against fifteen alien invasions.… more During a summer camp, 15 children, 8 males and 7 females, find a grotto by the sea. Deep within they discover working computers and some electronic equipment, and later the owner, a man called Kokopelli.    Kokopelli claimed to be a programmer working on a brand new game, in which a large robot has to defend the Earth against fifteen alien invasions. He persuades the children to test the game and sign a contract. All but one of them signs, barely a moment later they mysteriously awaken on the shore believing what happened was just a dream.',2007,'Drama, Mecha, Psychological, Sci-Fi','Completed'),(371,'Bokusatsu Tenshi Dokuro-chan','bokusatsu-tenshi-dokuro-chan','In the future, a man named Sakura is destined to create the technology for eternal life, which (due to Sakura’s lolicon tendencies) freezes all women’s aging once they turn twelve. God refuses to allow this, so he sends his angels to the past to kill Sakura before he can do this. But one angel, Dokuro-chan, decides to try to change the future witho… more In the future, a man named Sakura is destined to create the technology for eternal life, which (due to Sakura’s lolicon tendencies) freezes all women’s aging once they turn twelve.    God refuses to allow this, so he sends his angels to the past to kill Sakura before he can do this. But one angel, Dokuro-chan, decides to try to change the future without killing him. Problem is, Dokuro is very temperamental, and is constantly killing Sakura (and lots of other people too) in incredibly bloody ways with her giant spiked club. Good thing she can bring people back to life – if only to grusomely kill them again the next time she loses her temper.',2005,'Comedy, Ecchi, Magic','Completed'),(372,'Bokusatsu Tenshi Dokuro-chan Second','bokusatsu-tenshi-dokuro-chan-second','In the future, a man named Sakura is destined to create the technology for eternal life, which (due to Sakura’s lolicon tendencies) freezes all women’s aging once they turn twelve. God refuses to allow this, so he sends his angels to the past to kill Sakura before he can do this. But one angel, Dokuro-chan, decides to try to change the future witho… more In the future, a man named Sakura is destined to create the technology for eternal life, which (due to Sakura’s lolicon tendencies) freezes all women’s aging once they turn twelve.    God refuses to allow this, so he sends his angels to the past to kill Sakura before he can do this. But one angel, Dokuro-chan, decides to try to change the future without killing him. Problem is, Dokuro is very temperamental, and is constantly killing Sakura (and lots of other people too) in incredibly bloody ways with her giant spiked club. Good thing she can bring people back to life – if only to grusomely kill them again the next time she loses her temper.',2007,'Comedy, Ecchi, Magic','Completed'),(373,'Bonjour: Koiaji Patisserie','bonjour-koiaji-patisserie','The original story follows Sayuri Haruno, a girl who attends an elite confectionery school Fleurir on a scholarship to follow her dream to open a pastry shop. There she meets several charming young men.',2014,'Harem, Romance, Shoujo, Slice of Life','Completed'),(374,'Boogiepop Phantom','boogiepop-phantom','A light in the sky, followed by a strange aura and grisly murders. Each character tells there own connection to the event and to a similar murder spree 5 years ago. All of the different stories are slowly tied together by seemingly minute similarities and the story of Boogiepop is unraveled.',2000,'Dementia, Drama, Horror, Mystery, Psychological, Supernatural','Completed'),(375,'Bottom Biting Bug 2','bottom-biting-bug-2','Bottom biting bug. Continuation of the gag comedy about Oshiri Kajiri Mushi XVIII, a 10-year-old insect who goes to Biting School to inherit his family’s Biting Shop business.',2013,'Comedy, Kids','Completed'),(376,'Bottom Biting Bug 3','bottom-biting-bug-3','A gag comedy about Oshiri Kajiri Mushi XVIII, a 10-year-old insect who goes to Biting School to inherit his family&#039;s Biting Shop business. ',2014,'Comedy, Kids','Completed'),(377,'Bottom Biting Bug 4','bottom-biting-bug-4','A gag comedy about Oshiri Kajiri Mushi XVIII, a 10-year-old insect who goes to Biting School to inherit his family&#039;s Biting Shop business.',2015,'Comedy, Kids','Ongoing'),(378,'Boukyaku no Senritsu','boukyaku-no-senritsu','A great war occurred in the 20th century between humans and monsters. Since that time, the monsters rule the world in fear but keep relatively hidden from public view. A boy named Bokka ponders the past and wonders what became of the Meros Warriors who defended the world so bravely against the demons. He soon meets Kurofune and learns of the power… more A great war occurred in the 20th century between humans and monsters. Since that time, the monsters rule the world in fear but keep relatively hidden from public view. A boy named Bokka ponders the past and wonders what became of the Meros Warriors who defended the world so bravely against the demons. He soon meets Kurofune and learns of the power of the Meros and the I-bar machines they ride in battle. Warriors are the only ones who can see and hear the Melody of Oblivion, a phantom girl hidden away waiting to be rescued and be the savior of mankind.    During a battle between Kurofune and a demon, Bokka discovers something only his wildest dreams could possibly imagine…he too can hear that melody. Throughout his journeys, Bokka meets many monsters and their agents, friends, and companions as he discovers the true extent of his new powers. He must continue to battle evil in the hope of releasing Boukyaku no Senritsu and free a world that has forgotten its once beautiful melody.',2004,'Adventure, Fantasy, Horror, Mecha, Psychological, Sci-Fi, Shounen, Space, Supernatural','Completed'),(379,'Boys Be…','boys-be','',0,'','Completed'),(380,'Brave 10','brave-10','The story reimagines the legendary adventures of the 10 brave warriors assembled by the warlord Sanada Yukimura in the year 1600, in the middle of Japan’s tumultuous Sengoku (Warring States) era.',2012,'Action, Adventure, Historical, Samurai, Seinen, Super Power','Completed'),(381,'Brave Beats','brave-beats','Hibiki Kazaguruma, a sixth grader, meets an amusing little robot named Bureikin while coming home from school one day. Bureikin, a dancer from an alternate-dimension dance world, challenged the dance king for the throne and lost. He has been deprived of Dance Stones (the stones of dance power) and sent to the human world. To restore his power, Bureikin must collect all the Dance Stones scattered around Earth.',2015,'Adventure, Music','Ongoing'),(382,'Brave King GaoGaiGar','brave-king-gaogaigar','In the year 2005, a race of alien monsters called Zonders emerge from underground and launch a series of attacks on the city of Tokyo. The only defense against these creatures is the secret agency known as the Gutsy Geoid Guard (or 3G) and their ultimate weapon, the awesome giant robot GaoGaiGar. GaoGaiGar’s pilot, Guy Shishio, is a former astronau… more In the year 2005, a race of alien monsters called Zonders emerge from underground and launch a series of attacks on the city of Tokyo. The only defense against these creatures is the secret agency known as the Gutsy Geoid Guard (or 3G) and their ultimate weapon, the awesome giant robot GaoGaiGar. GaoGaiGar’s pilot, Guy Shishio, is a former astronaut who was nearly killed two years before when the Zonders first crashed to earth. Guy’s life was spared when a mysterious robot lion called Galeon pulled him from the burning shuttle and brought him to Earth.    Guy’s father, Leo, then used Galeon’s technology to rebuild his shattered son as a cyborg, in the hopes that he could stop the aliens when they appear. Now, with Galeon as its core, GaoGaiGar fights to protect Earth. He is aided by a team of transforming robots and by a young boy named Mamoru, who has the power to purify the Zonders’ cores, and seems to be connected to the mysterious Galeon.',1998,'Adventure, Mecha, Sci-Fi, Shounen','Completed'),(383,'Brave Story','brave-story','Wataru is a 10-year-old fifth grade elementary school student. His grades are so-so and he is a meek and unassertive boy, easily manipulated by girls. One day his father runs off with a mistress, leaving Wataru and his mother behind.    In shock, his mother suffers an accident and is near death. Broken-hearted, Wataru enters a neighbourhood building that is reputedly haunted. The building actually is the entrance to a delusional world called Vision, in which Wataru must master magic techniques and collect hidden treasures to meet a goddess, who, it is believed, can make wishes come true. Together with new friends he meets there, Wataru&#039;s magnificent journey through Vision begins...',2006,'Action, Adventure, Fantasy, Kids, Magic, Supernatural','Completed'),(384,'Brave Story Movie','brave-story-movie','When 11 year old Wataru&#039;s father leaves home and his mother is taken ill to hospital, he decides to change his fate by traveling through the door shown to him by his friend Mitsuru. In a land of magic and monsters, Wataru must summon all his courage and embark on a journey with several comrades to meet the Goddess of Destiny and change this &quot;mistaken fate&quot;.',2006,'Action, Adventure, Fantasy, Kids, Magic, Supernatural','Completed'),(385,'Break Blade','break-blade','The inhabitants of the continent of Cruzon are born with the ability to freely control quartz. Technology based on this power allows them to perform a great multitude of tasks such as shoot projectiles and pilot mobile suits (called Golems in this society). Rygart Arrow is an un-sorcerer, a rare individual who is unable to levitate even the smalles… more The inhabitants of the continent of Cruzon are born with the ability to freely control quartz. Technology based on this power allows them to perform a great multitude of tasks such as shoot projectiles and pilot mobile suits (called Golems in this society). Rygart Arrow is an un-sorcerer, a rare individual who is unable to levitate even the smallest crystal. Living with his brother on a farm, he receives a letter from an old friend, Hodr, the current king.    Close companion of the king and queen when they were students at Assam Military School, Arrow is informed that a war is about to occur. Hodr called him because an ancient type of Golem has been found in a mining shaft. No one has been able to move it and Queen Sigyn, an expert engineer, suspects that maybe an un-sorcerer might be the key to activate it.',2014,'Action, Fantasy, Mecha, Military, Shounen','Completed'),(386,'Break Blade (2014)','break-blade-2014','In the continent of Cruzon, an impending war between the Kingdom of Krisna and the nation of Athens is brimming. The people of this land are able to use quartz for whatever purpose they desire. Yet one person, Rygart Arrow, is not. He is an &quot;un-sorcerer,&quot; a person unable to use quartz. But this characteristic will enable him to pilot an ancient Golem, one strong enough to put up a fight against the invading army of Athens.',2014,'Action, Mecha, Military, Shounen','Completed'),(387,'Break Blade 1: Kakusei no Toki (2010)','break-blade-1-kakusei-no-toki-2010','Summary: In the continent of Cruzon, an impending war between the Kingdom of Krisna and the nation of Athens is brimming. The people of this land are able to use quartz for whatever purpose they desire. Yet one person, Rygart Arrow, is not. He is an &quot;un-sorcerer,&quot; a person unable to use quartz. But this characteristic will enable him to pilot an ancient Gol… more In the continent of Cruzon, an impending war between the Kingdom of Krisna and the nation of Athens is brimming. The people of this land are able to use quartz for whatever purpose they desire. Yet one person, Rygart Arrow, is not. He is an &quot;un-sorcerer,&quot; a person unable to use quartz. But this characteristic will enable him to pilot an ancient Gol… more In the continent of Cruzon, an impending war between the Kingdom of Krisna and the nation of Athens is brimming. The people of this land are able to use quartz for whatever purpose they desire. Yet one person, Rygart Arrow, is not. He is an &quot;un-sorcerer,&quot; a person unable to use quartz. But this characteristic will enable him to pilot an ancient Golem, one strong enough to put up a fight against the invading army of Athens. less - See more at: http://www.animegetdev.com/break-blade-1-kakusei-no-toki-movie#sthash.rDdVQwNQ.dpuf',2010,'Action, Fantasy, Mecha, Military, Shounen','Completed'),(388,'Break Blade 2: Ketsubetsu no Michi (2010)','break-blade-2-ketsubetsu-no-michi-2010','Second Break Blade movie.',2010,'Action, Fantasy, Mecha, Military, Shounen','Completed'),(389,'Break Blade 3: Kyoujin no Ato (2010)','break-blade-3-kyoujin-no-ato-2010','Third Break Blade movie.',2010,'Action, Fantasy, Mecha, Military, Shounen','Completed'),(390,'Brothers Conflict','brothers-conflict-','Hinata Ema is the only daughter of a famous adventurer, Hinata Rintarou. One day, Ema learns that Rintarou is going to remarry with a successful apparel maker named Asahina Miwa. Since she doesn’t want to disturb them, Ema decides to move out and live with her 11 new brothers in a mansion called Sunrise Residence. As they live under the same roof,… more Hinata Ema is the only daughter of a famous adventurer, Hinata Rintarou.    One day, Ema learns that Rintarou is going to remarry with a successful apparel maker named Asahina Miwa. Since she doesn’t want to disturb them, Ema decides to move out and live with her 11 new brothers in a mansion called Sunrise Residence. As they live under the same roof, romance is starting to grow between Ema and the Asahina brothers.',2013,'Harem, Romance, Shoujo','Completed'),(391,'Brothers Conflict OVA','brothers-conflict-ova','According to its official site, Brothers Conflict will get two OVAs about Christmas and Valentine&#039;s Day released in 2014 and 2015. New OP and ED songs by the same singers will be presented in these two OVAs.',2014,'Harem, Romance, Shoujo','Completed'),(392,'Btooom!','btooom','The story centers around Ry?ta Sakamoto, a NEET (Not in Education, Employment, or Training) young man and a top-ranked player in the online combat game Btoom! One day, he wakes up on a tropical island without remembering how he got there. He sees a figure in the distance and asks for help. However, the figure responds by throwing something at Ry?ta… more The story centers around Ry?ta Sakamoto, a NEET (Not in Education, Employment, or Training) young man and a top-ranked player in the online combat game Btoom! One day, he wakes up on a tropical island without remembering how he got there.    He sees a figure in the distance and asks for help. However, the figure responds by throwing something at Ry?ta — a “BIM” bomb. In that moment, Ry?ta comes to realize two things: one, his own life is in danger, and two, he is now in the world of Btoom!',2012,'Action, Psychological, Sci-Fi, Seinen','Completed'),(393,'Bubblegum Crisis: Tokyo 2040','bubblegum-crisis-tokyo-2040','After a mysterious earthquake levels Tokyo, Genom becomes a powerful influence providing their artificial organic lifeforms called Boomers to rebuild and act as a labor class to humanity. However, some of them occasionally run amok, and even the specially created AD Police are at a loss to stop them. Lina Yamazaki travels to Tokyo for employment bu… more After a mysterious earthquake levels Tokyo, Genom becomes a powerful influence providing their artificial organic lifeforms called Boomers to rebuild and act as a labor class to humanity.    However, some of them occasionally run amok, and even the specially created AD Police are at a loss to stop them. Lina Yamazaki travels to Tokyo for employment but also hopes to join a vigilante force called the Knight Sabers, who pilot powered suits to destroy these rogue Boomers.',1998,'Adventure, Mecha, Sci-Fi, Shounen','Completed'),(394,'Buddha 2: Tezuka Osamu no Buddha Owarinaki Tabi (2014)','buddha-2-tezuka-osamu-no-buddha-owarinaki-tabi-2014','Second Buddha movie from Tezuka Productions.',2014,'Drama, Historical, Supernatural','Completed'),(395,'Buddha Saitan Movie','buddha-saitan-movie','17-year-old Sayako Amanokawa aspires to become a journalist, just like Kanemoto, an elite newspaper writer she looks up to. But Kanemoto, shamed from an erroneous report about a corruption scandal, jumps in front of a train and commits suicide. Since that incident, Sayako suddenly becomes able to see spirits and almost loses her life. However, from that near-fatal incident she experiences something extraordinary. The journalist inside her stirred, she embarks to find out about the truth. But the forces that stand in her way turn out to be much more formidable than she ever imagined.',2014,'Psychological, Romance, Supernatural','Completed'),(396,'Buddy Complex','buddy-complex','The story will revolve around the friendship and coming-of-age of two boys. It begins with Aoba Watase, a boy who goes to high school in Tokyo and lives a carefree daily life. On the morning of his school’s opening ceremony after summer vacation, he goes to campus as usual, but he has a chance encounter with another boy.',2014,'Action, Mecha, Sci-Fi','Completed'),(397,'Buddy Complex: Kanketsu-hen - Ano Sora ni Kaeru Mirai de','buddy-complex-kanketsu-hen-ano-sora-ni-kaeru-mirai-de','Sequel of Buddy Complex.',2014,'Action, Mecha, Sci-Fi','Completed'),(398,'Bungaku Shoujo','bungaku-shoujo','The story is in the motif of Japanese classic novel Night on the Galactic Railroad (Ginga Tetsudo no Yoru) written by Miyazawa Kenji, set in a high school and its literary club. Inoue Konoha, a second-year high school boy who suffers a trauma, is one day partly forced to join the literary club by the club president Amano Tooko. Amano Tooko, a high school senior who calls herself the Literary Girl (Bungaku Shoujo), is actually a spectre that devours stories — she tears pages from books to munch on them.     Every day thus Konoha writes stories for Tooko to eat. He once wrote an award-winning novel, but he wrote it under the pen-name Inoue Miu so readers thought the author was a mysterious 14-year-old bishoujo novelist. Following his trauma he stopped writing at once, but forced to provide Tooko&#039;s snacks, he starts writing again. And so the two live a peaceful everyday life. However, one day the origin of his trauma, a girl named Asakura Miu, appears in front of him...',2010,'Drama, Mystery, Romance, School','Completed'),(399,'Bungaku Shoujo Memoir','bungaku-shoujo-memoir','T?ko Amano is a high school student with the strange power of being able to experience books by savoring them. While visiting the workplace of her deceased father, she stumbles upon the rejected drafts for a writing contest. One of them has such an impact on her that she asks her acquaintance there to give it one more chance. Asakura Miu lives a s… more T?ko Amano is a high school student with the strange power of being able to experience books by savoring them. While visiting the workplace of her deceased father, she stumbles upon the rejected drafts for a writing contest. One of them has such an impact on her that she asks her acquaintance there to give it one more chance. Asakura Miu lives a sad and troublesome childhood due to her parents’ constant fighting. Eventually her father leaves the house and she ends up living with her bitter mother. Miu has been desperately trying to escape the harsh reality that surrounds her to the only safe place she knows: the worlds inside the books she loves.    Ostracized by the kids at school due to her imaginative mind that prompts her to frequently lie, she becomes a friend of Konoha Inoue who rather than estranged, ends up fascinated by Asakura’s tales. Unable to express her feelings toward the boy she likes, Nanase Kotobuki inadvertently makes it look like she hates Konoha Inoue instead. Her best friend, Kurara Mori, tries to help as Kotobuki attempts to clear the misunderstandings she has created.',2010,'Drama, Mystery, Romance, School','Completed'),(400,'Burn Up Excess','burn-up-excess','Follows the exploits of Team Warrior, a special anti-terror wing of the Neo-Tokyo Police force. Team Warrior is comprised of the habitually broke Rio, gun-crazy Maya, computer specialist Lillica, tech-expert Nanvel, pilot/voyeur Yuji, and is led by the enigmatic Maki. The team faces a number of missions, ranging from bodyguard duty, breaking up rob… more Follows the exploits of Team Warrior, a special anti-terror wing of the Neo-Tokyo Police force. Team Warrior is comprised of the habitually broke Rio, gun-crazy Maya, computer specialist Lillica, tech-expert Nanvel, pilot/voyeur Yuji, and is led by the enigmatic Maki. The team faces a number of missions, ranging from bodyguard duty, breaking up robbery and arms rackets, and providing security for a very powerful tank.    Rio and company continually thwart the terrorist aims of Ruby, an operative for a shadowy cabal of powerful men. Before the final showdown, the circumstances behind the formation of Team Warrior, how the precocious Rio came to join it, and Maki’s painful past will be revealed.',1997,'Action, Adventure, Comedy, Ecchi, Police, Sci-Fi, Shounen','Completed'),(401,'Burn Up Scramble','burn-up-scramble','AD. 2023, Tokyo. Because of the change of the society such as internationalization and enlargement of the trading, the dark side of the society also continues changing. The criminals are getting deep, and their organizations are increasing its size, then the peace and security is getting worse. The government takes it seriously, and decides to introduce an innovative system. In order to cope with the special criminals, an extralegal police is founded. It is a special criminal team, Warriors, which consists of a few elite members',1997,'Action, Adventure, Comedy, Ecchi, Police, Sci-Fi, Shounen','Completed'),(402,'Burn Up W','burn-up-w','When crime and terrorism go out of control in Tokyo, the police unleash Team Warrior – a band of highly-skilled and completely reckless band of female cops. Featuring loose cannon Rio, triggerhappy Maya and ace hacker Lilica, Team Warrior will get the job done, regardless of the budget of the mission.',1996,'Comedy, Mecha, Sci-Fi, Shounen','Completed'),(403,'Burst Angel','burst-angel','In a crime-ridden future Japan, Kyohei Tachibana is a peaceful student at a culinary school, dreaming of going to France for advanced study as a patissier (pastry chef). To afford the trip, he accepts a part-time job as private cook to a strange group of women – Sei, Meg, Jo and Amy. To Kyohei’s astonishment, they turn out to be a band of violent m… more In a crime-ridden future Japan, Kyohei Tachibana is a peaceful student at a culinary school, dreaming of going to France for advanced study as a patissier (pastry chef).    To afford the trip, he accepts a part-time job as private cook to a strange group of women – Sei, Meg, Jo and Amy. To Kyohei’s astonishment, they turn out to be a band of violent mercenaries, and he finds himself in the line of fire.',2004,'Adventure, Comedy, Mecha, Sci-Fi, Shounen','Completed'),(404,'Bus Gamer','bus-gamer','When three complete strangers, Mishiba Toki, Nakajyo Nobuto and Saitoh Kazuo, are hired by a corporation to compete in the Bus Game, an illegal dog-fight conducted in strict secrecy, they are given the team code of “Team AAA” (Triple Anonymous). This group of three who differ entirely from their living environments to their personalities have to wo… more When three complete strangers, Mishiba Toki, Nakajyo Nobuto and Saitoh Kazuo, are hired by a corporation to compete in the Bus Game, an illegal dog-fight conducted in strict secrecy, they are given the team code of “Team AAA” (Triple Anonymous).    This group of three who differ entirely from their living environments to their personalities have to work together effectively, but without mutually wiping out their mistrust of each other or prying into each other’s privacy. They only have one point in common – each of them need a large amount of money for their individual circumstances. To get the money, they must play in the game despite their very own lives being at stake.',2008,'Action','Completed'),(405,'Buso Renkin','buso-renkin','One night, Kazuki Muto jumps in to try to save what he thinks is a girl in distress from a monster and instead gets impaled through the heart. The girl, Tokiko, is actually an alchemic warrior with a Busou Renkin, name of Valkerie Skirt, with the mission to exterminate Homunculi. She implants the only other successful work of alchemy than the Homun… more One night, Kazuki Muto jumps in to try to save what he thinks is a girl in distress from a monster and instead gets impaled through the heart. The girl, Tokiko, is actually an alchemic warrior with a Busou Renkin, name of Valkerie Skirt, with the mission to exterminate Homunculi.    She implants the only other successful work of alchemy than the Homunculus, the Kakugane, to take the place of Kazuki’s heart. The Kakugane resonates with his fighting spirit and forms a Busou Renkin (in his case a spear) so he can fight the Homunculus monsters who prey on humans. Kazuki joins with Tokiko to battle with the Homunculi and protect his friends and his sister Mahiro',2006,'Action, Comedy, Fantasy, School, Shounen, Supernatural','Completed'),(406,'Busou Chuugakusei Basket Army','busou-chuugakusei-basket-army','The story is set in August of 2026 at the Fuji Training Facility. Natori Touko, a third-year middle school student in the Eastern Private Defense Academy, is entrenched in field training with instructor Kamiya. It has been a harsh training regiment, but it is finally the last day. Kamiya proposes a extracurricular class under the name Newest Weapon… more The story is set in August of 2026 at the Fuji Training Facility.    Natori Touko, a third-year middle school student in the Eastern Private Defense Academy, is entrenched in field training with instructor Kamiya. It has been a harsh training regiment, but it is finally the last day. Kamiya proposes a extracurricular class under the name Newest Weapons Research. But then, an incident occurs that rocks all of Japan.',2011,'Action, Military','Completed'),(407,'Busou Shinki','busou-shinki','High school freshman Rihito, who just came back from abroad, started a new life in Japan with his four Busou Shinki, female action figures with weapons.',2012,'Action, Sci-Fi, Slice of Life','Completed'),(408,'Busou Shinki Moon Angel','busou-shinki-moon-angel','The story will follow the coming of age and Shinki battles of Tsubasa, a boy who dreams of becoming a Shinki Master, and his Shinki partner Arnval Mk. 2.',2011,'Action, Sci-Fi','Completed'),(409,'Butt Attack Punisher Girl Gautaman','butt-attack-punisher-girl-gautaman','Our heroine Mari is an innocent, boy-shy, devoutly Christian young girl who&#039;s just entered a religious high school. When her best friend is kidnapped by a mysterious cult, Mari prays to the Virgin Mary for help. Instead, the Buddha shows up and tells her that she&#039;s going to be a magical girl.    But not just any magical girl, mind you...none of this fuku-wearing, pink-wand-waving crap. She is presented with a sumo-style loincloth (magical, of course) and instructed to go kick bad guy butt. Being a good little Christian girl, the Buddha has to talk Mari into it, but she grudgingly agrees to bare her ass for the sake of her friend. And so Butt Attack Punisher Girl Gotaman was born! Villains beware her mighty ass of justice! Wedgies only make her stronger! Not even Darth Veda sumo can withstand her mighty posterior!',1994,'Action, Comedy, Ecchi, Parody','Completed'),(410,'Buzzer Beater (2005)','buzzer-beater-2005','Hideyoshi is a homeless boy living in New York in the near future, who survives by hustling other kids in basketball games. But now he’s been drafted into a pro team-a pro team with a very unique goal. There once was a time when humans dominated the game of basketball. But times have changed, and now the physically superior alien players have taken… more Hideyoshi is a homeless boy living in New York in the near future, who survives by hustling other kids in basketball games. But now he’s been drafted into a pro team-a pro team with a very unique goal.    There once was a time when humans dominated the game of basketball. But times have changed, and now the physically superior alien players have taken over the game, and there are barely any human players next. But Hideyoshi’s team-the first all-human team to compete in the Space League-intends to change all that, and bring the championship back home to Earth.',2005,'Shounen, Sports','Completed'),(411,'Buzzer Beater (2007)','buzzer-beater-2007','After being drafted into the Earth Team – a basketball team comprised solely of humans – street-punk-turned-pro Hideyoshi couldn’t be more cocky. The team is still up against the Gorons, a physically superior race of aliens who have dominated the game for some time. New challenges and problems stand in their way. Hideyoshi is unhappy with the team… more After being drafted into the Earth Team – a basketball team comprised solely of humans – street-punk-turned-pro Hideyoshi couldn’t be more cocky.    The team is still up against the Gorons, a physically superior race of aliens who have dominated the game for some time. New challenges and problems stand in their way. Hideyoshi is unhappy with the team and the Gorons have new tricks up their sleeves.',2007,'Action, Sci-Fi, Shounen','Completed'),(412,'C – The Money of Soul and Possibility Control','c-the-money-of-soul-and-possibility-control','The Japanese government was rescued from the brink of financial collapse by the Sovereign Wealth Fund. For its citizens, however, life has not improved, and unemployment, crime, suicide, and despair are rampant. Kimimaro, raised by his maternal grandmother after the disappearance of his father and the death of his mother, is a scholarship student w… more The Japanese government was rescued from the brink of financial collapse by the Sovereign Wealth Fund. For its citizens, however, life has not improved, and unemployment, crime, suicide, and despair are rampant.    Kimimaro, raised by his maternal grandmother after the disappearance of his father and the death of his mother, is a scholarship student whose only dream is to avoid all this and live a stable life. One day, however, he meets a man who offers him a large sum of money if he’ll agree to pay it back. From then on his fate is radically altered as he’s drawn into a mysterious realm known as “The Financial District.”',2011,'Action, Mystery, Super Power, Thriller','Completed'),(413,'C3 Cube x Cursed x Curious','c3-cube-x-cursed-x-curious','Haruaki Yachi is a high school student living alone in an old solitary home. When he wakes to a suspicious sound in his kitchen, he finds… a naked rice thief. The woman calls herself “Fear” and claims to be a cursed tool who has come Yachi’s home to remove her curse. Since he’s affected by the curse, Fear ends up moving in with Haruaki, and that’… more Haruaki Yachi is a high school student living alone in an old solitary home. When he wakes to a suspicious sound in his kitchen, he finds… a naked rice thief. The woman calls herself “Fear” and claims to be a cursed tool who has come Yachi’s home to remove her curse.    Since he’s affected by the curse, Fear ends up moving in with Haruaki, and that’s where the story begins. A wide variety of organizations are out to worship, study, or even destroy this cursed tool, however–, so it’s up to Haruaki and his neighbors Konoha and Kuroe, to fight them and defend Fear, who is no slouch herself. Lots of action (and some occasional fan service) ensues!',2012,'Action, Comedy, Ecchi, School, Shounen, Supernatural','Completed'),(414,'C3 Cube x Cursed x Curious OVA','c3-cube-x-cursed-x-curious-ova','Haruaki Yachi is a high school student living alone in an old solitary home. When he wakes to a suspicious sound in his kitchen, he finds… a naked rice thief. The woman calls herself “Fear” and claims to be a cursed tool who has come Yachi’s home to remove her curse. Since he’s affected by the curse, Fear ends up moving in with Haruaki, and that’… more Haruaki Yachi is a high school student living alone in an old solitary home. When he wakes to a suspicious sound in his kitchen, he finds… a naked rice thief. The woman calls herself “Fear” and claims to be a cursed tool who has come Yachi’s home to remove her curse. Since he’s affected by the curse, Fear ends up moving in with Haruaki, and that’s where the story begins.    A wide variety of organizations are out to worship, study, or even destroy this cursed tool, however–, so it’s up to Haruaki and his neighbors Konoha and Kuroe, to fight them and defend Fear, who is no slouch herself. Lots of action (and some occasional fan service) ensues!',2012,'Action, Comedy, Ecchi, School, Shounen, Supernatural','Completed'),(415,'California Crisis OVA','california-crisis-ova','Noera is heading to work after drinking all night with a friend when he meets Marcia, a young biker heading towards Los Angeles. They abruptly get involved in a car chase and Marcia ends up retrieving a locked metal box from one of the pursued vehicles. Within it, a dark sphere. Many people want the orb at any cost forcing Noera and Marcia to desperately run away while trying to figure out what exactly is the strange object they are carrying.',1986,'Action, Adventure, Comedy','Completed'),(416,'Campione!','campione','Campion is anime about Kusanagi Godo is a 16-year-old high school boy and Erica Brandelli is a 16-year-old Italian girl. They fight together to defeat Verethragna.    Campion is anime about Kusanagi Godo is a 16-year-old high school boy and Erica Brandelli is a 16-year-old Italian girl. They fight together to defeat Verethragna.  When was just 15 years old, Godo killed the god “Verethragna” and get the title of “Campione (god killer)”.  Erica is a “Great Knight” of the magic society “Bronze Black Cross”.  After getting  title of “Campione”, Godo have to in battles against other Campiones and uncontrollable gods.',2012,'Comedy, Ecchi, Fantasy, Harem, Magic, Romance','Completed'),(417,'CANAAN','canaan','The modern-day story centers on a present-day story about a detective, a young man, a virus researcher, a, and a cat mascot character who are brought together in the Tokyo neighborhood of Shibuya by bizarre events with worldwide implications.',2009,'Action, Seinen','Completed'),(418,'Candidate For Goddess','candidate-for-goddess','In the future humankind has expanded and colonized other planets. Then an alien species, Victim, attacks the human colonies leaving only one planet, Zion. In an effort to stop Victim from destroying the last planet a training school, GOA, is set up to gather boys from the Zion colonies and train them to become pilots of the Ingrids AKA The Goddesse… more In the future humankind has expanded and colonized other planets. Then an alien species, Victim, attacks the human colonies leaving only one planet, Zion. In an effort to stop Victim from destroying the last planet a training school, GOA, is set up to gather boys from the Zion colonies and train them to become pilots of the Ingrids AKA The Goddesses, five fighting robots that protect Zion. The boys must possess a rare blood type, EO , as well as a special ability, or EX.    Zero (Candidate 88) has just arrived in GOA when he falls into the cockpit of the Ingrid Eeva-Leena. Since the synch between pilot and Ingrid are very sensitive everyone believes the Goddess will kill Zero in an attempt to synch. Just before Zero passes out he makes a full synch with the Goddess. Before he can find out more about the incident, his pilot training begins.',2000,'Action, Mecha, Military, Sci-Fi, Space','Completed'),(419,'Candidate For Goddess OVA','candidate-for-goddess-ova','In the future humankind has expanded and colonized other planets. Then an alien species, Victim, attacks the human colonies leaving only one planet, Zion. In an effort to stop Victim from destroying the last planet a training school, GOA, is set up to gather boys from the Zion colonies and train them to become pilots of the Ingrids AKA The Goddesse… more In the future humankind has expanded and colonized other planets. Then an alien species, Victim, attacks the human colonies leaving only one planet, Zion. In an effort to stop Victim from destroying the last planet a training school, GOA, is set up to gather boys from the Zion colonies and train them to become pilots of the Ingrids AKA The Goddesses, five fighting robots that protect Zion. The boys must possess a rare blood type, EO , as well as a special ability, or EX. Zero (Candidate 88) has just arrived in GOA when he falls into the cockpit of the Ingrid Eeva-Leena.    Since the synch between pilot and Ingrid are very sensitive everyone believes the Goddess will kill Zero in an attempt to synch. Just before Zero passes out he makes a full synch with the Goddess. Before he can find out more about the incident, his pilot training begins.',2002,'Action, Mecha, Military, Sci-Fi, Space','Completed'),(420,'Candy Boy','candy-boy','Yukino and Kanade Sakurai live together as high school students enjoying their daily life; until one day Sakuya Kamiyama confess her love for Kanade to Yukino, asking for her support. This makes Yukino to release her true feelings for her sister.',2008,'Romance, School, Shounen Ai','Completed'),(421,'Candy Boy Ex01 Special','candy-boy-ex01-special','Yukino and Kanade Sakurai live together as high school students enjoying their daily life; until one day Sakuya Kamiyama confess her love for Kanade to Yukino, asking for her support. This makes Yukino to release her true feelings for her sister.',2008,'School, Shounen Ai, Slice of Life','Completed'),(422,'Canvas 2: Niji Iro No Sketch','canvas-2-niji-iro-no-sketch','Kamikura Hiroki is an art student at the local school Nadesico Achedemy (High School and colledge level) that tends to be an arts teacher in the future. He is also the advisor to the high school arts society where his cousin, Housen Ellse attends. While Ellse is a painter like Hiroki, Hiroki seems to have given up on his dreams and no longer paints… more Kamikura Hiroki is an art student at the local school Nadesico Achedemy (High School and colledge level) that tends to be an arts teacher in the future. He is also the advisor to the high school arts society where his cousin, Housen Ellse attends.    While Ellse is a painter like Hiroki, Hiroki seems to have given up on his dreams and no longer paints. There appears to be some mysterious trauma in the past for both of them that have changed them. Meanwhile, the high school hires a new PE teacher, Kikyo Kiri. On the first day, she bumps into Hiroki and is stunned. Here is the boy she confessed to and he refused her.',2005,'Comedy, Drama, Romance, Slice of Life','Completed'),(423,'Capeta','capeta','Taira Kappeita, or Capeta, was a 4th grader boy. He had lost his mother when he had been very little. Although he pretended to be tough in front of his father, actually he felt lonely. One day, his father brought junk parts home from his workplace and made a racing cart. Soon, they went to a circuit to drive the cart. However, Capeta found that its… more Taira Kappeita, or Capeta, was a 4th grader boy. He had lost his mother when he had been very little. Although he pretended to be tough in front of his father, actually he felt lonely. One day, his father brought junk parts home from his workplace and made a racing cart.    Soon, they went to a circuit to drive the cart. However, Capeta found that its frame was bent and it could hardly run straight. But, with his technique he managed the cart. Furthermore, he followed soon after the fast cart and he could nearly leave it behind. The driver in the cart was Minamoto Naomoi, the champion of the East Japan Junior Cart. Looking at their chase, Naomi’s mother, Minamoto Nanako, advised Capeta to take part in the official race.',2005,'Cars, Shounen, Sports','Completed'),(424,'Captain Earth','captain-earth','An original mecha anime by the team that made Star Driver. One night right before summer vacation, Daichi Manatsu, a second-year in high school, sees a weird round rainbow floating in the sky above Seed Island (Shuushi/Tane Island) and ventures there alone. He has seen this rainbow before. With the memories of his father&#039;s mysterious death and an encounter of a mysterious boy and girl, Daiji arrives on the island while the alarm of a building labeled &quot;Earth Engine&quot; is going off. Someone asks him &quot;Are you a captain?&quot; just as robotic intruders from Uranus called &quot;Kiltgang&quot; arrive. The battle around the shining stars is about to begin.',2014,'Action, Mecha, Sci-Fi','Completed'),(425,'Captain Harlock (2013)','captain-harlock-2013','A CGI remake of the original Captain Harlock series.    Captain Harlock rebelled against the Allied Forces and has been plundering space ships for one hundred years. Why did he rebel? How does he survive for one hundred years? With awe and fear of the legendary captain, the Allied Forces issues an order to assassinate Harlock.',2013,'Action, Drama, Sci-Fi, Space','Completed'),(426,'Captain Planet and the Planeteers Season 2','captain-planet-and-the-planeteers-season-2','Seeing the Earth in its profound environmental peril, Gaia, goddess of the Earth, summons five kids from around the world to become the Planeteers, an opposing force to fight back and educate others in the need to be environmentally responsible. To accomplish that task, each kid is given a magic ring that each has a power of earth, wind, water, fir… more Seeing the Earth in its profound environmental peril, Gaia, goddess of the Earth, summons five kids from around the world to become the Planeteers, an opposing force to fight back and educate others in the need to be environmentally responsible.    To accomplish that task, each kid is given a magic ring that each has a power of earth, wind, water, fire and heart. When the threat they face is too big for them to face, they can combine and amplify their powers to create Captain Planet, who has the power to stop catastrophic environmental disasters himself, while the Planeteers contribute with the things anyone can and should do to help',0,'','Completed'),(427,'Captain Planet and the Planeteers Season 3','captain-planet-and-the-planeteers-season-3','Seeing the Earth in its profound environmental peril, Gaia, goddess of the Earth, summons five kids from around the world to become the Planeteers, an opposing force to fight back and educate others in the need to be environmentally responsible. To accomplish that task, each kid is given a magic ring that each has a power of earth, wind, water, fir… more Seeing the Earth in its profound environmental peril, Gaia, goddess of the Earth, summons five kids from around the world to become the Planeteers, an opposing force to fight back and educate others in the need to be environmentally responsible.    To accomplish that task, each kid is given a magic ring that each has a 