h that task, each kid is given a magic ring that each has a power of earth, wind, water, fir… more Seeing the Earth in its profound environmental peril, Gaia, goddess of the Earth, summons five kids from around the world to become the Planeteers, an opposing force to fight back and educate others in the need to be environmentally responsible. To accomplish that task, each kid is given a magic ring that each has a power of earth, wind, water, fire and heart. When the threat they face is too big for them to face, they can combine and amplify their powers to create Captain Planet, who has the power to stop catastrophic environmental disasters himself, while the Planeteers contribute with the things anyone can and should do to help',0,'','Completed'),(432,'Captain Tsubasa – Asu ni Mukatte Hashire!','captain-tsubasa--asu-ni-mukatte-hashire','The firt 36 episodes are remade summaries of the first three series (Captain Tsubasa, Shin CT and CT J): Tsubasa’s career with Nankatsu and the different championships in Japan with all the main characters of the series; the U-16 world cup in Europe, as well as Tsubasa’s career with Roberto in Brazil. After that, the new episodes start, telling abo… more The firt 36 episodes are remade summaries of the first three series (Captain Tsubasa, Shin CT and CT J): Tsubasa’s career with Nankatsu and the different championships in Japan with all the main characters of the series; the U-16 world cup in Europe, as well as Tsubasa’s career with Roberto in Brazil.    After that, the new episodes start, telling about a match against Holland and about the three most extraordinary main characters on their hard but spectacular way to become soccer professionals in Europe: The soccer genius Tsubasa Ozora, the top goalkeeper Genzo Wakabayashi and the pround and strong striker Kojiro Hyuga.',1986,'Action, Shounen, Sports','Completed'),(433,'Captain Tsubasa – Saikyou no Teki! Holland Youth','-captain-tsubasa-saikyou-no-teki-holland-youth','The last Captain Tsubasa movie is about the match between Japan and Holland. After the Japanese team lost two games against this apparently supreme opponent, their confidence is at its lowest point and even Hyuga, having a hurt leg, is desperate. Thus the management tries everything to convince Wakabayashi (living in Germany) and Tsubasa (living in Brazil) to come to Holland and to help them, but both deny. Only in the second half of the third game Tsubasa appears and joins the team, giving them back their confidence and strength. With Tsubasa Ozora as their captain again, the last game ends 11:1 for Japan.',1995,'Action, Shounen, Sports','Completed'),(434,'Captain Tsubasa: Ayaushi! Zen Nihon Jr','captain-tsubasa-ayaushi-zen-nihon-jr','The second movie is about the return match between the All Europe Soccer Team and Japan. At the beginning Hyuga denies to join the team due to his 3. defeat against Nankatsu. He practices hard with Kyra to perfect his Tiger Shot. Misaki can&#039;t come and Wakabayashi isn&#039;t allowed to play for he normally plays for a German team.    With those lacks and Schneider&#039;s (the European&#039;s captain) improved skills, Tsubasa and the Japanese team have grave problems. Despite the new rules, Schneider finally want&#039;s to beat his rival Wakabayashi with his new &quot;illusion shot&quot;, thus he injures Wakashimazu and Murisaki (the second and third goal keeper) with brutal face shots until Wakabayashi is finally allowed to play. In the course of the match Hyuga manages to perfect his Tiger Shot and joins the team. With those legendary players united and Hyugas new power they manage to defeat their opponent 4:3 in the last minutes.',1985,'Action, Shounen, Sports','Completed'),(435,'Captain Tsubasa: Road to 2002','captain-tsubasa-road-to-2002','The firt 36 episodes are remade summaries of the first three series (Captain Tsubasa, Shin CT and CT J): Tsubasa’s career with Nankatsu and the different championships in Japan with all the main characters of the series; the U-16 world cup in Europe, as well as Tsubasa’s career with Roberto in Brazil. After that, the new episodes start, telling abo… more The firt 36 episodes are remade summaries of the first three series (Captain Tsubasa, Shin CT and CT J): Tsubasa’s career with Nankatsu and the different championships in Japan with all the main characters of the series; the U-16 world cup in Europe, as well as Tsubasa’s career with Roberto in Brazil.    After that, the new episodes start, telling about a match against Holland and about the three most extraordinary main characters on their hard but spectacular way to become soccer professionals in Europe: The soccer genius Tsubasa Ozora, the top goalkeeper Genzo Wakabayashi and the pround and strong striker Kojiro Hyuga.',2001,'Action, Shounen, Sports','Completed'),(436,'CardCaptor Sakura','card-captor-sakura','Sakura Kinomoto was an ordinary 4th grader until the day she opened a strange book and let dozens of powerful magic cards loose on the world. Keroberos, the Guardian of the Clow Cards, informs Sakura that it is now her responsibility to find and capture the freed cards. However, much to the reluctant Sakura’s dismay, things aren’t going to be easy… more Sakura Kinomoto was an ordinary 4th grader until the day she opened a strange book and let dozens of powerful magic cards loose on the world. Keroberos, the Guardian of the Clow Cards, informs Sakura that it is now her responsibility to find and capture the freed cards. However, much to the reluctant Sakura’s dismay, things aren’t going to be easy for her; simply saying magic words and waving her wand around isn’t good enough. Each card is a living, thinking, extremely powerful being.    She’ll have to learn to cope with her new responsibilities, as well as ordinary troubles involving love, school, family, and friends. With the support of her friend Tomoyo and a young boy with powers of his own, she must learn how to use her newly awakened magical abilities to collect each card and prevent the disaster that will befall the world if she doesn’t.',1998,'Adventure, Comedy, Drama, Romance, School, Shoujo','Completed'),(437,'Cardcaptor Sakura Movie','cardcaptor-sakura-movie','One day, Kinomoto Sakura, a 4th grader stumbles upon the mysterious book of Clow. Upon opening it and reading the name of The Windy aloud, Sakura scatters the cards to the winds. Sakura is elected and appointed by Keroberos, Guardian of the Cards to capture the remaining cards. With her friend Tomoyo and rival Syaoran, Sakura begins an adventure th… more One day, Kinomoto Sakura, a 4th grader stumbles upon the mysterious book of Clow.    Upon opening it and reading the name of The Windy aloud, Sakura scatters the cards to the winds. Sakura is elected and appointed by Keroberos, Guardian of the Cards to capture the remaining cards. With her friend Tomoyo and rival Syaoran, Sakura begins an adventure that will forever change her.',1999,'Comedy, Fantasy, Magic, Shoujo','Completed'),(438,'CardCaptor Sakura: The Movie','card-captor-sakura-the-movie','Kinomoto Sakura, a Card Captor, wins a game of chance and is awarded a trip to Hong Kong, along with her best friend Tomoyo and her rival, Li Syaoran.    It turns out that the ancient rival of Clow Reed, the creator of the mysterious and powerful Clow Cards, summoned them, and she&#039;s out for revenge. A battle ensues, and secrets are revealed about Clow Reed&#039;s shady past and Sakura&#039;s connection to him.',1999,'Comedy, Fantasy, Magic, Shoujo','Completed'),(439,'Cardcaptor Sakura: The Sealed Card','cardcaptor-sakura-the-sealed-card','Sakura and her classmates in grade 6-2, are all very busy preparing a play for the Nadesico festival. Even though it&#039;s summer holidays, daily rehearsals are keeping everyone very busy. During this time, Sakura unexpectedly runs into Syaoran and Meilin who have suddenly come to visit from Hong Kong.    While Syaoran has already expressed his feelings to Sakura, Sakura hasn&#039;t had a chance to tell Syaoran her true feelings. Sakura determines to tell Syaoran her true feelings but things always go wrong whenever she tries.Best friend, Tomoyo suggests that she, Syaoran, Meilin and Sakura all go to the new amusement park. Just as Sakura thought she could tell Syaoran her true feelings, both she and Syaoran sense a strangely familiar aura; the aura of the original Clow cards. But all the Clow cards have since been sealed and turned into Sakura cards! Yet, one by one the Sakura cards start to disappear.',1998,'Adventure, Comedy, Drama, Magic, Romance, School','Completed'),(440,'Cardfight!! Vanguard','cardfight-vanguard','game that was given to him when he was little. That card is the reason why he begins to engage in Card Fights, something that changes his life drastically. The name of the card game is “Vanguard.” The game takes place in a different planet called “Klay,” and due to a never before seen play system, it becomes popular throughout the world. Aichi, immediately attracted by Vanguard, meets friends such as Togura Misaki and Katsuragi Kamui, along with other rivals.    Through friendly rivalry with them, Aichi begins to enjoy a fulfilling life. Aichi, however, has a goal: to once again battle with a Vanguard Fighter by the name of Kai Tosihki. Kai Toshiki is an aloof and cold-hearted high schooler who has outstanding abilities in the world of Vanguard. He is also the reason why Aichi started playing the game. For him, Toshiki is the person who saved him from his boring life and introduced him to Vanguard. In order to get better at Vanguard, Aichi puts his soul into it every day. He wishes that someday, he’ll be able to battle Toshiki and have him recognize his worth.',2011,'Action, Adventure, Demons, Game, Shounen','Completed'),(441,'Cardfight!! Vanguard G','cardfight-vanguard-g','Taking place after a three-year time skip, the series will follow Shindou Kurono, Kiba Shion, and Anjou Tokoha as the new protagonists of G.Kurono uses the never-before-seen clan Gear Chronicle, which brings together the destinies of these three toward an &quot;impossible future, an impossible self signifying &#039;Generation.&#039;&quot;',2014,'Action, Game, Shounen','Completed'),(442,'Cardfight!! Vanguard G: Gears Crisis Hen','cardfight-vanguard-g-gears-crisis-hen','Second season of Cardfight!! Vanguard G series.',2015,'Action, Game, Shounen','Ongoing'),(443,'Cardfight!! Vanguard: Legion Mate-hen','cardfight-vanguard-legion-mate-hen','Several days after the mortal battle against Link Joker which embroils the whole world, the world has returned to peace. But Kai Toshiki faces a surprising situation. Sendou Aichi, the hero who saved the world from the invasion of Link Joker, has suddenly disappeared. In addition, everyone&#039;s memory about Aichi is lost...Almost all hints have been lost, and Kai starts to search Aichi with &quot;Blaster Blade&quot; and the deck of Royal Paladin, the only existing hint and the proof of their bonds. Kai is approached by fighters who call themselves &quot;Quatre Knights&quot;. The four---Gaillard, Neve, Ratie and Sarah---are fighters with world-class power in vanguard fights. They control mysterious power and urge Kai to give up searching Aichi. What is their purpose...!? And what is their relationship with Aichi...!? Kai, with the new power &quot;Legion&quot; in his hand, fights to take Aichi back. Now, the war has begun!',2014,'Action, Adventure, Demons, Game, Shounen','Completed'),(444,'Carnival Phantasm','carnival-phantasm','This anime is based on Takenashi Eri’s Take Moon manga and commemorates Type-Moon’s 10th anniversary. Various characters from Type-Moon’s works such as Kara no Kyoukai, Fate/Stay Night, and Tsukihime are featured in this.',2011,'Comedy, Parody, Supernatural','Completed'),(445,'Carnival Phantasm – HibiChika Special','carnival-phantasm--hibichika-special','This anime is based on Takenashi Eri’s Take Moon manga and commemorates Type-Moon’s 10th anniversary. Various characters from Type-Moon’s works such as Kara no Kyoukai, Fate/Stay Night, and Tsukihime are featured in this.',2012,'Comedy, Supernatural','Completed'),(446,'Carried by the Wind Tsukikage Ran','carried-by-the-wind-tsukikage-ran','In the Edo or Tokugawa period (1600-1868),Ran,a female wandering samurai whose skill with the katana is only matched by her taste for sake (rice wine),is joined by a chinese martial artist who calls herself Lady Meow of the Iron Cat Fist.Together,these two women face antagonists of all kinds.      [!] Report this episode    Genre:  Comedy',2000,'Adventure, Comedy, Historical, Martial Arts, Shounen','Completed'),(447,'Casshern Sins','casshern-sins-','After decades since the original anime series, the cybernetic warrior returns in this franchise reboot, Casshern Sins. In a world where the powerful robot leader known as Braiking Boss rule over humanity with an iron fist, a mysterious girl named Luna is summoned by the people for salvation. To retaliate against this potential threat, Braiking send… more After decades since the original anime series, the cybernetic warrior returns in this franchise reboot, Casshern Sins. In a world where the powerful robot leader known as Braiking Boss rule over humanity with an iron fist, a mysterious girl named Luna is summoned by the people for salvation. To retaliate against this potential threat, Braiking sends 3 of his most powerful cyborgs, Casshern, Dio and Reda to dispose of her. Casshern manages to kill Luna, plunging the world into a slow descent of annhilation.    Hundreds of years later, humanity is almost extinct. Robots constantly replace their body parts, fearing the corrosion of rust: their only form of death. In this wretched time and place, Casshern returns after a lengthy disappearance since his murder of Luna. Having lost his memory, Casshern now defends the humans from the robots, and find out his true identity and purpose.',2008,'Action, Adventure, Sci-Fi','Completed'),(448,'Cat Shit One','cat-shit-one-movie','The war against terrorism has gone private. War has always been a profitable business, so having private corporations field their own armies to fight against terrorism is just good business. Who else could protect those innocent bunnies from the religiously fervent turbaned camel fanatics.    It falls upon a small cadre of seasoned furry rabbit soldiers to take the battle to the camel&#039;s home turf.Derived from a popular Vietnam-conflict based manga series called Apocalypse Meow , this sequel series uses animal characters to tell the story of the war against terrorism fought in distant countries. Non-human cast of characters notwithstanding, this compelling and painstakingly-researched work places an emphasis on factualism in order to accurately portray the weapons and tactics used by soldiers.',2010,'Action, Fantasy, Military','Completed'),(449,'Cat Shit One','cat-shit-one','Packy and Botasky are members of a private military company, a new form of mercenary system. Somewhere on a desert region, they are on a rescue mission and due to the circumstances they must enter combat immediately.',2010,'Action, Fantasy, Military','Completed'),(450,'Cencoroll','cencoroll','Through a hole in the sky a huge monster suddenly appears, landing on top of a building, prompting the Defence Forces to go into action, panicking the citizens of this peaceful city.    Yuki, a brave-hearted and naturally inquisitive girl, stumbles into a secret. Her recent acquaintance Tetsu has been raising a strange shape-changing creature called Cenco, that he can telepathically control. Yuki, instantly becomes fascinated by Tetsu and quickly develops a bond with his pet.Then a mysterious boy appears with control over the huge monster threatening the town, and he wants Cenco. With that, an unexpected battle begins...',2009,'Action, Sci-Fi','Completed'),(451,'Chaos Dragon: Sekiryuu Seneki','chaos-dragon-sekiryuu-senyaku','In the year 3015, the great nations Donatia and Kouran divide the world in a cold war as they fight for supremacy. Amidst this standoff is the island country Nil Kamui, which has lost its independence. Red Dragon, the guardian god of Nil Kamui, goes out of control. Will the island country manage to regain its independence?',2015,'Action, Fantasy, Supernatural','Completed'),(452,'Chaos Head','chaos-head','Takumi is a high school student. He is withdrawn and is not interested in 3D things. In his town, a mysterious serial murder case happens and people get panicked. One day, when he chats on the internet, a man suddenly contacts him and gives him an URL. He goes to the website and finds a blog image that suggests a next murder case…. On the next da… more Takumi is a high school student. He is withdrawn and is not interested in 3D things.    In his town, a mysterious serial murder case happens and people get panicked. One day, when he chats on the internet, a man suddenly contacts him and gives him an URL. He goes to the website and finds a blog image that suggests a next murder case…. On the next day, it really happens',2008,'Harem, Mystery, Psychological, Sci-Fi, Supernatural','Completed'),(453,'Charady s Daily Joke','charady-s-daily-joke','The story will center on Charady (Misako Yasuda), a fictional 26-year-old woman from San Francisco who graduated from Kyoto University of Art and Design’s Department of Character Design. Charady loves jokes from around the world, and each daily short will present a different joke.',2009,'Comedy','Completed'),(454,'Charlotte','charlotte','The story centers around the special abilities that occur among a small percentage of boys and girls in puberty. Yuu Otosaka uses his power without others knowing, and lives a fairly normal, average school life. Before him suddenly appears a girl, Nao Tomori. Due to his meeting with her, the fate of special power-users will be exposed.',2015,'School, Super Power','Completed'),(455,'Cheeky Angel','cheeky-angel','Megumi-chan is a girl with a secret past. She used to be a boy until she met a person she thought was a magic user. This person gave him/her a magical book from which a genie appears to grant one wish when blood is applied to it. Megumi made the wish to be a man in a man’s body but the genie has a twist: he grants wishes backwards so he turns Megum… more Megumi-chan is a girl with a secret past. She used to be a boy until she met a person she thought was a magic user. This person gave him/her a magical book from which a genie appears to grant one wish when blood is applied to it.    Megumi made the wish to be a man in a man’s body but the genie has a twist: he grants wishes backwards so he turns Megumi-kun aged 9 to Megumi-chan. Years pass and Megumi enters High School where she immediately beats up the school bully who of course falls in love with her. She is looking for that book again to be able to reverse the spell placed upon her.',2002,'Comedy, Magic, Romance, Shounen','Completed'),(456,'Cherry no Manma','cherry-no-manma','Kanoko (nicknamed Nocco) is a young girl, living alone with Yuzuru and Yuki, two young male housekeepers, who could not be more different. While Yuzuru is kind and refined, Yuki is rude and crude. They try to keep their unusual family together in the face of conflict and misunderstanding.',1989,'Comedy, Romance, Shoujo','Completed'),(457,'Chi s New Address','chi-s-new-address','Chi is still living with the Yamada family, but they decide it isn’t fair to force her to hide indoors in their “no pets allowed” apartment. So they decide there is only one thing is to be done, Chi must move away for her own happiness.   ',2009,'Comedy, Kids, Slice of Life','Completed'),(458,'Chi`s Sweet Home','chis-sweet-home','Chii is a kitten that accidentally got separated from its mother, and is now unable to find its way back home. Chii is found by a young boy called Youhei and his father and mother, who then give it a home, but what Chii really wants is to return to its mother.',2009,'Comedy, Kids, Slice of Life','Completed'),(459,'Chibi Devi','chibi-devi','Sawada Honoka is a 14 year old girl who is very timid. She easily gets bullied by other classmates. Honoka is a non-believer in God, Angels, and Devils. Though one day, a devil baby was dropped into her room while she was sleeping. What will Honoka believe in now?',2011,'Fantasy, Shoujo, Supernatural','Completed'),(460,'Chihayafuru','chihayafuru','All her life, Chihaya’s dream was to see her model sister become Japan’s best… That is, until a quiet, unassuming transfer student named Arata tells her otherwise. A dream, he explains to her, is something she needs to work at herself. Arata plays a competitive version of a traditional Japanese card game–known as Hyakunin Isshu–in a way Chihay… more All her life, Chihaya’s dream was to see her model sister become Japan’s best… That is, until a quiet, unassuming transfer student named Arata tells her otherwise. A dream, he explains to her, is something she needs to work at herself.    Arata plays a competitive version of a traditional Japanese card game–known as Hyakunin Isshu–in a way Chihaya has never seen before. After taking Arata’s place in a game, Chihaya discovers she has a passion for it. Now Chihaya wants to become number one in the world, the Queen of Karuta.',2011,'Drama, Game, Josei, Sports','Completed'),(461,'Chihayafuru 2','chihayafuru-2','The wraparound jacket band on the 17th volume of Yuki Suetsugu’s Chihayafuru manga is revealing next week that a second anime season will launch. This story, which follows a schoolgirl competing in the Japanese card game of karuta, won the second Manga Taisho (Cartoon Grand Prize). Chihayafuru also won the sh?jo manga category in last year’s Kodan… more The wraparound jacket band on the 17th volume of Yuki Suetsugu’s Chihayafuru manga is revealing next week that a second anime season will launch.    This story, which follows a schoolgirl competing in the Japanese card game of karuta, won the second Manga Taisho (Cartoon Grand Prize). Chihayafuru also won the sh?jo manga category in last year’s Kodansha Manga Awards, and topped the female category of Takarajimasha’s Kono Manga ga Sugoi! book listings the year before.',2013,'Drama, Game, Josei, Sports','Completed'),(462,'Chihayafuru 2 OVA','chihayafuru-2-ova','The wraparound jacket band on the 17th volume of Yuki Suetsugu’s Chihayafuru manga is revealing next week that a second anime season will launch. This story, which follows a schoolgirl competing in the Japanese card game of karuta, won the second Manga Taisho (Cartoon Grand Prize). Chihayafuru also won the sh?jo manga category in last year’s Kodan… more The wraparound jacket band on the 17th volume of Yuki Suetsugu’s Chihayafuru manga is revealing next week that a second anime season will launch.    This story, which follows a schoolgirl competing in the Japanese card game of karuta, won the second Manga Taisho (Cartoon Grand Prize). Chihayafuru also won the sh?jo manga category in last year’s Kodansha Manga Awards, and topped the female category of Takarajimasha’s Kono Manga ga Sugoi! book listings the year before.',2013,'Comedy, Josei, Slice of Life','Completed'),(463,'Chiisana Ojisan','chiisana-ojisan','Noi Asano’s Chiisai Oyaji Nikki (Tiny Old Man’s Diary) manga will receive a television anime adaptation under the name Chiisana Ojisan starting in October. Kachidoki Studio (Litchi DE Hikari Club, Nukko.) is animating the series, which will premiere on Chiba TV.',2012,'Slice of Life','Completed'),(464,'Chikyuu ga Ugoita Hi','chikyuu-ga-ugoita-hi','January 16, 1995. Tsuyoshi Takahashi, a young student at Shiokaze elementary, is driven solely to get excellent grades. Because of this he often ignores those around him in his pursuit of perfection. Miho, a young girl in his class that wishes he would appreciate the people around him. Kazu a sickly and bed ridden classmate that lives near him. January 17, the 1995 Kobe / Hyogoken-Nanbu Earthquake strikes killing more than 6000 people and leaving 300 000 more homeless. Measuring 6.9 on the Richter Scale, it was the largest Earthquake to hit Japan since the Great Kanto Earthquake of 1923. In the aftermath of the quake, Tsuyoshi&#039;s finds his priorities changing. Dealing with the death of one friend while helping another to cope with a very personal loss, Tsuyoshi is forced to mature into someone who can no longer ignore the suffering around him.',1997,'Drama','Completed'),(465,'Children who Chase Lost Voices','children-who-chase-lost-voices','Strange sounds in the darkness... Unearthly music from an old crystal radio... These are all the warning Asuna Watase has before a simple walk to her clubhouse catapults her into a nightmarish adventure that will take her beneath the Earth to a lost land beyond the realm of legend! Attacked by a strange monstrous creature, rescued by a mysterious stranger and pursued by a relentless enemy, Asuna finds herself enmeshed in a centuries old mystery that will bind her to a strange young defender and lead her inevitably, towards a secret that may hold the key to life itself!',2011,'Adventure, Fantasy, Romance','Completed'),(466,'Chitose Get You!!','chitose-get-you','Chitose is an 11-year-old girl who is madly in love with an older guy named Hiroshi. He works at the town hall right next to the school and Chitose spends every day relentlessly pursuing him. Can Chitose ever convince Hiroshi to go out with her?',2012,'Comedy, Romance, School, Seinen, Slice of Life','Completed'),(467,'Chitose Get You!! OVA','chitose-get-you-ova','Chitose is an 11-year-old girl who is madly in love with an older guy named Hiroshi. He works at the town hall right next to the school and Chitose spends every day relentlessly pursuing him. Can Chitose ever convince Hiroshi to go out with her?',2013,'Comedy, Romance, School, Seinen, Slice of Life','Completed'),(468,'Chobits','chobits','In the future, personal computers have developped into “Persocons”, mobile computers that look like human beings. Hideki Motosuwa, a prep school student, desperately wants to buy a Persocon but cannot afford to. One day he finds a Persocon that has been thrown away and decides to keep it. When he turns on the Persocon, all she can say is “Chii” so… more In the future, personal computers have developped into “Persocons”, mobile computers that look like human beings. Hideki Motosuwa, a prep school student, desperately wants to buy a Persocon but cannot afford to.    One day he finds a Persocon that has been thrown away and decides to keep it. When he turns on the Persocon, all she can say is “Chii” so he decides to name her that. After a while it starts to become apparent that Chii is more than an average Persocon. Having much better performance, it seems that Chii might be a “Chobit”, a type of advanced Persocon rumoured to have independent thought.',2002,'Comedy, Drama, Ecchi, Romance, Sci-Fi, Seinen','Completed'),(469,'Chocotto Sister','chocotto-sister','Haruma Kawagoe is an only child. A long time ago, at Christmastime, his mother miscarried the child that was to have been his baby sister. That night, young Haruma knelt down and offered up an earnest prayer: “Please make my mother well again, and please give me a little sister.” Years have passed, and Haruma has nearly forgotten his prayer. But Sa… more Haruma Kawagoe is an only child. A long time ago, at Christmastime, his mother miscarried the child that was to have been his baby sister.    That night, young Haruma knelt down and offered up an earnest prayer: “Please make my mother well again, and please give me a little sister.” Years have passed, and Haruma has nearly forgotten his prayer. But Santa hasn’t…. one Christmas, when Haruma is least expecting it, he gets an unusual present – his sister.',2006,'Comedy, Drama, Romance','Completed'),(470,'Chokotan! OVA','chokotan-ova','This story is about the dog named Chokotan who has the ability to speak with humans in the human language. Nao, her owner, likes a guy named Arima. Arima has a dog named Hatsupi. On Hatsupi’s birthday, Nao makes biscuits that are edible for both dogs and humans. Nao and Chokotan bump into Arima and Hatsupi on the sidewalk and Nao runs away before s… more This story is about the dog named Chokotan who has the ability to speak with humans in the human language. Nao, her owner, likes a guy named Arima. Arima has a dog named Hatsupi. On Hatsupi’s birthday, Nao makes biscuits that are edible for both dogs and humans.    Nao and Chokotan bump into Arima and Hatsupi on the sidewalk and Nao runs away before she can summon the courage to give the biscuits to Arima. Chokotan encourages Nao and she makes up her mind to go back and give the biscuits to Arima. Now then, will she be able to approach Arima while she’s not even able to talk casually to him? And how about Chokotan’s secret? – The Story about the talking dog and her Owner’s clumsy-love-story!',2013,'Comedy, Shoujo','Completed'),(471,'Choubakuretsu Ijigen Menko Battle: Gigant Shooter Tsukasa','choubakuretsu-ijigen-menko-battle-gigant-shooter-tsukasa','The anime follows Tsukasa, whose dream is to become the best at Gigant Shooter (battles in a game similar to pog) in the world. The menko card his father left for him called King Menger is his partner. Tsukasa&#039;s fellow gamers are the cute but tsundere Koide Miruko, the spectacled bully Numata Manabu, and the realist and sharp-tongued Doumoto Ataru.',2014,'Action, Comedy, Kids','Completed'),(472,'Choujigen Game Neptune: The Animation','choujigen-game-neptune-the-animation-','This is Gamindustri. Beings called the Goddesses rule the countries of this unreal world. The four Goddesses govern four states: Planeptune, Lastation, Lowee, and Leanbox. For many long years, these countries fought each other over the Shares, the source of the Goddess power. However, fearful that the conflict would pointlessly erode their countries’ strength, the Goddesses signed a Friendship Treaty forbidding them from taking Shares by force.    Under the treaty, the Goddesses and their younger sisters took a step forward to a new stage in their relations. It was the dawn of a new, dynamic era marked occasionally by shared laughter, disputes as well cooperation. What does the future hold in store for Gamindustri?',2013,'Action, Comedy, Fantasy, Parody, Sci-Fi, Supernatural','Completed'),(473,'CHOUJIGEN GAME NEPTUNE: THE ANIMATION OVA','choujigen-game-neptune-the-animation-ova','Unaired episode 13 of Choujigen Game Neptune: The Animation, included in the 7th BD/DVD volume.',2014,'Action, Comedy, Fantasy, Sci-Fi','Completed'),(474,'Chousoku Henkei Gyrozetter','chousoku-henkei-gyrozetter','Anime adaptation of a card game which depicts battles between cars that transform into robots.',2012,'Action, Cars, Mecha, Shounen','Completed'),(475,'Chouyaku Hyakuninisshu: Uta Koi','chouyaku-hyakuninisshu-uta-koi','Uta Koi tells the “super-liberal interpretation” of the Hyakuninisshu anthology compiled during Japan’s Heian period of 100 romantic poems from 100 different poets such as The Tale of Genji’s Murasaki Shikibu.',2012,'Historical, Josei, Romance','Completed'),(476,'Chrome Shelled Regios','chrome-shelled-regios','In the distant future, a polluted world has been overtaken by havoc-wreaking creatures called filth monsters. Humanity, having been forced to relocate itself, must live in isolated mobile cities called Regios. A mysteriously skilled fighter named Layfon Alseif enrolls in the Academy city of Zuellni and is immediately noticed by Nina Antalk, leader… more In the distant future, a polluted world has been overtaken by havoc-wreaking creatures called filth monsters. Humanity, having been forced to relocate itself, must live in isolated mobile cities called Regios.    A mysteriously skilled fighter named Layfon Alseif enrolls in the Academy city of Zuellni and is immediately noticed by Nina Antalk, leader of the 17th Military Arts Unit. He then reluctantly joins her squad, uncertain of what future awaits him and his new teammates within the city as well as the impending dangers in the midst of a plagued world',2009,'Action, Adventure, Fantasy, School, Sci-Fi','Completed'),(477,'Chrono Crusade','chrono-crusade','The year is 1928 A.D. The place is New York, U.S.A. The economic prosperity brought forth after the Great War also heightened the presence of something far darker and much more sinister: the demonic Sinners. The Magdalene Order is an organization that tries to counter this force. Two of its exorcists are Rosette Christopher and her assistant, Chron… more The year is 1928 A.D. The place is New York, U.S.A. The economic prosperity brought forth after the Great War also heightened the presence of something far darker and much more sinister: the demonic Sinners.    The Magdalene Order is an organization that tries to counter this force. Two of its exorcists are Rosette Christopher and her assistant, Chrono. Both appear out of place in an organization like this, and they are in a quest to find Rosette’s missing brother, Joshua. Their relationships, secrets and fates can only be revealed in time',2003,'Action, Demons, Romance, Supernatural','Completed'),(478,'Chu Feng: B.E.E','chu-feng-b-e-e','In 2017, a group of genius scientists achieve a remarkable breakthrough in bioengineering. However, all the new technologies are put into military use, beginning a new round of arms race. Vanguards, as the most significant achievement of the modern bioengineering and the most advanced weapon, are widely utilized in the race. Although vanguards are exceptionally combat-effective, their life expectancy is shortened by the nanomachines they use. Usually, most vanguards will retire from the army after a number of years in service.    The heroine Liuli has also consumed too much of her lifespan after executing missions for a long time. With only 380 days left in her life, Liuli receives a new mission, to rescue a hostage being held in a civilian facility. It is without doubt a difficult mission for a vanguard like Liuli, who only knows how to kill and battle. However, Liuli obediently decides to accept the mission in the end.    During the mission, Liuli surprisingly finds that the man who holds the hostage was once a vanguard. The former vanguard Zhongrong Zhou cries and asks the government to hand over the son of Eden. As a vanguard, Liuli feels deep contempt against Zhou. To eliminate the scum of the vanguards, a battle between two vanguards begins...',2015,'Action, Comedy, Fantasy, Mecha, Romance, School, Sci-Fi','Ongoing');
